INSERT INTO `information` VALUES (8,'Top Categories','top-categories',NULL,'2020-04-30 14:59:11','2020-10-10 04:09:27',NULL,NULL,NULL,0,NULL,NULL,0,NULL,'40','40',NULL),(9,'Information','information',NULL,'2020-04-30 14:59:27','2021-02-18 22:12:18',NULL,NULL,NULL,0,NULL,NULL,0,NULL,NULL,NULL,NULL),(10,'Legal','legal',NULL,'2020-04-30 14:59:42','2020-05-02 22:33:21',NULL,NULL,NULL,1,NULL,NULL,0,NULL,NULL,NULL,NULL),(13,'Men','men',NULL,'2020-04-30 15:39:30','2020-10-27 15:50:31',8,NULL,'https://www.theluxurysale.com/products/men',0,NULL,NULL,0,NULL,'30','50',NULL),(14,'Women','women',NULL,'2020-04-30 15:40:00','2020-10-27 15:51:31',8,NULL,'https://www.theluxurysale.com/products/women',0,NULL,NULL,0,NULL,'50','50',NULL),(16,'About us','about-us','<p>We are Nigeria&#39;s largest luxury online store, we have been working for 10 years with high-end fashion stores, and now we have a clear purpose. We want you to feel luxury all around you, giving you access to a huge assortment of the best historical brands and very rare and antique items at the best possible price.</p>\r\n\r\n<p>Our website is easy to browse, user friendly, and very secure, you can subscribe to our newsletters, you will constantly receive the latest updates, and our best offers and sensitive data will be protected and will not be shared with any other third parties.</p>\r\n\r\n<p>Enjoy THELUXURYSALE &amp; Thanks.</p>','2020-04-30 15:44:35','2021-03-08 02:14:56',9,NULL,NULL,0,NULL,NULL,0,'https://www.theluxurysale.com/images/banners/yeNAwmAFsCflWhM3cjO9dxlJGXTlrV2OJsqL6EN2.jpeg',NULL,NULL,NULL),(17,'Shipping & Delivery','shipping-delivery','<div>\r\n<div class=\"_4de54_bOq9e\">\r\n<div class=\"ed8f5_2tEMb\">\r\n<div class=\"_0d805_fXlwk\">\r\n<div class=\"_59b41_1SDd-\" id=\"section-1\">\r\n<ul>\r\n	<li>\r\n	<h2>How much are the delivery charges?</h2>\r\n	</li>\r\n</ul>\r\n\r\n<div class=\"b2076_VX1cQ\">\r\n<p>Products sold directly by Theluxurysale are purchased from authorized distributors. Some of the Products are covered under a manufacturer warranty.</p>\r\n\r\n<p>We also offer a standard 7 day return policy for eligible items in case you need to make a return.</p>\r\n\r\n<p>To return any items bought on Theluxurysale.com, ensure the item is in line with the conditions in the Return Policy. All items have free insurance coverage against theft and damage during transit.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_59b41_1SDd-\" id=\"section-2\">\r\n<ul>\r\n	<li>\r\n	<h2>Are all items purchased online covered by warranty?</h2>\r\n	</li>\r\n</ul>\r\n\r\n<div class=\"b2076_VX1cQ\">\r\n<p>Products sold directly by Theluxurysale are purchased from authorized distributors. Some of the Products are covered under a manufacturer warranty.</p>\r\n\r\n<p>We also offer a standard 7 day return policy for eligible items in case you need to make a return.</p>\r\n\r\n<p>To return any items bought on Theluxurysale.com, ensure the item is in line with the conditions in the Return Policy.</p>\r\n\r\n<p>All items have free insurance coverage against theft and damage during transit.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_59b41_1SDd-\" id=\"section-3\">\r\n<ul>\r\n	<li>\r\n	<h2>How will the delivery be done?</h2>\r\n	</li>\r\n</ul>\r\n\r\n<div class=\"b2076_VX1cQ\">\r\n<p>We process most of our deliveries through DHL, OHRAM LOGISTICS, GIG Logistics, USPS.</p>\r\n\r\n<p>We recommend you pre-pay to Theluxurysale.com (via Paystack, or Bank Deposit/Transfer) for your order in order to take advantage of our Buyer Protection Program.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_59b41_1SDd-\" id=\"section-4\">\r\n<ul>\r\n	<li>\r\n	<h2>What is the estimated delivery time?</h2>\r\n	</li>\r\n</ul>\r\n\r\n<div class=\"b2076_VX1cQ\">\r\n<p>Standard delivery time is 24 hours however, this may vary by location and even product.</p>\r\n\r\n<p>Delivery time for products are usually indicated on the product detail page.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_59b41_1SDd-\" id=\"section-5\">\r\n<ul>\r\n	<li>\r\n	<h2>Does Theluxurysale deliver internationally?</h2>\r\n	</li>\r\n</ul>\r\n\r\n<div class=\"b2076_VX1cQ\">\r\n<p>Theluxurysale.com deliver items internationally.</p>\r\n\r\n<p>You are more than welcome to make your purchases on our site from anywhere in the world.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_59b41_1SDd-\" id=\"section-6\">\r\n<ul>\r\n	<li>\r\n	<h2>What about warranty &amp; hidden costs?</h2>\r\n	</li>\r\n</ul>\r\n\r\n<div class=\"b2076_VX1cQ\">\r\n<p>There are no extra taxes, hidden costs or additional dispatch charges.</p>\r\n\r\n<p>The price mentioned on the website is the final price, what you see is what you pay. Our prices are all inclusive, all taxes are included with the list prices.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_59b41_1SDd-\" id=\"section-7\">\r\n<ul>\r\n	<li>\r\n	<h2>Can my order be delivered the same day I order?</h2>\r\n	</li>\r\n</ul>\r\n\r\n<div class=\"b2076_VX1cQ\">\r\n<p>Yes it can. However, this depends on the product ordered and the location for delivery. You can identify such products at checkout.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2020-04-30 15:45:12','2020-12-13 14:39:18',9,NULL,NULL,0,NULL,NULL,0,NULL,NULL,NULL,NULL),(19,'Contact Us','contact-us','<div class=\"col-contact-info col-sm-6 col-xs-12\">\r\n<h4>Contact Information</h4>\r\n\r\n<p>If you would like to talk to us about your order or you have a question, please get in touch. Fill in our contact form and we&rsquo;ll get right back to you.<br />\r\nWhether you&rsquo;re looking to discuss a new fashion project or simply say hello, we&rsquo;d love to hear from you.</p>\r\n\r\n<h4>Phone:</h4>\r\n\r\n<p>+2349043111111, WAT Zone</p>\r\n\r\n<h4>Email:</h4>\r\n\r\n<p><a href=\"mailto:info@theluxurysale.com\">info@theluxurysale.com</a></p>\r\n</div>\r\n\r\n<div class=\"col-sm-6 col-xs-12 form-area\"><div class=\"page-title\"><h1>Contact Us</h1></div> <form action=\"/contact/store\" id=\"contact-form\" method=\"post\" class=\"form-group\"><div class=\"bold field\">Name\r\n<div class=\"control\"><input name=\"full_name\" required=\"required\" type=\"text\" class=\"form-control\"></div></div> <div class=\"bold required\">Email\r\n<div class=\"control\">\r\n<input name=\"email\" required=\"required\" type=\"email\" class=\"form-control\"></div></div> \r\n \r\n<div class=\"bold comment required\">What’s on your mind?\r\n<div class=\"control\"><textarea name=\"comment\" required=\"required\" rows=\"8\" class=\"form-control\"></textarea></div></div> <div class=\"form-footer text-right\"><button type=\"submit\" class=\"btn btn-rose btn-round  btn-fill\">Submit</button></div></form></div>','2020-04-30 15:46:00','2020-12-21 19:45:24',9,NULL,NULL,0,NULL,NULL,0,NULL,NULL,NULL,NULL),(27,'Sounds & Tvs','sounds-tvs','<p>fdsfg</p>','2020-05-02 22:43:08','2020-12-15 13:20:45',8,1,'https://www.theluxurysale.com/products/sounds-tvs',0,NULL,NULL,0,NULL,NULL,NULL,NULL),(28,'Interiors','interiors','<p>dfgfhg</p>','2020-05-02 22:44:11','2020-12-15 13:22:27',8,1,'https://www.theluxurysale.com/products/interiors',0,NULL,NULL,0,NULL,NULL,NULL,NULL),(30,'Terms & Conditions','terms-conditions','<h2 style=\"font-style:normal; text-align:start\"><strong><span style=\"font-size:16pt\"><span style=\"color:#434343\">TERMS OF SERVICE</span></span></strong></h2>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">Please carefully read the following Terms of Use before using the <a href=\"http://Theluxurysale.com\">Theluxurysale.com</a> Website (the &ldquo;Site&rdquo;). By accessing this Site, you agree to be bound by these Terms of Use. These Terms of Use may be updated from time to time. Accordingly, you should check the date of the Terms of Use (which appear at the end of this document) and review any changes since the last version. If at any time you do not agree to these Terms of Use, please do not use this Site.</span></span></p>\r\n\r\n<p style=\"text-align