pan></p>\r\n\r\n<h2 style=\"font-style:normal; text-align:start\">&nbsp;</h2>\r\n\r\n<h2 style=\"font-style:normal; text-align:start\"><strong><span style=\"font-size:16pt\"><span style=\"color:#434343\">PRIVACY</span></span></strong></h2>\r\n\r\n<h3 style=\"color:#222222; font-style:normal; text-align:start\"><strong><span style=\"font-size:14pt\"><span style=\"color:#434343\">What information do we collect?</span></span></strong></h3>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">We collect information from you when you register on our site or subscribe to our newsletter.</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address, mailing address, phone number or credit card information. You may, however, visit our site anonymously.</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">Google, as a third party vendor, uses cookies to serve ads on your site. Google&rsquo;s use of the DART cookie enables it to serve ads to your users based on their visit to your sites and other sites on the Internet. Users may opt out of the use of the DART cookie by visiting the Google ad and content network privacy policy.</span></span></p>\r\n\r\n<h3 style=\"color:#222222; font-style:normal; text-align:start\"><strong><span style=\"font-size:14pt\"><span style=\"color:#434343\">What do we use your information for?</span></span></strong></h3>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">Any of the information we collect from you may be used in one of the following ways:</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To personalize your experience</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">(your information helps us to better respond to your individual needs)</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To improve our website</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">(we continually strive to improve our website offerings based on the information and feedback we receive from you)</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To improve customer service</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">(your information helps us to more effectively respond to your customer service requests and support needs)</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To process transactions</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested.</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To administer a contest, promotion, survey or other site feature</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">&ndash;To send periodic emails</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">The email address you provide for order processing, will only be used to send you information and updates pertaining to your order.</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">Note: If at any time you would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.</span></span></p>\r\n\r\n<h2 style=\"font-style:normal; text-align:start\"><strong><span style=\"font-size:14pt\"><span style=\"color:#434343\">How do we protect your information?</span></span></strong></h2>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information.</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">We offer the use of a secure server. All supplied sensitive/credit information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway providers database only to be accessible by those authorized with special access rights to such systems and are required to keep the information confidential.</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">After a transaction, your private information (credit cards, social security numbers, financials, etc.) will not be stored on our servers.</span></span></p>\r\n\r\n<h2 style=\"font-style:normal; text-align:start\"><strong><span style=\"font-size:14pt\"><span style=\"color:#434343\">Do we use cookies?</span></span></strong></h2>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">Yes (Cookies are small files that a site or its service provider transfers to your computer&rsquo;s hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information</span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">We use cookies to help us remember and process the items in your shopping cart and understand and save your preferences for future visits.</span></span></p>\r\n\r\n<h2 style=\"font-style:normal; text-align:start\"><strong><span style=\"font-size:14pt\"><span style=\"color:#434343\">Do we disclose any information to outside parties?</span></span></strong></h2>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or other rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.</span></span></p>\r\n\r\n<h2 style=\"font-style:normal; text-align:start\"><strong><span style=\"font-size:14pt\"><span style=\"color:#434343\">Online Privacy Policy Only</span></span></strong></h2>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">This online privacy policy applies only to information collected through our website and not to information collected offline.</span></span></p>\r\n\r\n<h2 style=\"font-style:normal; text-align:start\"><strong><span style=\"font-size:14pt\"><span style=\"color:#434343\">Your Consent</span></span></strong></h2>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">By using our site, you consent to our web site privacy policy.</span></span></p>\r\n\r\n<h2 style=\"font-style:normal; text-align:start\"><strong><span style=\"font-size:14pt\"><span style=\"color:#434343\">Changes to our Privacy Policy</span></span></strong></h2>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">If we decide to change our privacy policy, we will post those changes on this page.</span></span></p>\r\n\r\n<h2 style=\"font-style:normal; text-align:start\"><strong><span style=\"font-size:14pt\"><span style=\"color:#434343\">Contacting us</span></span></strong></h2>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">If you have any questions or comments about these Terms of Use or this site, please contact us by email: </span></span><a href=\"mailto:info@theluxurysale.com\">info@theluxurysale.com</a><span style=\"font-size:10pt\"><span style=\"color:#434343\"> </span></span></p>\r\n\r\n<p style=\"text-align:start\"><span style=\"font-size:10pt\"><span style=\"color:#434343\">This site is owned and operated by THELUXURYSALE LIMITED.</span></span></p>\r\n\r\n<p style=\"text-align:start\">Regards</p>','2020-05-03 15:05:55','2020-12-14 13:01:24',10,1,NULL,0,NULL,NULL,0,NULL,NULL,NULL,NULL),(66,'FAQs','faqs','<p>Faq</p>','2020-11-28 17:32:41','2020-11-28 17:32:41',9,10,NULL,0,NULL,NULL,0,NULL,NULL,NULL,NULL),(67,'Privacy Policy','privacy-policy','<h2>Who we are</h2>\r\n\r\n<p><br />\r\nOur website address is: <a href=\"https://www.theluxurysale.com.\">https://www.theluxurysale.com.</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PRIVACY POLICY</strong></p>\r\n\r\n<p>Thank you for visiting our website for THELUXURYSALE.COM, which is owned by THELUXURYSALE LIMITED. We are committed to providing an exciting and safe online shopping experience and elevated level of personal service synonymous with LUXURYSALE. This commitment includes respecting and protecting the privacy of your personal information.</p>\r\n\r\n<p>This privacy policy describes the types of information we collect from and about you when you visit our website (each a &quot;Site&quot;), use our mobile applications (each an &quot;App&quot;), visit or make a purchase at our stores (each a &quot;Store&quot;), or otherwise contact or interact with us offline (&quot;Offline Services&quot;). The Sites, Apps, Stores, and Offline Services are collectively referred to as the &quot;Services.&quot; This privacy policy also explains how THELUXURYSALE may use and share your personal information, as well as your ability to control certain uses of it.</p>\r\n\r\n<p>By using the Services, you agree to the collection, use, and disclosure of your information as described in this privacy policy, and agree to the Terms of Use which are incorporated by reference. If you do not agree, please do not access or use the Services.</p>\r\n\r\n<p>&lt;strong&gt;FREQUENTLY ASKED QUESTIONS&lt;/strong&gt;</p>\r\n\r\n<p>&lt;strong&gt;Q: What information does THELUXURYSALE collect?&lt;/strong&gt;</p>\r\n\r\n<p>A: THELUXURYSALE may collect information from or about you in a number of ways. Please note that if you decline to provide any of the requested information (whether or not required), you may not be able to take full advantage of the Services and their features or make a purchase from us:</p>\r\n\r\n<p>&lt;strong&gt;From THELUXURYSALE&#39;s Interactions With You&lt;/strong&gt;: We collect information from and about you and your transactions and other interactions with us. This may include when you use the Services, create an online account with us, make a purchase, sign up for our catalogue, newsletters or email lists, participate in sweepstakes, contests or other promotions, participate in a product review, survey, or other similar programs, send a gift or virtual gift card to a person, or otherwise contact us. The personal information we collect may include your name, address, email address, telephone number, or other contact information, loyalty program membership information, gender, birthday, age, other demographic information, your interests, and preferences.</p>\r\n\r\n<p>If you make a purchase from us, we may also collect a credit or debit card number or other financial information, CVV, and billing address.</p>\r\n\r\n<p>If you download one of our Apps, you may choose to permit the App to obtain your precise geolocation. In this case, we will determine your zip code from the precise location data received from your mobile device. We do not store precise location data; we only store the zip code associated with the location.</p>\r\n\r\n<p>&lt;strong&gt;Automatically on the Site or App&lt;/strong&gt;: We, or our service providers, may use cookies, web beacons/pixel tags, log files, and other technologies to collect certain non-personal information about visitors to our Site or App, users of our online services, and interactions with our emails and online advertisements, and to allow THELUXURYSALE to keep track of analytics and certain statistical information. For example, we may collect information such as your browser type, operating system type or mobile device model, viewed webpages, links that are clicked, IP address, mobile device identifier or other unique identifier, sites or apps visited before coming to our Site or App, the amount of time you spend viewing or using the Site or App, the number of times you return, or other click-stream or site usage data, emails we send that you open, forward, or click through to our Site or App. Collecting this information, and linking it with your personal information, helps us to tailor our Site and App and enhance your online shopping experience by saving your preferences while you are visiting a particular Site or App, and to help identify Ssite or App features, promotions, advertisements, and offers that may be of particular interest to you and retarget online and mobile advertisements to you across computers or devices you may use.</p>\r\n\r\n<p>&lt;strong&gt;Q: What are my Tracking Options?&lt;/strong&gt;</p>\r\n\r\n<p>A: Certain parts of the Site and App require cookies. You can set your browser or operating system settings to limit certain tracking or to decline cookies, but by doing so, you may not be able to use certain features on the Site or App or take full advantage of all of our offerings. Please refer to your Web browser&#39;s or operating system&#39;s website or &quot;Help&quot; section for more information on how to delete and/or disable your browser or operating system from receiving cookies or controlling your tracking preferences.</p>\r\n\r\n<p>Our system may not respond to Do Not Track requests or headers from some or all browsers. We may use cookies or other technologies to deliver more relevant advertising and to link data collected across other computers or devices that you may use. To understand your choices for receiving more relevant advertising or to manage your settings, please review the information below:</p>\r\n\r\n<p>To learn more about managing your privacy and storage settings and opting out from receiving third party advertiser cookies, you may visit the Network Advertising Initiative&#39;s opt-out page at http://www.networkadvertising.org/managing/opt_out.asp.<br />\r\nIf you wish to prevent your data from being used by Google Analytics, Google has developed the Google Analytics opt-out browser add-on available at https://tools.google.com/dlpage/gaoptout/.<br />\r\nOn your mobile device, you may also adjust your privacy and advertising settings to control whether you want to receive more relevant advertising.</p>\r\n\r\n<p>&lt;strong&gt;Q: How does THELUXURYSALE use the information collected?&lt;/strong&gt;</p>\r\n\r\n<p>A: THELUXURYSALE may use the information we collect from and about you for any of the following purposes:</p>\r\n\r\n<p>To validate, confirm, verify, deliver, install, and track your order (including to process payment card transactions, arrange for shipping, handle returns and refunds, maintain a record of the purchases you make, and contact you about your orders, including by telephone) or to service products you purchased from us.<br />\r\nTo enhance your online shopping experience, including as a way to recognize you and welcome you to the Site or App.<br />\r\nTo send you catalogs, information, newsletters, promotional materials and other offerings from THELUXURYSALE or on behalf of our partners and affiliates.<br />\r\nTo provide you with customized Site or App content, targeted offers, promotions and advertising on the Site or App, through other third party sites or apps, or via email, text messages, or App push notifications that are offered by THELUXURYSALE or other marketing partners that might be of interest to you.<br />\r\nTo improve our sites, products/services, customer service, and customer shopping experience.<br />\r\nTo use your data in an aggregated non-specific format for analytical and demographic purposes.<br />\r\nTo protect the security or integrity of the Site and our business, such as by protecting against and preventing fraud, unauthorized transactions, claims and other liabilities, and managing risk exposure, including by identifying potential hackers and other unauthorized users.<br />\r\nTo contact you when necessary or requested, including responding to your questions and comments and providing customer support.<br />\r\nAs otherwise described to you at the point of data collection.</p>\r\n\r\n<p>&lt;strong&gt;Q: What information does THELUXURYSALE share with others?&lt;/strong&gt;</p>\r\n\r\n<p>A: THELUXURYSALE will never sell or rent your personal information to third parties. THELUXURYSALE may share personal information we collect from and about you in the following ways:</p>\r\n\r\n<p>Co-Marketing Partners: Certain areas of the Services may be provided to you in association with third parties, such as companies that provide products and services, rewards programs, conduct joint sales programs (such as our Boutique Services in our stores), sweepstakes, promotional campaigns, and other jointly sponsored events. Such Services will identify the third party. If you elect to register for any products and/or services provided during the Services, you either will be providing your information to both THELUXURYSALE and such third party, or SAKS OFF 5TH might share your information directly with such third party for that third party to fulfill their products and our products and services directly with you.</p>\r\n\r\n<p>Other Third Parties: THELUXURYSALE may share your information with select partners, affiliates, and other third parties that we believe may have offers or be of interest to you.</p>\r\n\r\n<p>&lt;strong&gt;Q: How can I view, update or remove my information?&lt;/strong&gt;</p>\r\n\r\n<p>A: If you have registered for an account or made a purchase, you may view and update your account information by logging into the &quot;Your Account&quot; section of the Site or App with your email address and password. Once logged in, you can view or update your name, address, telephone number or email address. You can also contact our Customer Service Department via email at service@saksoff5th.com to access or update any of this information.</p>\r\n\r\n<p>If you would like to remove or delete your profile or the personal information that SAKS OFF 5TH has collected from or about you, please contact our Customer Service Department via email at customerservice@theluxurysale.com. We will process your request within a reasonable period of time. Any information that you previously posted may still be publicly viewable.</p>\r\n\r\n<p>Residents of certain countries, including European Union member states (and the United Kingdom), may have additional rights listed under ?What if I live outside Nigeria??</p>\r\n\r\n<p>&lt;strong&gt;Q: What choices do I have about receiving communications from THELUXURYSALE?&lt;/strong&gt;</p>\r\n\r\n<p>A: To receive promotional offers from the Hudson&#39;s Bay Company family of affiliated companies, you can sign up on our Site or App or contact a Customer Service representative. If you register for an account or make a purchase, you will automatically receive promotional emails and direct mail from THELUXURYSALE. We provide our customers with the opportunity to &quot;opt out&quot; of having their information used for purposes not directly related to placement, processing, fulfillment or delivery of a product order. We provide you with the following options if you prefer to &quot;opt out&quot; of receiving information or materials that we think may be of interest to you:</p>\r\n\r\n<p>&lt;strong&gt;Q: What about security?&lt;/strong&gt;</p>\r\n\r\n<p>A: We have taken certain physical, administrative, and technical steps to safeguard the information we collect from and about our customers and Site visitors. While we make every effort to help ensure the integrity and security of our network and systems, we cannot guarantee our security measures. When you enter sensitive information (such as credit card information) on our forms, we encrypt the transmission of that information using secure socket layer technology (SSL).</p>\r\n\r\n<p>&lt;strong&gt;Q: For how long and where is my data stored?&lt;/strong&gt;</p>\r\n\r\n<p>A: Your personal information may be stored for as long as is reasonably necessary to perform the purposes listed under &quot;How does THELUXURYSALE use the information collected?&quot; For example, if you create an online account with us, we will store any personal information associated with your account for as long as you maintain that account. If you make a purchase, we will store any personal information associated with that purchase to fulfill the order and process any returns. Your personal information is subject to the laws of the United States. The servers and databases in which information may be stored may be located outside the country from which you accessed the Services and in a country where the data protection and other laws may differ from your country of residence. Your personal information may be disclosed in response to inquiries or requests from government authorities or to respond to judicial process in the countries in which we operate.</p>\r\n\r\n<p>In addition, residents of certain countries, including European Union member states (and the United Kingdom), have some or all of the following rights with respect to personal information collected from and about them on the Services: the right to request access to, and the correction, erasure, and/or restriction of processing of, such personal information; in some instances, the right to object to the processing of such personal information; in some instances, the right to request that THELUXURYSALEexport, in a structured, commonly used, and machine readable format, and transmit to another controller, such personal information; and the right to withdraw, at any time, any consent to the processing of such personal information. To exercise these rights, please contact THELUXURYSALE via email at <a href=\"mailto:info@theluxurysale.com\">info@theluxurysale.com</a></p>\r\n\r\n<p>&lt;strong&gt;Q: How does does THELUXURYSALE communicate changes to this Policy&lt;/strong&gt;?</p>\r\n\r\n<p>A: Any changes to our Privacy Policy will be noted on the home page of the Site and App with a link to the revised Privacy Policy. Your continued use of the Site or App following posting of changes to these terms will mean you accept these changes. If we change the Privacy Policy in any material way, we will provide appropriate notice to you.</p>','2020-11-28 17:38:02','2020-12-14 13:06:38',10,NULL,NULL,0,NULL,NULL,0,NULL,NULL,NULL,NULL);
