s',NULL,8,NULL,NULL,NULL,NULL,'<p>Bring a stylish flair to your wardrobe this season with Fendi&rsquo;s latest footwear collection. A more minimal and classic choice, these back leather square toe Chelsea boots from Fendi feature a pull-on style, an ankle length, elasticated side panels, a square toe and a chunky low heel.</p>\r\n\r\n<ul>\r\n	<li>Made in Italy</li>\r\n</ul>\r\n\r\n<h4>Composition</h4>\r\n\r\n<ul>\r\n	<li>Lining: Calf Leather 100%</li>\r\n	<li>Outer: Calf Leather 100%</li>\r\n	<li>Sole: Leather 100%, Rubber 100%</li>\r\n	<li>Designer Style ID:&nbsp;7U1265A8PD</li>\r\n</ul>',2,NULL,'WZGP6V',NULL,NULL,1,1,1,'2020-11-30 19:53:56','2020-11-30 19:53:56',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(385,'Model 0 Sneakers','model-0-sneakers',NULL,36,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Lace-up</li>\r\n	<li>Upper 54% Cotton, 46% Linen&nbsp;</li>\r\n	<li>Sole 100% Elasthane</li>\r\n</ul>',2,NULL,'Y7T52I',NULL,NULL,1,1,1,'2020-11-30 20:12:28','2020-11-30 20:12:28',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44'),(386,'Allover Logo Triple S Sneakers','allover-logo-triple-s-sneakers',NULL,11,NULL,NULL,NULL,NULL,'<p>Composition:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>60% Polyurethane, 28% Polyester, 12% Nylon</p>\r\n\r\n<ul>\r\n	<li>100% non leather sneaker</li>\r\n	<li>Double foam and mesh sneakers</li>\r\n	<li>Allover logo printed</li>\r\n	<li>The logos are placed randomly</li>\r\n	<li>Embroidered size at the edge of the toe</li>\r\n	<li>Embroidered logo on the side</li>\r\n	<li>Embossed logo in the back</li>\r\n	<li>Triple S rubber branding on the tongue</li>\r\n	<li>2 laces loops including 1 functional</li>\r\n	<li>Athletic lacing system featuring 12 fabric eyelets</li>\r\n	<li>Bicolor laces</li>\r\n	<li>1 additional pair of laces included</li>\r\n	<li>Back pull-on tab and tongue pull-on tab</li>\r\n	<li>Made in China</li>\r\n	<li>Wipe with a soft cloth</li>\r\n	<li>The item comes with a Balenciaga dustbag and box</li>\r\n</ul>',2,NULL,'tpMUd2',NULL,NULL,1,0