nditions in the product photography.All goods purchased through Darveys.com are subject to warranty/exchange provided by the entities selling on Darveys.com. The brand owner and their channel partners are not responsible for warranty/exchange of goods purchased through Darveys.com.This being a final sale item, we will not be able to accept any return and exchange against the same.</p>',2,NULL,'IED29s',NULL,NULL,1,0,1,'2020-12-01 02:56:33','2020-12-01 02:56:33',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44'),(390,'Floral Logo Print T-shirt Black','floral-logo-print-t-shirt-black',NULL,2,NULL,NULL,NULL,NULL,'<ul>\r\n	<li><strong>Designed for a relaxed, boxy fit</strong></li>\r\n	<li><strong>Advised to take a size down</strong></li>\r\n	<li>Colour: Black</li>\r\n	<li>Composition: 100% cotton</li>\r\n	<li>Care:&nbsp;Machine wash</li>\r\n	<li>Red printed logos on the front and back.</li>\r\n	<li>Lightweight cotton jersey</li>\r\n</ul>',2,NULL,'TMtPLi',NULL,NULL,1,0,1,'2020-12-01 03:03:46','2020-12-01 03:03:46',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'M'),(391,'Velvet Logo Loafers','velvet-logo-loafers',NULL,22,NULL,NULL,NULL,NULL,'<p>Dolce &amp; Gabbana&#39;s classic men&#39;s footwear is expertly crafted from the finest artisan techniques in Italy. Presenting a slip-on style, these black velvet logo loafers from Dolce &amp; Gabbana boast a flat heel, a branded insole, a round toe and a signature embroidered gold-tone brand insignia.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Lining: Viscose 100%, Leather 100%</p>\r\n\r\n<p>Sole: Leather 100%</p>\r\n\r\n<p>Outer: Velvet 100%</p>',2,NULL,'Ajhtj6',NULL,NULL,1,0,1,'2020-12-01 03:16:00','2020-12-01 03:16:00',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44'),(392,'Leather Runner Sneakers','leather-runner-sneakers',NULL,25,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Off-white Dior Oblique printed canvas and mesh upper</li>\r\n	<li>Low-top silhouette</li>\r\n	<li>Mesh and leather upper</li>\r\n	<li>Lace-up style</li>\r\n	<li>Padded insole</li>\r\n	<li>Rubber sole with textured &#39;Dior&#39; logo</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'oz5H09',NULL,NULL,1,0,1,'2020-12-01 10:52:46','2020-12-01 10:52:46',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(393,'White & Red Logo Patch \'Ace\' Sneakers','white-red-logo-patch-ace-sneakers',NULL,16,NULL,NULL,NULL,NULL,'<h2><span style=\"font-size:14px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Worn by Gucci Mane in the &#39;Muwop&#39; music video. These Gucci &#39;Ace&#39; Sneakers feature a white leather upper; red leather interlocking &#39;GG&#39; logo patch on the later side; tonal lace front; blue leather heel counter with gold-tone logo print; &amp; white sole.</span></span></h2>',2,NULL,'EnVBbp',NULL,NULL,1,0,1,'2020-12-01 11:04:23','2021-03-14 23:09:40',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(394,'White Smooth Calfskin and Suede','white-smooth-calfskin-and-suede',NULL,12,NULL,NULL,NULL,NULL,'<p>The B01 sneaker is a classic in the Dior Men wardrobe. Crafted in white and black&nbsp;smooth calfskin with off-white suede detailing, it is adorned with the &#39;DIOR HOMME B01&#39; signature on the side with the emblematic House bee on the back. A lace-up front, textured tongue, and white rubber sole meet for a casual look. It can be worn with jeans or suit pants.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>White and black smooth calfskin</li>\r\n	<li>Off-white suede detailing on the front</li>\r\n	<li>Textured tongue with &#39;CD&#39; signature</li>\r\n	<li>Perforated side with &#39;DIOR HOMME B01&#39; signature</li>\r\n	<li>Printed bee signature on the heel</li>\r\n	<li>Low-top</li>\r\n	<li>Lace-up closure</li>\r\n	<li>Leather and nylon lining</li>\r\n	<li>White rubber outsole with &#39;DIOR HOMME&#39; signature</li>\r\n	<li>Welded construction</li>\r\n	<li>Dust bag included</li>\r\n	<li>Normal fit, please choose your regular shoe size</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'2yZFiZ',NULL,NULL,1,0,1,'2020-12-01 14:30:42','2020-12-01 14:34:58',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41,44.5'),(395,'Neon Canvas and Suede Sneakers','neon-canvas-and-suede-sneakers',NULL,26,NULL,NULL,NULL,NULL,'<p>Typically a hue reserved for performance and safety gear, the neon-yellow of Off-White&#39;s sneakers is what some might call &#39;lit&#39;. Combining canvas and smooth suede, the uppers are decorated with signature arrows and rest on heavy-duty vulcanised rubber soles. A pair this bright couldn&#39;t possibly go unnoticed.</p>',2,NULL,'nF27Qm',NULL,NULL,1,0,1,'2020-12-01 14:40:08','2020-12-01 14:40:08',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'45'),(396,'side zip sneakers','side-zip-sneakers',NULL,35,NULL,NULL,NULL,NULL,'<p>Black leather side zip sneakers from Giuseppe Zanotti featuring a logo plaque, a round toe, a side zip fastening and a ridged rubber sole.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Outer: Leather 100%</p>\r\n\r\n<p>Lining: Leather 100%</p>\r\n\r\n<p>Sole: Rubber 100%</p>',2,NULL,'jc9Xmg',NULL,NULL,1,0,1,'2020-12-01 14:44:50','2021-03-14 23:21:56',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(397,'Black Drivers with Gold Trimmings','black-drivers-with-gold-trimmings',NULL,38,NULL,NULL,NULL,NULL,'<p>This is a classical black&nbsp;drivers for today&rsquo;s fashion savvy gentleman, made by John Galliano. This very stylish driving shoes with a gold detail on top is the definition of Class and Comfort. Made from the finest of Leather. A staple for any Closet.</p>\r\n\r\n<p>The padded leather lining preserves the&nbsp;interior of the shoe and the cushioned leather insole soothingly comforts your feet as you walk. Beautifully&nbsp;designed with pebbled rubber studded sole which extends up to the back heel.</p>\r\n\r\n<p>This drivers&nbsp;can be worn with any kind of clothing; shorts, trousers, jeans and for all occasions, except a formal outing. Make this drivers a necessary addition&nbsp;to your casual attire.</p>',2,NULL,'2PGsDC',NULL,NULL,1,0,1,'2020-12-01 15:25:19','2020-12-01 15:48:30',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42,46'),(398,'Black Spiked London Sneakers','black-spiked-london-sneakers',NULL,35,NULL,NULL,NULL,NULL,'<p>Black leather &#39;Rebecca&#39; sneakers from Giuseppe Zanotti Design featuring a round toe, a lace-up front fastening, a silver-tone logo plaque, a branded insole, a white rubber sole and a contrasting heel counter with silver-tone stud detailing. Item ID: wedge: 2.9 centimetres, heel: 2.9 centimetres Leather 100% Leather 100% rubber 100% Metal (Other) 100%</p>',2,NULL,'O4bBAR',NULL,NULL,1,0,1,'2020-12-01 15:46:04','2021-03-14 23:22:03',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42.5'),(399,'Double Side-Zip Signature Sneakers','double-side-zip-signature-sneakers',NULL,35,NULL,NULL,NULL,NULL,'<p>Blue/Grey&nbsp;leather side-zip signature sneakers from Giuseppe Zanotti featuring suede panels, a round toe, side zip fastenings, a lace-up front fastening, a front logo plaque, a pull tab at the rear and a ridged rubber sole.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Outer: Leather 100%</p>\r\n\r\n<p>Lining: Leather 100%</p>\r\n\r\n<p>Sole: Rubber 100%</p>',2,NULL,'zC1t0b',NULL,NULL,1,0,1,'2020-12-01 16:09:28','2021-03-14 23:22:10',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41'),(400,'Nude Palais Royal 120 Patent Leather Open Toe Heels Pumps Platforms','nude-palais-royal-120-patent-leather-open-toe-heels-pumps-platforms',NULL,27,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>This patent leather peep toe pump is designed with a partially hidden double platform (1.25&quot;) and sky high heel. Red sole. Leather insole. Made in Italy. Color: Nude.</li>\r\n	<li>SIZE: 39 EU (Insole: 9.75&quot;, Heel: 5.5&quot;) Typically CL shoes run small. rand New in the Louboutin box with Louboutin Signature Red Dust Bag.</li>\r\n	<li>Please note: These are European size shoes. European size cannot always be accurately compar