NULL,NULL,NULL,'variable',0,'39'),(508,'VELVET LOAFERS WITH BOW TIE','velvet-loafers-with-bow-tie',NULL,22,NULL,NULL,NULL,NULL,'<div class=\"b-product_details-description b-scroll-wrapper\">\r\n<div class=\"b-product_details-content js-product-details-content\">\r\n<div class=\"b-product_long_description\"><em>Dolce&amp;Gabbana Men&rsquo;s formal footwear stands out for its craftsmanship, the meticulous selection of leather and the attention to detail.</em><br />\r\n<br />\r\nLoafers from the New Lukas line in velvet with bow tie and grosgrain trim:<br />\r\n&bull; Velvet upper<br />\r\n&bull; Flat bow tie in grosgrain and velvet<br />\r\n&bull; Black calfskin insole with matelass&eacute; satin insert and logo on label<br />\r\n&bull; Leather sole with fresa bomb&eacute;<br />\r\n&bull; Two-tone leather sole with embossed logo and micro-injected monogram<br />\r\n&bull; Blake Welt<br />\r\n&bull; Made in Italy</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"b-product_details-description\">\r\n<div class=\"b-product_details-care b-scroll-wrapper\">\r\n<h2>Care and Details</h2>\r\n\r\n<div class=\"b-product_details-content js-product-details-content\">\r\n<div class=\"b-care_details-content js-care_details-content\">External composition: 64% Cotton 36% Rayon<br />\r\nInternal composition: 88% Sheep Leather 8% Rayon 4% Silk</div>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'aa3U9I',NULL,NULL,1,0,1,'2020-12-30 16:12:20','2020-12-30 16:12:20',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44'),(509,'Jacquard Flames Logo Cap','jacquard-flames-logo-cap',80000,36,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\">jacquard flames logo cap</div>\r\n</div>\r\n\r\n<div class=\"_824b7a _9584ff _d85b45\">\r\n<p>It&#39;s time to set the world on fire - with your fashion, naturally. Boasting jacquard flames and an embroidered logo to its front, this cap from Palm Angels is how you&#39;ll do that. Feeling convinced yet?</p>\r\n</div>\r\n\r\n<div class=\"_6e1e52 _9584ff _d46645 _d85b45\">\r\n<h4>Highlights</h4>\r\n\r\n<ul>\r\n	<li>black/white/tonal-orange</li>\r\n	<li>cotton</li>\r\n	<li>jacquard flames detailing</li>\r\n	<li>embroidered logo</li>\r\n	<li>curved peak</li>\r\n	<li>adjustable strap to the rear</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff _d8b821\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4>Composition</h4>\r\n\r\n<p>Cotton 100%</p>\r\n</div>\r\n\r\n<div class=\"_9584ff _d46645\">\r\n<h4>washing instructions</h4>\r\n\r\n<p>Hand Wash</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'4uwJZG',NULL,1,1,0,0,'2020-12-30 16:18:46','2021-01-04 18:22:46',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/CBijsoS6fcSgmVJDDHvFmb3Uf2FBaLA2501U7KYv.jpg',NULL,NULL,'simple',0,''),(510,'White baseball cap with white Iceberg logo','white-baseball-cap-with-white-iceberg-logo',80000,24,NULL,NULL,NULL,NULL,'<p>White cotton cap baseball hat with stiff pre-curved bill. Contrast white Iceberg logo and &quot;since 1974&quot; embroidered across front panel. Adjustable buckle size backstrap and sweatband with hole under back panel. Simple never sucks.<br />\r\n<br />\r\n100%COTTON</p>',2,NULL,'5Qd2JW',NULL,1,1,0,0,'2020-12-30 16:25:30','2020-12-30 16:25:30',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/79ekIyvn5rkSwLBzaWxATE15HHmaoEG3ji4KfIYW.jpg',NULL,NULL,'simple',0,''),(511,'Logo print cap','logo-print-cap',150000,22,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Logo print cap</div>\r\n</div>\r\n\r\n<div class=\"_9584ff\">\r\n<p>Embrace a leisurely take on luxury dressing with Dolce &amp; Gabbana&rsquo;s latest collection. This white logo print cap is crafted from cotton and features a round top, a visor and an adjustable fit.</p>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div clas