 these Greca sandals from Versace are the perfect pair to accompany you.</p>\r\n</div>\r\n\r\n<div>\r\n<h4><strong>Highlights</strong></h4>\r\n\r\n<ul>\r\n	<li>black&nbsp;</li>\r\n	<li>leather trim</li>\r\n	<li>signature Greek Key pattern</li>\r\n	<li>silver-tone Medusa stud&nbsp;</li>\r\n	<li>thong strap&nbsp;</li>\r\n	<li>leather sole</li>\r\n</ul>\r\n\r\n<p>Made in Italy</p>\r\n</div>\r\n\r\n<div>\r\n<p><strong>Composition</strong></p>\r\n\r\n<ul>\r\n	<li>Outer: Polyamide 100%, Leather 100%</li>\r\n	<li>Lining: Leather 100%</li>\r\n	<li>Sole: Leather 100%</li>\r\n</ul>\r\n</div>\r\n</div>',2,NULL,'XV9nEc',NULL,NULL,1,0,1,'2021-01-04 13:40:21','2021-01-06 09:04:54',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42,46'),(514,'Baroque Print Raffia Sole Espadrilles','baroque-print-raffia-sole-espadrilles',NULL,7,NULL,NULL,NULL,NULL,'<div>\r\n<div>\r\n<div id=\"bannerComponents-Container\">Baroque Print Raffia Sole Espadrilles</div>\r\n</div>\r\n\r\n<div>\r\n<p>If there&#39;s any brand which is famed for their iconic prints, it&#39;s Versace. These baroque print espadrilles from the Italian label are guaranteed to add a statement edge to any outfit, night or day. The ultimate summer shoe? We think so.</p>\r\n</div>\r\n\r\n<div>\r\n<h4><strong>Highlights</strong></h4>\r\n\r\n<ul>\r\n	<li>Black/yellow/beige</li>\r\n	<li>\r\n	<p>cotton/leather/rubber</p>\r\n	</li>\r\n	<li>\r\n	<p>baroque-pattern print</p>\r\n	</li>\r\n	<li>\r\n	<p>branded insole</p>\r\n	</li>\r\n	<li>\r\n	<p>braided raffia sole</p>\r\n	</li>\r\n	<li>\r\n	<p>round toe</p>\r\n	</li>\r\n	<li>\r\n	<p>slip-on style</p>\r\n	</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<p>Made in Italy</p>\r\n\r\n<p><strong>Composition</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Outer: Cotton 100%</p>\r\n	</li>\r\n	<li>\r\n	<p>Lining: Leather 100%</p>\r\n	</li>\r\n	<li>\r\n	<p>Sole: Rubber 100%</p>\r\n	</li>\r\n</ul>\r\n</div>\r\n</div>',2,NULL,'MapIRR',NULL,NULL,1,0,1,'2021-01-05 06:57:57','2021-01-06 09:04:27',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(516,'Medusa Logo-Print Cotton-Jersey T-shirt','medusa-logo-print-cotton-jersey-t-shirt',NULL,7,NULL,NULL,NULL,NULL,'<p><span style=\"background-color:#ffffff; color:#000000; font-family:Group3; font-size:12px\">The white Medusa head logo on this black T-shirt has been an emblem of Versace since the early 1990s when it was chosen by Gianni Versace, who was inspired by the Greek artwork on the floor of a building in Rome that he and his siblings used to play in as children. It&rsquo;s made in Italy from soft cotton jersey that&rsquo;s slim fitting across the shoulders and relaxed through the body.</span></p>\r\n\r\n<ul style=\"margin-left:0px; margin-right:0px\">\r\n	<li style=\"list-style-type:disc\">COLOUR: Black</li>\r\n	<li style=\"list-style-type:disc\">COMPOSITION: 100% cotton.</li>\r\n	<li style=\"list-style-type:disc\">CARE: Machine wash</li>\r\n	<li style=\"list-style-type:disc\">COUNTRY OF ORIGIN: Italy</li>\r\n	<li style=\"list-style-type:disc\">Lightweight cotton jersey</li>\r\n	<li style=\"list-style-type:disc\">White Medusa logo print</li>\r\n	<li style=\"list-style-type:disc\">Crew neck</li>\r\n	<li style=\"list-style-type:disc\">Short sleeves</li>\r\n</ul>',2,NULL,'w184jC',NULL,NULL,1,0,1,'2021-01-07 08:29:40','2021-01-07 08:29:40',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'M'),(517,'Medusa Canvas Espadrilles','medusa-canvas-espadrilles',NULL,7,NULL,NULL,NULL,NULL,'<p><span style=\"background-color:#ffffff; color:#000000; font-family:trade-gothic-next-regular,&quot;helvetica neue&quot;,Helvetica,Arial,sans-serif; font-size:14px\">Set atop a braided espadrille sole, these canvas flats are adorned with Versace&#39;s iconic geometric trim and Medusa head motif.</span></p>\r\n\r\n<ul style=\"margin-left:0px; margin-right:0px\">\r\n	<li style=\"list-style-type:inherit\">Cotton upper</li>\r\n	<li style=\"list-style-type:inherit\">Almond toe</li>\r\n	<li style=\"list-style-type:inherit\">Slip-on style</li>\r\n	<li style=\"list-style-type:inherit\">Leather lining</li>\r\n	<li style=\"list-style-type:inherit\">Rubber sole</li>\r\n	<li style=\"list-style-type:inherit\">Made in Italy</li>\r\n</ul>',2,NULL,'0cjPWJ',NULL,NULL,1,0,1,'2021-01-07 08:58:00','2021-01-07 08:58:00',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(518,'BeoPlay A8 Wireless Speaker - Black','beoplay-a8-wireless-speaker-black',678300,43,NULL,NULL,NULL,NULL,'<p style=\"text-align:left\">BeoPlay A8 is a one-point stereo system with truly powerful acoustics. It&rsquo;s simple and intuitive to use, it works with all devices &ndash; and we like to think it brings new life to both your digital music and your home.</p>\r\n\r\n<p style=\"text-align:left\">It features black anodised aluminium that has been mechanically brushed to ensure long hairlines that give you a matte black finish on the shiny surface - and front speaker covers made out of black canvas.</p>\r\n\r\n<p style=\"text-align:left\">BeoPlay A8 has the portability to turn any kitchen or summer cottage into a party zone. Rest the A8 on any surface or mount it on a wall (wall mounts sold separately), and the speakers adjust for perfect sound in any location</p>\r\n\r\n<p style=\"text-align:left\">BeoPlay A8 works with all devices. Whether it&rsquo;s an Apple iPhone, iPad or iPod, an Android phone or tablet &ndash; or even a laptop you&rsquo;re playing your music from, it&rsquo;ll go hand in hand with the A8. No problems whatsoever!</p>\r\n\r\n<p style=\"text-align:left\"><strong>Key Features</strong></p>\r\n\r\n<ul style=\"margin-left:20px; margin-right:0px\">\r\n	<li>Iconic stereo that makes your music look and sound beautiful</li>\r\n	<li>Bang &amp; Olufsen Signature Sound</li>\r\n	<li>Stream via AirPlay, DLNA (for Android), and wireless network login sharing</li>\r\n	<li>Sensational bass power</li>\r\n	<li>Two 3/4&quot; tweeters and two 5&quot; woofers</li>\r\n</ul>\r\n\r\n<p style=\"text-align:left\"><strong>Connectivity</strong></p>\r\n\r\n<ul style=\"margin-left:20px; margin-right:0px\">\r\n	<li>Bluetooth 4.0 for wireless streaming</li>\r\n	<li>iPod/iPhone/iPad connector</li>\r\n	<li>Apple Lightning connector</li>\r\n	<li>Ethernet</li>\r\n	<li>1 x DC power input</li>\r\n	<li>1 x line-in (AUX) for MP3 player or mobile device</li>\r\n	<li>1 x USB connection for charging your device while playing music&nbsp;</li>\r\n</ul>\r\n\r\n<p style=\"text-align:left\"><strong>What&#39;s In The Box</strong></p>\r\n\r\n<ul style=\"margin-left:20px; margin-right:0px\">\r\n	<li>BeoPlay A8</li>\r\n	<li>Aluminium spikes</li>\r\n	<li>Lightning connector dock</li>\r\n	<li>Power supply</li>\r\n	<li>Quick start guide</li>\r\n</ul>\r\n\r\n<p style=\"text-align:left\"><strong>Bang &amp; Olufsen at Headphones SG</strong></p>\r\n\r\n<ul style=\"margin-left:20px; margin-right:0px\">\r\n	<li>Authorised reseller</li>\r\n	<li>3 Years international warranty</li>\r\n	<li>Local service centre (Singapore)</li>\r\n</ul>',2,NULL,'GqIiaO',NULL,1,1,0,0,'2021-01-07 15:29:28','2021-01-08 07:28:55',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/hfpXtUQqNZQmscLXvHsLWYUEazmjC9j8neOkgSjx.jpg',NULL,NULL,'variable',0,'Black,White'),(519,'BeoPlay A8 Wireless Speaker - White','beoplay-a8-wireless-speaker-white',NULL,43,NULL,NULL,NULL,NULL,'<p style=\"text-align:left\">BeoPlay A8 is a one-point stereo system with truly powerful acoustics. It&rsquo;s simple and intuitive to use, it works with all devices &ndash; and we like to think it brings new life to both your digital music and your home.</p>\r\n\r\n<p style=\"text-align:left\">It features black anodised aluminium that has been mechanically brushed to ensure long hairlines that give you a matte black finish on the shiny surface - and front speaker covers made out of black canvas.</p>\r\n\r\n<p style=\"text-align:left\">BeoPlay A8 has the portability to turn any kitchen or summer cottage into a party zone. Rest the A8 on any surface or mount it on a wall (wall mounts sold separately), and the speakers adju