i>\r\n	<li>PLACE OF ORIGIN: EU</li>\r\n	<li>Almond toe</li>\r\n	<li>Black front patch, zardozi-embroidered crest</li>\r\n	<li>Brown grosgrain piping</li>\r\n	<li>Tan-brown leather lining and insole</li>\r\n	<li>Natural-jute espadrille midsole</li>\r\n	<li>Signature red rubber sole</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'lq0dui',NULL,NULL,1,0,1,'2021-01-18 08:39:11','2021-02-22 11:24:33',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(525,'Nanou Espadrilles With Tassel Detail','nanou-espadrilles-with-tassel-detail',NULL,27,NULL,NULL,NULL,NULL,'<p>These blue Christian Louboutin &#39;Nanou&#39; espadrilles are crafted in Spain and feature a square toe, a slip-on style, a branded insole, tassel detailing and a jute sole. For the lexicologists among you, it might be interesting to note that the name Nanou means &quot;one who is graced with God&#39;s favour&quot;. And even if that weren&#39;t the case, at the very least, the wearer would be graced with Monsieur Louboutin&#39;s favour.</p>\r\n\r\n<ul>\r\n	<li>Slip on</li>\r\n	<li>Tassels detailing</li>\r\n	<li>Rubber sole</li>\r\n	<li>Blue</li>\r\n	<li>Autumn-Winter</li>\r\n</ul>\r\n\r\n<div class=\"_2fekQ\" id=\"accordionItem-97\">\r\n<div class=\"TJTFh\" id=\"accordionTitle-97\"><strong>Materials &amp; Product Care</strong></div>\r\n\r\n<div style=\"height:auto\">\r\n<div>\r\n<div class=\"_1dZf1\" id=\"accordionBody-97\">\r\n<div>\r\n<div class=\"_2o9vf\">\r\n<p>Lining Composition: Leather 100%</p>\r\n\r\n<p>Outer Composition: Cotton 100%</p>\r\n\r\n<p>Sole Composition: Rubber 100%</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'Lq5OYH',NULL,NULL,1,0,1,'2021-01-18 08:48:05','2021-02-22 11:24:47',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(526,'Blue Dandelion Velvet Loafers','blue-dandelion-velvet-loafers',NULL,0,NULL,NULL,NULL,NULL,'<p>Christian Louboutin&rsquo;s blue Dandelion loafers have a clean-cut silhouette and a plush velvet outer for a fusion of opulent and minimalist codes. They&rsquo;re lined with leather and have grosgrain piping and a low stacked heel, then are completed with the signature red sole &ndash; an iconic part of the designer&rsquo;s work since the 1990s.</p>\r\n\r\n<div class=\"mCSB_container\" dir=\"ltr\" id=\"mCSB_2_container\" style=\"left:0px; position:relative; top:-2px\">\r\n<div class=\"pdp-accordion__content\">\r\n<div class=\"inner-content\">\r\n<ul>\r\n	<li>COLOUR: Blue</li>\r\n	<li>COMPOSITION: Velvet.</li>\r\n	<li>COUNTRY OF ORIGIN: Italy</li>\r\n	<li>Velvet-coated leather upper</li>\r\n	<li>Grosgrain piping</li>\r\n	<li>Tan leather and suede lining</li>\r\n	<li>Signature red sole, stacked low heel</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'xQZHU1',NULL,NULL,1,0,1,'2021-01-18 09:06:26','2021-02-22 11:25:40',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42.5,43.5'),(527,'Spike-Embellished Neoprene Sock Trainers','spike-embellished-neoprene-sock-trainers',NULL,27,NULL,NULL,NULL,NULL,'<p>Christian Louboutin imbues a classic trainer design with a modern sensibility by taking its hallmark spikes and scattering them over the uppers of these white neoprene sock trainers. The Italian-made shoes feature a streetwear-inspired chunky profile and the house&rsquo;s signature red soles for a flash of colour. Wear them to continue the directional streetwear look of a logo sweater and track pants.</p>\r\n\r\n<div class=\"mCSB_container\" dir=\"ltr\" id=\"mCSB_2_container\" style=\"left:0px; position:relative; top:0px\">\r\n<div class=\"pdp-accordion__content\">\r\n<div class=\"inner-content\">\r\n<ul>\r\n	<li>COLOUR: Black</li>\r\n	<li>COMPOSITION: Neoprene.</li>\r\n	<li>COUNTRY OF ORIGIN: Italy</li>\r\n	<li>Foam sock body</li>\r\n	<li>Stacked black, red and silver rubber sole</li>\r\n	<li>Red lining</li>\r\n	<li>Beige leather insoles</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'lqepsS',NULL,NULL,1,0,1,'2021-01-18 09:23:14','2021-02-22 11:27:37',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43.5,46.5'),(528,'Greggo Flat Nounours Tan Suede Leather Oxford Shoes','greggo-flat-nounours-tan-suede-leather-oxford-shoes',NULL,27,NULL,NULL,NULL,NULL,'<p>These &#39;Greggo Flat&#39; oxford shoes from Christian Louboutin are made from a luxurious tan suede&nbsp;leather and feature lace-up fastening with&nbsp;a long, slender toe. Complete with the brand&#39;s iconic red lacquered outsole.</p>\r\n\r\n<p><u><strong>Details</strong></u></p>\r\n\r\n<ul>\r\n	<li>Outer: Leather</li>\r\n	<li>Inner: Leather</li>\r\n	<li>Sole: Leather</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'5qkR0q',NULL,NULL,1,0,1,'2021-01-18 09:38:29','2021-02-22 11:27:56',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'46'),(529,'Louis Junior Spikes Orlato Mixed-Media Sneakers','louis-junior-spikes-orlato-mixed-media-sneakers',NULL,27,NULL,NULL,NULL,NULL,'<p>Taking inspiration from the 1980&#39;s tennis shoe, the Louis Junior Spikes brings cool, retro fashion up to date with exquisite colors and materials. This model is meticulously crafted in an all-over soft, black veau velours, with black laces and black top-stitching, set atop a black sole with a Maison Christian Louboutin signature red bottom. Glossy tonal spikes embellish the toe.</p>\r\n\r\n<div class=\"productCutline\">\r\n<div>\r\n<ul>\r\n	<li>Christian Louboutin two-tone sneaker in polyester, mesh and patent calfskin.</li>\r\n	<li>Lace-up vamp.</li>\r\n	<li>Tabbed back collar.</li>\r\n	<li>Rubber outsole.</li>\r\n	<li>&quot;Louis Junior Orlato&quot; is made in Italy.</li>\r\n</ul>\r\n</div>\r\n</div>',2,NULL,'p7anfL',NULL,NULL,1,0,1,'2021-01-18 09:59:20','2021-02-22 11:29:26',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'46'),(530,'BLack Vieira Flat Sneakers','black-vieira-flat-sneakers',NULL,27,NULL,NULL,NULL,NULL,'<p>A statement sneaker of infinite potential, Christian Louboutin&rsquo;s Vieira is a round-toe sneaker, crafted in black calfskin and streamlined to a low-top silhouette. Confident in its tone-on-tone look, elegant topstitching and grosgrain piping detail add a polished finish to this signature model.</p>',2,NULL,'myHqHi',NULL,NULL,1,0,1,'2021-01-18 10:04:46','2021-02-22 11:29:58',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(531,'Black Suede Alpinono Flat','black-suede-alpinono-flat',NULL,27,NULL,NULL,NULL,NULL,'<p>New silhouettes and classics reinvented. Christian Louboutin has been a lover of innovative styles, distinct shapes and a sensual and unconventional charm for over twenty years. Entered in the history of international fashion thanks to its super vertiginous heel, a symbol of excellence and a popular cult where the famous red lacquered sole is transformed from a simple stylistic detail to a real way of being and expressing oneself, a state soul to Louboutin. Red thus becomes a distinctive fulcrum of the Maison expressed in all its accessories.</p>\r\n\r\n<p>&bull; Slip on model<br />\r\n&bull; Round tip<br />\r\n&bull; High ankle<br />\r\n&bull; Genuine suede upper<br />\r\n&bull; Elastic bands<br />\r\n&bull; Grosgrain finishes<br />\r\n&bull; Interior lined in smooth genuine leather<br />\r\n&bull; Micro-grained rubber sole<br />\r\n&bull; Louboutin red background<br />\r\n&bull; Made in Italy</p>\r\n\r\n<p>Composition: 100% Calf (Bos Taurus)</p>',2,NULL,'dZkqhv',NULL,NULL,1,0,1,'2021-01-18 12:03:59','2021-02-22 11:30:11',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'45'),(532,'Dandelion Tassel Flat','dandelion-tassel-flat',NULL,27,NULL,NULL,NULL,NULL,'<p>The Dandelion flat is a Maison Christian Louboutin iconic slip-on loafer with sleek elongated lines and a timeless appeal. An essential in any modern wardrobe, these loafers complement all trouser styles. The exquisite craftsmanship makes each pair a pleasure to wear. This model is fashioned in a soft black patent leather for an elegant appeal and finished with tone-on-tone grosgrain piping and an iconic crown-shaped tassel.</p>\r\n\r\n<div class=\"productCutline\">\r\n<div>\r\n<ul>\r\n	<li>Christian Louboutin &quot;Dandelion&quot; loafer in patent leather.</li>\r\n	<li>1&quot; flat heel.</li>\r\n	<li>Round toe.</li>\r\n	<li>Notched vamp.</li>\r\n	<li>Double tassel detail.</li>\r\n	<li>Grosgrain topline.</li>\r\n	<li>Slip-on style.</li>\r\n	<li>Signature red outsole.</li>\r\n	<li>Made in Italy.</li>\r\n</ul>\r\n</div>\r\n</div>',2,NULL,'qE1ZFn',NULL,NULL,1,0,1,'2021-01-18 12:18:13','2021-01-18 12:18:13',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44.5'),(533,'Rantulow Flat Black Leather','rantulow-flat-black-leather',NULL,27,NULL,NULL,NULL,NULL,'<p>The Rantulow are low-top sneakers inspired by retro basketball shoes from the 1980s. These iconic low-top sneakers stand out from the crowd due to their two-part nose construction, creating a virtual vamp. The simple design also incorporates traditional trainer construction with a back counter and heel tab. This sleek black version is luxuriously crafted from supple Calf Graine leather. A versatile, time-honoured classic to enhance casual outfits and denims.</p>\r\n\r\n<div>\r\n<ul>\r\n	<li>COLOUR: Black</li>\r\n	<li>COMPOSITION: Grained Leather&nbsp;</li>\r\n	<li>Round toe, low top</li>\r\n	<li>Black&nbsp;lace-up fronts,&nbsp;Black metal eyelets</li>\r\n	<li>Leather heel panel</li>\r\n	<li>Nude-beige leather lining and insole</li>\r\n	<li>White&nbsp;rubber midsole</li>\r\n	<li>Signature red rubber sole</li>\r\n</ul>\r\n</div>',2,NULL,'QOFeA7',NULL,NULL,1,0,1,'2021-01-18 13:10:47','2021-02-22 11:30:47',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44'),(534,'Black Greggo Flat','black-greggo-flat',NULL,27,NULL,NULL,NULL,NULL,'<p>An exquisitely made dress shoe, the Greggo Flat is an elegant closed-lace Oxford shoe featuring a slim outsole and a sleek, elongated silhouette. This striking model is reworked season upon season in a variety of sophisticated materials and tones. This season&rsquo;s model is crafted in a gleaming Patent leather in all-over black and outlined with an a elegant grosgrain ribbon trim.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"mCSB_container\" dir=\"ltr\" id=\"mCSB_2_container\" style=\"left:0px; position:relative; top:-34px\">\r\n<div class=\"pdp-accordion__content\">\r\n<div class=\"inner-content\">\r\n<ul>\r\n	<li>COLOUR: Black</li>\r\n	<li>COMPOSITION: 100% patent leather.</li>\r\n	<li>PLACE OF ORIGIN: Italy</li>\r\n	<li>Stitched toecap</li>\r\n	<li>Beige leather lining and insole</li>\r\n	<li>Red leather sole</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'g45tLU',NULL,NULL,1,0,1,'2021-01-18 14:17:53','2021-02-22 11:31:06',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43.5'),(535,'Dandylove Strass Flat','dandylove-strass-flat',NULL,27,NULL,NULL,NULL,NULL,'<p>Cloaked in black veau velours, Christian Louboutin&rsquo;s Venetian cut Dandylove loafers bring simple sophistication to all your ensembles. An undisputed classic, the elegant set features a descending vamp that adds a smooth laid-back appeal, while elongating the silhouette. Grosgrain piping finish lends edge to the perfect city shoe sublimed by the inscription &quot;Love&quot; in silver strass.</p>\r\n\r\n<p><br />\r\nColor : Red<br />\r\nMaterial : Suede</p>',2,NULL,'19eXfI',NULL,NULL,1,0,1,'2021-01-18 15:54:17','2021-02-22 11:31:18',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'46'),(536,'Mirror-Effect Patent Leather Loafers','mirror-effect-patent-leather-loafers',NULL,62,NULL,NULL,NULL,NULL,'<ul>\r\n	<li><span style=\"background-color:#f7f7f7; color:#000000; font-family:PlainLight-Regular,Arial,sans-serif; font-size:13px\">Black patent leather loafers</span></li>\r\n	<li><span style=\"background-color:#f7f7f7; color:#000000; font-family:PlainLight-Regular,Arial,sans-serif; font-size:13px\">Cord accent on top</span></li>\r\n	<li><span style=\"background-color:#f7f7f7; color:#000000; font-family:PlainLight-Regular,Arial,sans-serif; font-size:13px\">Fits true to size: select your usual size</span></li>\r\n	<li><span style=\"background-color:#f7f7f7; color:#000000; font-family:PlainLigh