\" style=\"left:0px; position:relative; top:0px\">\r\n<div class=\"pdp-accordion__content\">\r\n<div class=\"inner-content\">\r\n<ul>\r\n	<li>COLOUR: Green</li>\r\n	<li>COMPOSITION: Neoprene.</li>\r\n	<li>COUNTRY OF ORIGIN: Italy</li>\r\n	<li>Neoprene upper, leather toe cap, suede instep and heel patches</li>\r\n	<li>Mesh tongue</li>\r\n	<li>Cut-out vamp</li>\r\n	<li>Black metal studs, leather lace loops, white logo hot-stamped leather tab</li>\r\n	<li>Red neoprene lining</li>\r\n	<li>Chunky white rubber midsole</li>\r\n	<li>Red logo-debossed rubber sole</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>',2,NULL,'er68Ji',NULL,NULL,1,0,1,'2021-01-20 10:32:31','2021-02-22 11:33:05',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'46.5'),(541,'Black Monmoc Flat Loafers','black-monmoc-flat-loafers',NULL,27,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Polished leather loafers in black. Round moc toe.</li>\r\n	<li>Adjustable pin-buckle strap in white with logo hardware at vamp.</li>\r\n	<li>Serrated detailing at tongue.</li>\r\n	<li>Leather lining.</li>\r\n	<li>Adjustable pin-buckle strap in white at heel.</li>\r\n	<li>Tonal stacked leather heel.</li>\r\n	<li>Signature red leather sole featuring rubber injection at heel. S</li>\r\n	<li>ilver-tone hardware.</li>\r\n	<li>Supplier color: Black</li>\r\n</ul>',2,NULL,'WYMkcG',NULL,NULL,1,0,1,'2021-01-20 10:37:15','2021-02-22 11:47:23',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'46'),(542,'Corteo Iridescent Patent Leather Lace-Up Shoes','corteo-iridescent-patent-leather-lace-up-shoes',NULL,27,NULL,NULL,NULL,NULL,'<div class=\"product-description__content__cutline-standard\">\r\n<ul>\r\n	<li>Christian Louboutin calf leather oxfords with patent iridescent accent.</li>\r\n	<li>Stacked heel.</li>\r\n	<li>Round toe.</li>\r\n	<li>Lace-up vamp.</li>\r\n	<li>Signature red leather outsole.</li>\r\n	<li>&quot;Corteo&quot; is made in Italy.</li>\r\n</ul>\r\n</div>',2,NULL,'9gGw72',NULL,NULL,1,0,1,'2021-01-20 10:51:19','2021-02-22 11:47:53',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43,46'),(543,'Big Horn Trucker cap - Navy','big-horn-trucker-cap-navy',50000,63,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Size: single adjustable with snap back closure.</li>\r\n	<li>Material: 57% polyester, 43% cotton</li>\r\n	<li>Gender: unisex</li>\r\n	<li>Brand Name: Goorin Bros</li>\r\n	<li>Model: Big Horny</li>\r\n	<li>Style: baseball cap, trucker cap.</li>\r\n	<li>Features: is a sunscreen, adjustable size with back zipper, embroidered ram.</li>\r\n</ul>',2,NULL,'dnSA3y',NULL,1,1,0,0,'2021-01-20 11:29:38','2021-01-20 11:29:38',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/jnvwiS4nSGsjLPG8nQfmUcOGtw0EfGX6TGNFWw0E.jpg',NULL,NULL,'simple',0,''),(544,'Lucia Floral Leopard Print Bag','lucia-floral-leopard-print-bag',780000,22,NULL,NULL,NULL,NULL,'<p>Dolce &amp; Gabbana&rsquo;s luxurious bags are exquisitely crafted in Italy using the finest artisan techniques. Roomy and functional, this pretty textile Lucia shoulder bag from Dolce &amp; Gabbana is a signature staple with its mix of floral and leopard print on the outside. It features a detachable shoulder strap, a foldover top with push-lock closure, an internal zipped pocket and a card slot.</p>\r\n\r\n<p>Designer colour:MULTICOLOUR<br />\r\nMade in Italy</p>',2,NULL,'PoD8tA',NULL,1,1,0,0,'2021-01-20 12:02:20','2021-01-20 12:03:04',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/sHGEDbGbcMtVoLFBaBk2MoEIUwed4398kIAtJACO.jpg',NULL,NULL,'simple',0,''),(545,'Hibiscus Hybrid Brogues With Hand-Made Acrylic Mosaic','hibiscus-hybrid-brogues-with-hand-made-acrylic-mosaic',NULL,64,NULL,NULL,NULL,NULL,'<div class=\"entry-content panel wc-tab woocommerce-Tabs-panel woocommerce-Tabs-panel--know_more\" id=\"tab-know_more\" style=\"display:block\">\r\n<p><strong>Key Facts</strong></p>\r\n\r\n<ul>\r\n	<li>DV061 Hibiscus is a hand-made hybrid shoe. Its construction is based on an oxford style fused with a derby outer layer, a Vanassibara trademark</li>\r\n	<li>The upper is 100% made from black calf leather</li>\r\n	<li>The shoes have fully articulated, non-removable acrylic mosaic faceplates. The hibiscus inspired mosaic design is all hand-made and it emulates a stained glass surface</li>\r\n	<li>DV061 is entirely lined in super soft lambskin</li>\r\n	<li>Vanassibaras will never smell unpleasant. Our shoes are mounted on a breathable raw leather insole which naturally absorbs excessive sweat from the feet. That&rsquo;s an old technique that only true luxury brands can afford</li>\r\n	<li>The sole is actually hand-made too. It is made from blocks of cut, trimmed and sanded rubber, then mounted and finished with a leather welt <strong>trim</strong></li>\r\n</ul>\r\n\r\n<p><strong>Know More</strong></p>\r\n\r\n<div class=\"entry-content panel wc-tab woocommerce-Tabs-panel woocommerce-Tabs-panel--key_facts\" id=\"tab-key_facts\" style=\"display:block\">\r\n<ul>\r\n	<li>Oxford shoes in calf leather</li>\r\n	<li>Faceplates in acrylic mosaic</li>\r\n	<li>Fully lined in lambskin</li>\r\n	<li>Sole in 100% rubber</li>\r\n</ul>\r\n\r\n<p><strong>Care Instructions </strong></p>\r\n\r\n<div class=\"entry-content panel wc-tab woocommerce-Tabs-panel woocommerce-Tabs-panel--care_instructions\" id=\"tab-care_instructions\" style=\"display:block\">\r\n<ul>\r\n	<li>Calfskin is a strong leather but like all leather products, they might become marked with wear and occasionally require maintenance</li>\r\n	<li>We would advise against the use of any cleaning products containing solvents, which might affect the surface finishing on the leather</li>\r\n	<li>Gently wipe the product with a soft damp cloth and allow to air dry away from direct heat</li>\r\n	<li>Avoid contact with liquids containing alcohol or solvents, as this will cause irreversible damage to the surface of the leather</li>\r\n	<li>Should be stored away from humidity and sources of heat</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'m4CBPi',NULL,NULL,1,0,1,'2021-01-20 22:15:03','2021-01-20 22:28:41',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(546,'Moonrise Hybrid Brogues With Hand-Made Acrylic Mosaic','moonrise-hybrid-brogues-with-hand-made-acrylic-mosaic',NULL,64,NULL,NULL,NULL,NULL,'<div class=\"entry-content panel wc-tab woocommerce-Tabs-panel woocommerce-Tabs-panel--know_more\" id=\"tab-know_more\" style=\"display:block\">\r\n<p><strong>Know More</strong></p>\r\n\r\n<ul>\r\n	<li>DV061 Moonrise is a hand-made hybrid shoe. Its construction is based on an oxford style fused with a derby outer layer, a Vanassibara trademark</li>\r\n	<li>The upper is 100% made from high-shine calfskin in dark blue</li>\r\n	<li>The shoes have fully articulated, non-removable acrylic mosaic faceplates. The moonrise over the ocean mosaic design is all hand-made and it emulates a stained glass surface</li>\r\n	<li>DV061 is entirely lined in super soft lambskin</li>\r\n	<li>Vanassibaras will never smell unpleasant. Our shoes are mounted on a breathable raw leather insole which naturally absorbs excessive sweat from the feet. That&rsquo;s an old technique that only true luxury brands can afford</li>\r\n	<li>The sole is actually hand-made too. It is made from blocks of cut, trimmed and sanded rubber, then mounted and finished with a leather welt trim</li>\r\n</ul>\r\n\r\n<p><strong>Key Facts</strong></p>\r\n\r\n<div class=\"entry-content panel wc-tab woocommerce-Tabs-panel woocommerce-Tabs-panel--key_facts\" id=\"tab-key_facts\" style=\"display:block\">\r\n<ul>\r\n	<li>Oxford shoes in brushed calfskin</li>\r\n	<li>Faceplates in acrylic mosaic</li>\r\n	<li>Fully lined in lambskin</li>\r\n	<li>Sole in 100% rubber</li>\r\n</ul>\r\n\r\n<p><strong>Care Instructions </strong></p>\r\n\r\n<div class=\"entry-content panel wc-tab woocommerce-Tabs-panel woocommerce-Tabs-panel--care_instructions\" id=\"tab-care_instructions\" style=\"display:block\">\r\n<ul>\r\n	<li>Brushed calf is a relatively strong leather but like all leather products, they might become marked with wear and occasionally require maintenance</li>\r\n	<li>Brushed calfskin is easy to clean. Gently wipe the product with a soft damp cloth and allow to air dry away from direct heat</li>\r\n	<li>Follow above instructions to clean the acrylic mosaic</li>\r\n	<li>Avoid contact with liquids containing alcohol or solvents, as this will cause irreversible damage to the surface of the leather</li>\r\n	<li>Avoid scratching or excessive abrasion, as the texture cannot be repaired once damaged</li>\r\n	<li>Should be stored away from humidity and sources of heat</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'hpbyui',NULL,NULL,1,0,1,'2021-01-20 22:27:38','2021-01-20 22:27:38',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(547,'Rhyton Worldwide Sneakers','rhyton-worldwide-sneakers',NULL,16,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Rhyton Worldwide sneakers</div>\r\n</div>\r\n\r\n<div class=\"_9584ff\">\r\n<p>You&#39;re not alone in this world. These Rhyton Worldwide sneakers from Gucci are designed to remind us that we&#39;re part of a global community, with imaginary flags printed on the side. Every time you get the blues, just look down at these shoes! Featuring a printed logo, a front lace-up detail, a stitch detail and a platform rubber sole.</p>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4>Composition</h4>\r\n\r\n<p>outer: Leather 100%</p>\r\n\r\n<p>sole: Rubber 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'pKNHTm',NULL,NULL,1,0,1,'2021-01-20 22:44:27','2021-03-14 23:11:19',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(548,'Wing Low-Top Sneakers','wing-low-top-sneakers',NULL,2,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Wing low-top sneakers</div>\r\n</div>\r\n\r\n<div class=\"_824b7a _9584ff _d85b45\">\r\n<p>These Wings sneakers will not give you the power to fly. They will, although, give you heavenly comfort, which ultimately, is all a boy needs. Givenchy really knows your needs.&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"_6e1e52 _9584ff _d46645 _d85b45\">\r\n<h4><strong>Highlights</strong></h4>\r\n\r\n<ul>\r\n	<li>black/white</li>\r\n	<li>calf leather</li>\r\n	<li>colour-block design</li>\r\n	<li>embossed logo to the side</li>\r\n	<li>logo-embossed tongue</li>\r\n	<li>branded insole</li>\r\n	<li>contrasting heel counter</li>\r\n	<li>round toe</li>\r\n	<li>front lace-up fastening</li>\r\n	<li>flat rubber sole</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>outer: Calf Leather 100%</p>\r\n\r\n<p>lining: Calf Leather 100%</p>\r\n\r\n<p>sole: Rubber 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'Dhknie',NULL,NULL,1,0,1,'2021-01-20 23:29:39','2021-01-20 23:29:39',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'40'),(549,'Portofino Sneakers With Yellow Stripe','portofino-sneakers-with-yellow-stripe',NULL,22,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Portofino sneakers</div>\r\n</div>\r\n\r\n<div class=\"_9584ff\">\r\n<p>Definitive directors of Italian style, Dolce &amp; Gabbana return with this elevated edition of the classic court shoe, reimagined in stark white leather, accented with a thick metallic yellow stripe print, plus a script logo to the side of the lace fastening. Sculpting a round toe silhouette with a lace fastening, a brand embossed tongue and a contrasting branded heel counter, the design is finished with an off-white flat rubber sole for another deviant detail.</p>\r\n</div>\r\n\r\n