have colour-blocked suede-like panels that remind us of those beloved toy coloured bricks. But unlike those chunky blocks, these chunky shoes are comfortable to stand on. Featuring a color blocked design, a pull tab at the rear, a brand embossed tongue, a round toe, a lace-up front fastening, suede-like panels and a chunky rubber sole.</p>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4>Composition</h4>\r\n\r\n<p>lining: Leather 100%</p>\r\n\r\n<p>sole: Rubber 100%</p>\r\n\r\n<p>outer: Polyester 45%, Calf Leather 40%, Spandex/Elastane 10%, Polyethylene 4%, Nylon 1%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'FH2oVT',NULL,NULL,1,0,1,'2021-01-21 00:48:17','2021-01-21 00:48:17',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(559,'Fuckin\' Freezing Low-Top Sneakers','fuckin-freezing-low-top-sneakers',NULL,21,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>DSQUARED2 Low-tops &amp; sneakers.</li>\r\n	<li>contrasting applications</li>\r\n	<li>Logo</li>\r\n	<li>Solid color</li>\r\n	<li>Laces</li>\r\n	<li>Round toeline</li>\r\n	<li>Flat</li>\r\n	<li>Leather lining</li>\r\n	<li>Rubber sole</li>\r\n	<li>Contains non-textile parts of animal origin</li>\r\n	<li>Calfskin</li>\r\n</ul>',2,NULL,'Pj2uFY',NULL,NULL,1,0,1,'2021-01-21 00:59:10','2021-01-21 00:59:10',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(560,'White Wing Low-Top Sneakers','white-wing-low-top-sneakers',NULL,2,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">White Wing low-top sneakers</div>\r\n</div>\r\n\r\n<div class=\"_9584ff\">\r\n<p>Peter Pan and the Lost Boys needed fairy dust to fly to the second star to the right and straight on till morning, to reach Neverland. We feel sorry for them, honestly. If only they had these white calf leather Wing low-top sneakers from Givenchy, they wouldn&#39;t need Tinkerbell&#39;s help. Let&#39;s fly away? Featuring an almond toe, a lace-up front fastening, a logo patch at the tongue, decorative perforations, a white rubber sole, a printed logo to the side, a Givenchy signature to the back and tone-on-tone canvas bands to the front.</p>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4>Composition</h4>\r\n\r\n<p>outer: Calf Leather 100%</p>\r\n\r\n<p>lining: Polyester 100%</p>\r\n\r\n<p>sole: Rubber 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'pPST5x',NULL,NULL,1,0,1,'2021-01-21 01:07:18','2021-01-21 01:07:18',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(561,'Wing Asymmetric Low-Top Sneakers','wing-asymmetric-low-top-sneakers',NULL,2,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Wing asymmetric low-top sneakers</div>\r\n</div>\r\n\r\n<div class=\"_824b7a _9584ff _d85b45\">\r\n<p>Spread your wings in the style stakes. These Wing low-top sneakers from Givenchy are presented in a mismatched style and come in a two-tone construction. Do things differently.</p>\r\n</div>\r\n\r\n<div class=\"_6e1e52 _9584ff _d46645 _d85b45\">\r\n<h4><strong>Highlights</strong></h4>\r\n\r\n<ul>\r\n	<li>black/white</li>\r\n	<li>calf leather</li>\r\n	<li>two-tone design</li>\r\n	<li>perforated detailing</li>\r\n	<li>logo-embossed tongue</li>\r\n	<li>round toe</li>\r\n	<li>front lace-up fastening</li>\r\n	<li>flat rubber sole</li>\r\n	<li>Please note that this item comes as a pair that intentionally do not match.</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>outer: Calf Leather 100%</p>\r\n\r\n<p>Fabric 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'A6Mx0o',NULL,NULL,1,0,1,'2021-01-21 01:11:41','2021-01-21 01:11:41',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41'),(562,'VL7N Panelled Logo-Print Sneakers','vl7n-panelled-logo-print-sneakers',NULL,18,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">VL7N panelled logo-print sneakers</div>\r\n</div>\r\n\r\n<div class=\"_9584ff\">\r\n<p>Valentino Garavani&#39;s sneakers find the sweet spot between practicality and style - what more could you want? The perforated details let your skin breathe, so you can wear them for hours on end without having to worry about a thing. Yes, they&#39;re as comfy as they look. Featuring a rubber sole, a front lace up detail, a printed logo to the rear, a perforated detail, a grosgrain band and panelled.</p>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>sole: Rubber 100%</p>\r\n\r\n<p>outer: Calf Leather 100%, Polyurethane 55%, Cotton 45%</p>\r\n\r\n<p>lining: Bos Taurus 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'7lkO8P',NULL,NULL,1,0,1,'2021-01-21 01:16:44','2021-01-21 01:16:44',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'45'),(563,'Giggies Lovers Language Low-Top Sneakers','giggies-lovers-language-low-top-sneakers',NULL,18,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Giggies Lovers Language low-top sneakers</div>\r\n</div>\r\n\r\n<div class=\"_824b7a _9584ff _d85b45\">\r\n<p>&quot;Good Lover&quot;. Are you sure? Guess you got to wear these Giggies Lovers Language low-top sneakers from Valentino Garavani to prove it. Oh wow, now we see...</p>\r\n</div>\r\n\r\n<div class=\"_6e1e52 _9584ff _d46645 _d85