the next level. Featuring a lace-up front fastening, a brand embossed tongue, a printed logo at the back, a round toe and an extended white rubber sole, these sneakers can be worn paired with denim for a low key look or dressed up with a slip dress. Alexander McQueen&#39;s sneakers are a dependable off-duty necessity. Please note that Alexander McQueen&#39;s sneakers no longer come with a dust bag.</p>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>sole: Rubber 100%</p>\r\n\r\n<p>outer: Leather 100%</p>\r\n\r\n<p>lining: Leather 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'Q7S4RL',NULL,NULL,1,0,1,'2021-01-21 01:56:33','2021-01-21 01:56:33',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'46'),(569,'VLTN TIMES Giggies Low-Top Sneakers','vltn-times-giggies-low-top-sneakers',NULL,18,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">VLTN TIMES Giggies low-top sneakers</div>\r\n</div>\r\n\r\n<div class=\"_824b7a _9584ff _d85b45\">\r\n<p>There&#39;s no such thing as too much VLTN. Featuring a VLTN TIMES print, VLTN patch and laces, these Giggies low-top sneakers will show everyone where your fashion loyalties lie. Colourful.</p>\r\n</div>\r\n\r\n<div class=\"_6e1e52 _9584ff _d46645 _d85b45\">\r\n<h4><strong>Highlights</strong></h4>\r\n\r\n<ul>\r\n	<li>white/multicolour&nbsp;</li>\r\n	<li>VLTN TIMES print</li>\r\n	<li>VLTN patch to the side</li>\r\n	<li>round toe</li>\r\n	<li>jacquard VLTN front lace-up fastening</li>\r\n	<li>pull-tab at the heel</li>\r\n	<li>flat rubber sole</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff _d8b821\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>sole: Rubber 100%</p>\r\n\r\n<p>outer: Fabric 100%</p>\r\n\r\n<p>lining: Fabric 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'hDUHKM',NULL,NULL,1,0,1,'2021-01-21 02:00:23','2021-01-21 02:00:23',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43.5'),(570,'Oversized low-top sneakers','oversized-low-top-sneakers',NULL,29,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Oversized low-top sneakers</div>\r\n</div>\r\n\r\n<div class=\"_824b7a _9584ff _d85b45\">\r\n<p>Yes, Alexander McQueen&#39;s Oversized sneakers do look as though they&#39;ve been decorated with a marker pen - in a good way. Set on bouncy rubber soles that feel like you&#39;re walking on air, you won&#39;t want to wear anything else. We knew you&#39;d be sold.</p>\r\n</div>\r\n\r\n<div class=\"_6e1e52 _9584ff _d46645 _d85b45\">\r\n<h4><strong>Highlights</strong></h4>\r\n\r\n<ul>\r\n	<li>white</li>\r\n	<li>leather</li>\r\n	<li>chunky rubber sole</li>\r\n	<li>almond toe</li>\r\n	<li>perforated detailing</li>\r\n	<li>front lace-up fastening</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>outer: Leather 100%</p>\r\n\r\n<p>lining: Leather 100%</p>\r\n\r\n<p>sole: Rubber 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'2iBXMb',NULL,NULL,1,0,1,'2021-01-21 02:05:04','2021-01-21 02:05:04',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42.5'),(571,'Dark Brown Suede \'Gerald\' Chelsea Boots','dark-brown-suede-gerald-chelsea-boots',NULL,67,NULL,NULL,NULL,NULL,'<p>Constructed from smooth suede, these dark brown &#39;Gerald&#39; Chelsea boots feature burgundy elasticated side gores and black grosgrain heel pulls with &#39;Sports Stripe&#39; interior.</p>\r\n\r\n<p>Finished with smooth leather