ow Low-Top Sneakers','flow-low-top-sneakers',NULL,8,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Fendi Flow low-top sneakers</div>\r\n</div>\r\n\r\n<div class=\"_824b7a _9584ff _d85b45\">\r\n<p>Refresh your sneaker edit with Fendi. The Fendi Flow low-top sneakers have been made from white calf leather and are detailed with logo lettering at the heel counter. Step out in pure style.</p>\r\n</div>\r\n\r\n<div class=\"_6e1e52 _9584ff _d46645 _d85b45\">\r\n<h4><strong>Highlights</strong></h4>\r\n\r\n<ul>\r\n	<li>white</li>\r\n	<li>calf leather</li>\r\n	<li>branded heel counter</li>\r\n	<li>round toe</li>\r\n	<li>front lace-up fastening</li>\r\n	<li>zip fastening</li>\r\n	<li>flat rubber sole</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff _d8b821\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>outer: Calf Leather 100%, Polyamide 100%</p>\r\n\r\n<p>lining: Polyester 100%</p>\r\n\r\n<p>sole: Rubber 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'tLiRYL',NULL,NULL,1,0,1,'2021-01-21 02:51:34','2021-01-21 02:51:34',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42.5'),(578,'Daymaster Two-Tone Sneakers','daymaster-two-tone-sneakers',NULL,22,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Daymaster two-tone sneakers</div>\r\n</div>\r\n\r\n<div class=\"_9584ff\">\r\n<p>The humble &#39;chunky dad sneaker&#39; gets a sleek update by Dolce &amp; Gabbana. These two-tone Daymaster pair are set on a chunky rubber sole that is every bit as comfortable as it looks. The 80s called, they want them back. Featuring a two-tone design, a rubber sole and a front lace-up detail and a contrasting mirrored heel.</p>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<