<li>Protect from direct light, heat and rain. Should it become wet, dry it immediately with a soft cloth</li>\r\n	<li>Fill shoe with tissue paper to help maintain the shape and absorb humidity, then store in the provided flannel bag and box</li>\r\n	<li>Clean with a soft, dry cloth or brush</li>\r\n</ul>\r\n</div>',2,NULL,'AOfvyR',NULL,NULL,1,0,1,'2021-01-21 22:45:52','2021-03-14 23:12:29',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(608,'Icon Pool Slide-Green','icon-pool-slide-green',NULL,21,NULL,NULL,NULL,NULL,'<div class=\"rte\">\r\n<p>New season khaki green ICON sliders from <a href=\"https://www.brother2brother.co.uk/dsquared2-m2761\">DSQUARED2</a>. Perfect for the summer, made with a rubber moulded footbed with the brand&#39;s famous ICON embossed across the front.</p>\r\n\r\n<ul>\r\n	<li>Colour:&nbsp;Green</li>\r\n	<li>Composition:&nbsp;Rubber</li>\r\n	<li>Open toe</li>\r\n	<li>ICON logo</li>\r\n	<li>Dsquared2 logo small detail to side</li>\r\n	<li>Pool Sliders</li>\r\n	<li>Black ICON print</li>\r\n</ul>\r\n</div>',2,NULL,'bEpztF',NULL,NULL,1,0,1,'2021-01-21 23:06:56','2021-01-21 23:06:56',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'40'),(609,'Rockstud Rubber Slides','rockstud-rubber-slides',NULL,18,NULL,NULL,NULL,NULL,'<p>Valentino Garavani imbues a casual wardrobe staple with its own rebellious attitude with these red Rockstud slides. They&rsquo;re made in Italy from rubber to an open toe and they&rsquo;re set on a moulded rubber insole and a camouflage-embossed sole, while the wide front strap is punctuated with two rows of signature studs in a light gold-tone finish.</p>\r\n\r\n<ul>\r\n	<li>COLOUR: Red</li>\r\n	<li>COMPOSITION: Rubber</li>\r\n	<li>COUNTRY OF ORIGIN: Italy</li>\r\n	<li>Open toe</li>\r\n	<li>Wide rubber front strap, pebbled-rubber embossed edge</li>\r\n	<li>Light gold-tone Rockstud embellishment</li>\r\n	<li>Red leather-effect moulded-rubber insole</li>\r\n	<li>Red camouflage-embossed rubber sole</li>\r\n</ul>',2,NULL,'mftWVM',NULL,NULL,1,0,1,'2021-01-21 23:20:35','2021-01-21 23:20:35',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41'),(610,'Industrial Logo Slides','industrial-logo-slides',NULL,26,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Industrial Logo Slides</div>\r\n</div>\r\n\r\n<div class=\"_824b7a _9584ff _d85b45\">\r\n<p>Make your poolside look a good one. These black and yellow Industrial logo slides from Off-White are decorated with jacquard-woven logo strap across the top. Slip them on for instant style.</p>\r\n</div>\r\n\r\n<div class=\"_6e1e52 _9584ff _d46645 _d85b45\">\r\n<h4><strong>Highlights</strong></h4>\r\n\r\n<ul>\r\n	<li>black/yellow</li>\r\n	<li>jacquard logo motif</li>\r\n	<li>slip-on style</li>\r\n	<li>open toe</li>\r\n	<li>round toe</li>\r\n	<li>flat rubber sole</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>outer: Polyurethane 100%</p>\r\n\r\n<p>lining: Polyurethane 100%</p>\r\n\r\n<p>sole: Rubber 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'zA98eE',NULL,NULL,1,0,1,'2021-01-21 23:32:01','2021-01-21 23:32:01',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(611,'Rubber Slide Sandals','rubber-slide-sandals',NULL,16,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Rubber slide sandals</div>\r\n</div>\r\n\r\n<div class=\"_9584ff\">\r\n<ul>\r\n	<li>The slide sandal features a Sylvie Web detail across the strap</li>\r\n	<li>The blue, red and white stripe first appeared on the Sylvie bag and has quickly become a symbolic House code.</li>\r\n	<li>Black rubber sole with Sylvie Web rubber strap.</li>\r\n	<li>Gucci logo embossed on the sole.</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"_20ef65 _