g zip slot and phone slot. Gray-silver Dolce &amp; Gabbana logo on side, made in Italy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Colors: Petrol Blue</li>\r\n	<li>Style:&nbsp;Large Hand Bag</li>\r\n	<li>Fabrics: Genuine Leather</li>\r\n	<li>(Removable) Strap / Lock (Key Included)/&nbsp;&nbsp;Internal Smartphone Ppocket</li>\r\n	<li>Size: 40&nbsp;x&nbsp;28 x 9cm -&nbsp;16 x&nbsp;11 x 3.6&quot;</li>\r\n	<li>Brand:&nbsp;Dolce &amp; Gabbana</li>\r\n	<li>Original Dolce &amp; Gabbana Logo Dust Bag</li>\r\n	<li>Origin: Made in Italy</li>\r\n	<li>Authentic</li>\r\n</ul>',2,NULL,'Zyu6ud',NULL,1,1,0,0,'2021-02-13 18:40:11','2021-02-15 07:12:17',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/DftFabNWhaCZ6EeByUh2vz6peMbjS3wTdJmj4P8Y.jpg',NULL,NULL,'simple',0,''),(678,'Black Laptop Bag with Military Designer Patch','black-laptop-bag-with-military-designer-patch',350000,22,NULL,NULL,NULL,NULL,'<p>Black calf leather&nbsp;laptop bag from Dolce &amp; Gabbana featuring round top handles, a top zip fastening , a military designer patch&nbsp;and a gold-tone logo plaque</p>\r\n\r\n<p>&nbsp;</p>',2,NULL,'7LW1Qu',NULL,1,1,0,0,'2021-02-13 19:33:27','2021-02-13 19:34:18',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/dlOOKvlUD4we6a85b9YRIVrnIRRrKfzSkDus530q.jpg',NULL,NULL,'simple',0,''),(679,'Doctor’s Bag','doctors-bag',600000,21,NULL,NULL,NULL,NULL,'<p>One apple a day keeps the doctor away. But nothing can keep this black leather Doctor bag from dsquared2&nbsp;from you. Disclaimer though: you might still need to actually make an appointment in case you catch something. Although mighty fashionable,&nbsp;this tote is yet to cure colds.</p>\r\n\r\n<h4>Highlights</h4>\r\n\r\n<ul>\r\n	<li>black</li>\r\n	<li>leather</li>\r\n	<li>gold-tone hardware</li>\r\n	<li>single rounded top handle</li>\r\n	<li>leather lining</li>\r\n</ul>',2,NULL,'Htgere',NULL,1,1,0,0,'2021-02-13 20:05:15','2021-02-13 20:06:12',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/74ia4vgY