Dolce &amp; Gabbana classic leather briefcase will look great perched on the large oak desk in your corner office of the new sky-rise on Wall Street. Crafted in Italy from a luxurious brown&nbsp;textured leather, this man-bag oozes sophistication and charm. It features a traditional silhouette complete with two structured top handles, a detachable&nbsp;shoulder strap that can be adjusted, a secure zip around fastening and interior pockets to keep your confidential papers organised. Finished with a gold designer logo punctuated on the front.</p>\r\n\r\n<p>Size &amp; Fit</p>\r\n\r\n<p>HANDLE DROP LENGTH: 16 cm / 6.5 inches<br />\r\nSHOULDER STRAP DROP LENGTH: &nbsp;65 cm / 25.5 inches<br />\r\nWIDTH: 37 cm / 14.5 inches<br />\r\nHEIGHT: 29 cm / 11.5 inches<br />\r\nDEPTH: 6 cm / 2.5 inches&nbsp;</p>\r\n\r\n<p>Materials &amp; Product Care</p>\r\n\r\n<p>Outer&nbsp;Composition:&nbsp;Calf Leather&nbsp;100%</p>\r\n\r\n<p>Composition:&nbsp;Calf Leather&nbsp;0%</p>',2,NULL,'4Ffj41',NULL,1,1,0,0,'2021-02-14 09:38:59','2021-02-14 09:38:59',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/eXnVGThLClGrDcxcX0kopDJIJgSXvqQe99ObekFS.jpg',NULL,NULL,'simple',0,''),(687,'Men\'s Black Wool Trilby Hat','mens-black-wool-trilby-hat',120000,67,NULL,NULL,NULL,NULL,'<p>DESCRIPTION</p>\r\n\r\n<ul>\r\n	<li>Made in England from black wool,</li>\r\n	<li>this trilby hat features a grey grosgrain headband with &#39;Bright Stripe&#39; detail&nbsp;</li>\r\n	<li>finished with a black silky lining&nbsp;</li>\r\n	<li>leather inner headband.</li>\r\n</ul>\r\n\r\n<p>Composition</p>\r\n\r\n<ul>\r\n	<li>wool 100%</li>\r\n</ul>',2,NULL,'lyfXMm',NULL,1,1,0,0,'2021-02-14 10:18:07','2021-02-14 10:18:07',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/0J40KZJZLgVGs1tR0yrtFExLKlchR2zZUGChnV3s.jpg',NULL,NULL,'simple',0,''),(689,'Sicily Mini Embellished Velvet Bag','sicily-mini-embellished-velvet-bag',400000,22,NULL,NULL,NULL,NULL,'<p>Dolce &amp; Gabbana re-imagines its coveted &#39;Sicily&#39; bag in plush purple velvet accented with flowers&nbsp;- we love the mix of tactile textures. Exquisitely decorated with faux pearls, crystals .this structured piece has a satin twill-lined interior,Carry yours by the top handle, letting the removable chain shoulder strap gracefully drape at the back</p>\r\n\r\n<ul>\r\n	<li>purple&nbsp;velvet</li>\r\n	<li>Snap-fastening front flap</li>\r\n	<li>top handle</li>\r\n	<li>floral patch</li>\r\n	<li>Weighs approximately 2.2lbs/ 1kg</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'E7mCN9',NULL,1,1,0,0,'2021-02-14 11:50:21','2021-02-14 11:50:21',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/BHlRnfrcWDQ0U57Qfh52RpkJN46uyKl3XJxKDHZL.jpg',NULL,NULL,'simple',0,''),(690,'Welcome Bag','welcome-bag',550000,22,NULL,NULL,NULL,NULL,'<p>Dolce &amp; Gabbana&rsquo;s signature, aptly named, Sicily handbag pays tribute to the beauty of the Italian design duo&rsquo;s native Sicily. Exquisitely crafted from the finest calf leather in pink, the Welcome bag from Dolce &amp; Gabbana&#39;s Collection features a foldover top with vintage brass galvanized closure with logo and a press stud fastening, interior compartments divided by a partition and gold-tone hardware.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Outer: Calf Leather 100%</p>',2,NULL,'RYWdvC',NULL,1,1,0,0,'2021-02-14 12:28:16','2021-02-14 12:28:16',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/IMg7X2UedRF9sjCqSerU5tKGBB4lYPY7OlZhmwvP.jpg',NULL,NULL,'simple',0,''),(691,'Graffiti Animal Print Nylon Bag','graffiti-animal-print-nylon-bag',350000,22,NULL,NULL,NULL,NULL,'<p>Animal print nylon bag detailed with graffiti print, leather inserts, adjustable shoulder strap, two front zipped pockets, zip closure.</p>\r\n\r\n<p><strong>Composition and details</strong></p>\r\n\r\n<ul>\r\n	<li>62% Nylon</li>\r\n	<li>&nbsp;20% Calfskin</li>\r\n	<li>&nbsp;8% Viscose</li>\r\n	<li>&nbsp;6% Acrylic</li>\r\n	<li>4% Polyester</li>\r\n</ul>\r\n\r\n<p><strong>Size &amp; Fit</strong></p>\r\n\r\n<ul>\r\n	<li>W 9.45 x H 9.84 x D 3.15 inches</li>\r\n	<li>Drop: 23.62</li>\r\n	<li>W 24 x H 25 x D 8 cm</li>\r\n	<li>Drop: 60</li>\r\n</ul>',2,NULL,'jko2lh',NULL,1,1,0,0,'2021-02-14 12:39:16','2021-02-14 12:39:16',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/M9Nz1nm1x1ZWDBYW7JYzLfvkJTVzoPlm9MVHc5l7.jpg',NULL,NULL,'simple',0,''),(692,'Safari Messenger Bag','safari-messenger-bag',780000,12,NULL,NULL,NULL,NULL,'<p>Safari messenger bag in black&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Rubber &quot;Dior&quot; signature on the outside</li>\r\n	<li>Heat-embossed &quot;Dior&quot; signature on the inside</li>\r\n	<li>1 zipped pocket on the outside</li>\r\n	<li>Removable and adjustable shoulder strap in black grained calfskin with black nylon trim</li>\r\n	<li>Carried on the shoulder</li>\r\n	<li>Made in Italy</li>\r\n	<li>22 x 15 x 5 cm</li>\r\n</ul>',2,NULL,'FrD8dw',NULL,1,1,0,0,'2021-02-14 14:15:43','2021-02-14 14:15:43',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/V3j6flEw8JnYt1PYp2Cxlv2iFHerMZxX8kfuPkDg.jpg',NULL,NULL,'simple',0,''),(693,'Nappa Leather Millennials Bag','nappa-leather-millennials-bag',600000,22,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>The D&amp;G Millennials line is renewed with a new glamorous and feminine version.</li>\r\n	<li>The side bag is made of nappa calfskin and presents the new D&amp;G Millennials crossed logo in light galvanized gold: &bull;</li>\r\n	<li>Sliding cross-body chain strap with nappa calfskin insert allowing use as both a shoulder or side bag &bull;</li>\r\n	<li>Front flap with D&amp;G logo &bull;</li>\r\n	<li>Hidden press-stud closure &bull;</li>\r\n	<li>Internal calfskin structure with credit card holder space divided into three compartments and a smartphone pocket &bull;</li>\r\n	<li>Logoed dust bag matching the item &bull;</li>\r\n</ul>\r\n\r\n<p>Measurement: 23.5 x 16 x 5 cm - 9.3 x 6.3 x 5 inches &bull;</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<p>&nbsp;</p>',2,NULL,'OoLhSg',NULL,1,1,0,0,'2021-02-14 14:23:43','2021-02-14 14:24:23',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/fUN8P0JB3m74GGKvVgFdZF1SPQSjrPv7odIX6F8U.jpg',NULL,NULL,'simple',0,''),(695,'Mini Mystic Bag','mini-mystic-bag',750000,2,NULL,NULL,NULL,NULL,'<p>Sometimes it&#39;s fun being square. Just like this black leather mini Mystic bag from Givenchy. Which - as luck would have it - makes the perfect companion for sitting on the sofa and cancelling all your plans. Because what&#39;s better than an empty weekend? Nothing. Nothing at all. Featuring gold-tone hardware, a square body, a top handle, a detachable and adjustable shoulder strap, a foldover top, a front logo plaque and a rear slip pocket.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>Outer: Leather 100%</p>',2,NULL,'AFCfoQ',NULL,1,1,0,0,'2021-02-14 14:49:14','2021-02-14 14:49:14',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/XLkM42vKPzzUmpDjGTYNvr9LFTJeQ5PESG7sCt1w.jpg',NULL,NULL,'simple',0,''),(696,'King Of Love Belt Bag','king-of-love-belt-bag',350000,22,NULL,NULL,NULL,NULL,'<p>Life feels easy with a bag around your waist. Boasting a printed logo to its front and a zipper fastening, this belt bag from Dolce &amp; Gabbana is pretty simple and very effective. Because no hands is always better. Featuring an adjustable fit, a two-way zip fastening, a main internal compartment and an internal zipped pocket.</p>\r\n\r\n<h4>Made in Italy</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',2,NULL,'nV8LBM',NULL,1,1,0,0,'2021-02-15 07:47:04','2021-02-15 07:47:04',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/LUEnTRbopzskP1hhbP6b6rtR2Uj89URM19qEzoQz.jpg',NULL,NULL,'simple',0,''),(697,'Small Sicily Shoulder Bag','small-sicily-shoulder-bag',600000,22,NULL,NULL,NULL,NULL,'<p>Dolce &amp; Gabbana are the height of romanticism, femininity and Italian luxury. Along with bright colours and signature floral blooms, the designers behind the iconic brand are expert in fashioning timeless essentials for the woman of any age. Fashioned from luxe leather, this hot pink Sicily bag features a top handle, a foldover top with magnetic closure, an internal slip pocket, a gold-tone logo plaque and a detachable and adjustable shoulder strap. This stunning bag is finished with D&amp;G&#39;s trademark leopard print lining for a wild touch.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Outer: Leather 100%</p>',2,NULL,'aqA6ON',NULL,1,1,0,0,'2021-02-15 08:06:07','2021-02-15 08:06:07',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/w5T21znAtxranuT8MhKpzek57OyyM27HYR5sBLEc.jpg',NULL,NULL,'simple',0,''),(700,'Short Sleeves Logo Shirt','short-sleeves-logo-shirt',450000,11,NULL,NULL,NULL,NULL,'<p>Embody your favourite brand. With a logo print to the front and back of this T-shirt, your love for Balenciaga is undeniable</p>\r\n\r\n<ul>\r\n	<li>Shirt in orange cotton,</li>\r\n	<li>collar</li>\r\n	<li>short sleeves</li>\r\n	<li>&nbsp;frontal buttoning,</li>\r\n	<li>a chest pocket,&nbsp;</li>\r\n	<li>embroidered logo at the chest</li>\r\n</ul>',2,NULL,'vECSFg',NULL,1,1,0,0,'2021-02-15 18:43:46','2021-02-17 10:51:10',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/qIBj2d7GNQ7pwNSubrB4enM23tkRlethf3lY7JZm.jpg',NULL,NULL,'simple',0,''),(701,'Camouflaged Pinstripe Short Sleeved Shirt Black','camouflaged-pinstripe-short-sleeved-shirt-black',250000,30,NULL,NULL,NULL,NULL,'<p>Black camouflaged pinstripe shirt from Neil Barrett is in a camouflaged pinstripe design and features a classic collar.&nbsp;It also features short sleeves, a concealed front button placket and a curved hem.</p>\r\n\r\n<p>Neil Barrett has been a renowned designer for over two decades, working for brands including Prada and Gucci. He launched his eponymous line in 1999 and has built a strong signature style ever since with impeccable construction at the core. Renowned for striking, streamlined styling and immaculately cut suits, Neil Barrett always brings an element of grit to handsome collections that remain true to his signature pared-back style</p>\r\n\r\n<p>Printed cotton shirt detailed with pointy collar, short sleeves and turn-ups, covered button placket.</p>\r\n\r\n<p><strong>Composition and details</strong></p>\r\n\r\n<p>100% Cotton</p>',2,NULL,'55zn47',NULL,1,1,0,0,'2021-02-15 19:50:23','2021-02-17 10:51:41',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/91n6XoPZOPibz62qa6lEJnWof8ck95pIPENhz4mZ.jpg',NULL,NULL,'simple',0,''),(702,'Black Animalier T-shirt','black-animalier-t-shirt',200000,7,NULL,NULL,NULL,NULL,'<p>Black animalier women&#39;s tshirt VERSACE JEANS COUTURE. Versace pays homage to the Baroque style by releasing in its latest collection this model of short tshirt with animal print interwoven by the typical finishes of the artistic movement. VERSACE JEANS COUTURE logo clearly visible on the chest: the maison puts the focus on the manufacturing quality of its garments made since 1988.<br />\r\n<br />\r\nComposition: 100% cotton</p>',2,NULL,'z2QIKT',NULL,1,1,0,0,'2021-02-15 22:37:02','2021-02-15 22:37:02',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/WShGtvRhuq20TY3EsQztmuKM3LCijFePQjptdI9c.jpg',NULL,NULL,'simple',0,''),(703,'Short-Sleeved T-shirt With Floral Baroque Print','short-sleeved-t-shirt-with-floral-baroque-print',200000,7,NULL,NULL,NULL,NULL,'<h3><strong>&nbsp;Details</strong></h3>\r\n\r\n<p>&bull; Short-sleeved model<br />\r\n&bull; Crew neckline<br />\r\n&bull; Regular bottom<br />\r\n&bull; Stretch cotton fabric<br />\r\n&bull; Baroque and floral print<br />\r\n&bull; Maxi front logo print<br />\r\n<br />\r\n<br />\r\nComposition: 100% Cotton</p>',2,NULL,'FIjvAj',NULL,1,1,0,0,'2021-02-15 22:59:39','2021-02-15 22:59:39',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/PJGGePXSq93BvkaugA3jJKxGxa92mm9VHMlNVc5U.jpg',NULL,NULL,'simple',0,''),(704,'Anthurium Print T-shirt','anthurium-print-t-shirt',200000,22,NULL,NULL,NULL,NULL,'<p>Domenico Dolce and Stefano Gabbana are at the height of Italian luxury. Along with iconic prints and signature floral blooms, the notorious Italian designer duo are experts at fashioning timeless classics for the debonair uomo. This multicolour anthurium print T-shirt is crafted from cotton and features a round neck, short sleeves, a relaxed fit, a straight hem and a flower and logo print to the chest.</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Cotton 100%</p>\r\n\r\n<ul>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'CWytrn',NULL,1,1,0,0,'2021-02-15 23:06:11','2021-02-19 13:31:05',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/YGS23q8xolGXcyLDZNt9ia12VaClY8jupHYZnngh.jpg',NULL,NULL,'simple',0,''),(705,'Leopard Print Long Sleeve Shirt','leopard-print-long-sleeve-shirt',250000,23,NULL,NULL,NULL,NULL,'<h2>DESCRIPTION&nbsp;</h2>\r\n\r\n<p>Black long-sleeve shirt featuring a leopard-spot jacquard pattern.</p>\r\n\r\n<p>Central button fastening and buttoned cuffs.&nbsp;</p>',2,NULL,'L9bG10',NULL,1,1,0,0,'2021-02-15 23:26:46','2021-02-17 10:59:30',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/oe5RyihYUD2tZYEorlc6WnCAms2us6xA4wROjYIK.jpg',NULL,NULL,'simple',0,''),(706,'Oversize T-shirt With Interlocking G','oversize-t-shirt-with-interlocking-g',250000,16,NULL,NULL,NULL,NULL,'<p>The now recognizable oversize Gucci T-shirt continues to evolve with each new collection, the Interlocking G print is influenced by an &#39;80s design from the archives. Streetwear continues to be a defining feature of Gucci&#39;s collections and is often juxtaposed by tailored separates.</p>\r\n\r\n<ul>\r\n	<li>Black cotton jersey with wrinkled effect.&nbsp;</li>\r\n	<li>Interlocking G print.</li>\r\n	<li>Oversize fit.</li>\r\n	<li>100% cotton.</li>\r\n	<li>Made in Italy.</li>\r\n	<li>Material:Cotton.</li>\r\n</ul>',2,NULL,'CqGmip',NULL,1,1,0,0,'2021-02-15 23:33:50','2021-02-17 10:59:01',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/J6QMB2iClNLYi3BersqwJWuvUOHP4w38jEtIMEj2.jpg',NULL,NULL,'simple',0,''),(707,'Baroque Logo Print T-shirt','baroque-logo-print-t-shirt',200000,22,NULL,NULL,NULL,NULL,'<p>Sometimes all you need to complete an outfit is a basic tee. But not just any basic tee, this baroque logo print T-shirt from Dolce &amp; Gabbana, with it&#39;s baroque logo print to the front for a regal effect. You are D&amp;G Royalty after all.</p>\r\n\r\n<h4>Highlights</h4>\r\n\r\n<ul>\r\n	<li>white</li>\r\n	<li>cotton&nbsp;</li>\r\n	<li>baroque-pattern print</li>\r\n	<li>logo print to the front</li>\r\n	<li>round neck&nbsp;</li>\r\n	<li>short sleeves</li>\r\n</ul>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Cotton 100%</p>',2,NULL,'EDBoqI',NULL,1,1,0,0,'2021-02-16 00:00:20','2021-02-16 00:00:20',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/K8qvrlY2Xo67eXqB0dBNF7pjvsedeatjnfmX2m9u.jpg',NULL,NULL,'simple',0,''),(708,'Rare Spirit Printed T-shirt','rare-spirit-printed-t-shirt',250000,2,NULL,NULL,NULL,NULL,'<p>The worlds of high-fashion and streetwear alike look to Givenchy for its particularly Parisian notion of style, as seen in this black cotton Spirit printed tee. Featuring a crew neck, short sleeves, a straight hem and contrasting red printed logos on the front .</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Cotton 100%</p>',2,NULL,'b7wp0C',NULL,1,1,0,0,'2021-02-16 00:13:14','2021-02-17 10:58:14',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/qwjitZxDYt62f7voGf5OmO6Z3I353AqZZ23onO4L.jpg',NULL,NULL,'simple',0,''),(709,'Tribal Tarius Print T-Shirt','tribal-tarius-print-t-shirt',250000,2,NULL,NULL,NULL,NULL,'<p>This black Givenchy tribal Tarius graphic T-shirt is cut from 100% cotton and features a round neck, short sleeves, a relaxed fit and is embellished with a print of a bull on the front, &#39;GV Industries&#39; printed on the back and a printed brand logo on the chest. In ancient Greek mythology, the bull is a symbol of Zeus, the all-powerful head honcho of the gods. Now, I&#39;m not saying that this T-shirt has mythical, godlike powers, but I&#39;m pretty sure you&#39;ll feel godlike in it. Grab the bull by its proverbial horns and wear your new black Givenchy tribal Tarius T-shirt on your next boys night out.</p>\r\n\r\n<ul>\r\n	<li>Oversized Taurus Print Cotton T-shirt</li>\r\n	<li>Crewneck.</li>\r\n	<li>Printed front and back panels.</li>\r\n	<li>Cut for an oversized fit.</li>\r\n	<li>100% Cotton</li>\r\n</ul>',2,NULL,'76xaA3',NULL,1,1,0,0,'2021-02-16 00:18:53','2021-02-17 10:52:29',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/mQA3WUe84H4kPGql08dN3wl9Ug7UA8t8Kje8DeO3.jpg',NULL,NULL,'simple',0,''),(710,'Logo Racetrack Moccasin','logo-racetrack-moccasin',NULL,10,NULL,NULL,NULL,NULL,'<p>This sporty driving shoe in supple grained calf leather is distinguished by its elegant ruthenium accessory, inspired by the S-locks used on Louis Vuitton trunks.</p>\r\n\r\n<h2>Detailed features</h2>\r\n\r\n<ul>\r\n	<li>\r\n	<h2>Moccasin construction for extra lightness</h2>\r\n	</li>\r\n	<li>\r\n	<h2>no insole</h2>\r\n	</li>\r\n	<li>\r\n	<h2>ultra-supple sole with square rubber pads only at the front and back of the shoe</h2>\r\n	</li>\r\n	<li>\r\n	<h2>Grained calf leather</h2>\r\n	</li>\r\n</ul>',2,NULL,'hpT10i',NULL,NULL,1,0,1,'2021-02-16 00:39:33','2021-02-17 10:38:28',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/2UYHKTIeMhHlhyPP6np4y49zz7GwQCWzwFFKxu7a.jpg',NULL,NULL,'variable',0,'42.5'),(711,'Brown Major Loafer','brown-major-loafer',NULL,10,NULL,NULL,NULL,NULL,'<p>Louis Vuitton&#39;s classic Major loafer comes in the House&#39;s historic Damier canvas with dark-brown glazed calf-leather trim. This model is distinguished by its traditional Blake construction and hand-stitched vamp. The strap is finished with an iconic LV Initials accessory.</p>\r\n\r\n<h2>Detailed Features</h2>\r\n\r\n<ul>\r\n	<li>Damier canvas</li>\r\n	<li>Ebene</li>\r\n	<li>Hand-stitched vamp (1 hour per pair)</li>\r\n	<li>Blake construction</li>\r\n	<li>Leather outsole with rubber pads</li>\r\n	<li>LV Initials accessory</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'jom1hP',NULL,NULL,1,0,1,'2021-02-16 00:46:00','2021-02-17 10:40:53',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'47'),(712,'Blue Major Loafer','blue-major-loafer',NULL,10,NULL,NULL,NULL,NULL,'<p>One of Louis Vuitton&#39;s signature styles, the Major loafer is crafted from grained calf leather and finished with a metal LV Initials accessory. This model testifies to the House&#39;s shoemaking expertise with its traditionally hand-stitched vamp and Blake construction for immediate suppleness and comfort.</p>\r\n\r\n<h2>Detailed Features</h2>\r\n\r\n<ul>\r\n	<li>Grained calf leather</li>\r\n	<li>Blue</li>\r\n	<li>Hand-stitched vamp (1 hour per pair)</li>\r\n	<li>Blake construction</li>\r\n	<li>Rubber outsole</li>\r\n	<li>LV Initials accessory</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'Y1GDoB',NULL,NULL,1,0,1,'2021-02-16 00:52:28','2021-02-17 10:42:40',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41.5'),(713,'Leather Moccasin','leather-moccasin',NULL,24,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Composition:</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Soft Leather</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Details:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>textured leather,</li>\r\n	<li>logo,</li>\r\n	<li>solid colour,</li>\r\n	<li>round toeline,</li>\r\n	<li>rubber cleated sole,</li>\r\n	<li>flat</li>\r\n</ul>',2,NULL,'qaZDjz',NULL,NULL,1,0,1,'2021-02-16 01:12:00','2021-02-17 10:47:45',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44'),(714,'Leather loafer with Double G','leather-loafer-with-double-g',NULL,16,NULL,NULL,NULL,NULL,'<p>A leather loafer with a slim shape and slightly elongated toe, distinguished by silver-toned Double G hardware. Since the introduction of its classic shape in 1950s, the preppy-inspired shoe has continued its influence, redesigned with different details, in new forms and materials.</p>\r\n\r\n<ul>\r\n	<li>Black leather</li>\r\n	<li>Leather sole</li>\r\n	<li>Double G hardware</li>\r\n	<li>.5&quot; heel</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'fozElT',NULL,NULL,1,0,1,'2021-02-16 01:17:52','2021-03-14 23:14:00',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'40.5'),(715,'Black Velvet Beaded Loafers','black-velvet-beaded-loafers',NULL,22,NULL,NULL,NULL,NULL,'<p>Gorgeous brand new with tags, 100% Authentic&nbsp;<strong>Dolce &amp; Gabbana&nbsp;</strong>mens&nbsp;shoes.&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Model</strong>: Loafers&nbsp;</li>\r\n	<li><strong>Color</strong>: Black</li>\r\n	<li><strong>Material</strong>: 100% Cotton Velvet</li>\r\n	<li>Crystals and beads</li>\r\n	<li>Bordeaux leather sole</li>\r\n	<li>Logo details</li>\r\n</ul>\r\n\r\n<p>Made in Italy<br />\r\nVery exclusive and high craftsmanship</p>',2,NULL,'KRpua6',NULL,NULL,1,0,1,'2021-02-16 01:30:54','2021-02-16 01:30:54',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(716,'Men\'s Black Epi Leather Major Loafer','mens-black-epi-leather-major-loafer',NULL,10,NULL,NULL,NULL,NULL,'<p>chic and sophisticated, these Major Louis Vuitton loafers are crafted from a black&nbsp;epi leather body and comes detailed with silver-tone &#39;LV&#39; logo on the front. They are set on a leather sole and looks best when styled with linen pants or chinos.</p>\r\n\r\n<ul>\r\n	<li>Hardware: Silver-tone.</li>\r\n	<li>Lining Material: Leather.</li>\r\n	<li>Exterior Material : Leather</li>\r\n	<li>Sole Material: Leather.</li>\r\n	<li>Origin: Italy.</li>\r\n	<li>Outsole Length: 30 CM.</li>\r\n	<li>Outsole Width: 11 CM.</li>\r\n</ul>',2,NULL,'7ERpM7',NULL,NULL,1,0,1,'2021-02-16 01:39:44','2021-02-16 01:39:44',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42.5'),(717,'Men\'s Black Velvet Logo Loafers','mens-black-velvet-logo-loafers',NULL,22,NULL,NULL,NULL,NULL,'<p>Dolce &amp; Gabbana&#39;s classic men&#39;s footwear is expertly crafted from the finest artisan techniques in Italy. Presenting a slip-on style