iable',0,'45'),(720,'Dandelion loafers- Brown','dandelion-loafers-brown',NULL,27,NULL,NULL,NULL,NULL,'<p>Made from smooth leather, Christian Louboutin&#39;s Dandelion loafers are the perfect pair for bringing a dose of panache to smart outfits. They feature the brand&#39;s signature lacquered red sole and a soft leather lining.</p>\r\n\r\n<p>Product details</p>\r\n\r\n<ul>\r\n	<li>Made in&nbsp;Italy</li>\r\n	<li>Colour&nbsp;Brown</li>\r\n	<li>Designer&nbsp;Christian Louboutin</li>\r\n	<li>Material&nbsp;Leather</li>\r\n</ul>',2,NULL,'y1p8UY',NULL,NULL,1,0,1,'2021-02-17 12:44:20','2021-02-22 11:48:57',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41'),(721,'Vertical Strip Trouser','vertical-strip-trouser',250000,22,NULL,NULL,NULL,NULL,'<p>Black and white, the perfect match of all times! Whether you&#39;re going for a casual or event classic look, the&nbsp;vertical stripped&nbsp;logo patch pant&nbsp; from Dolce &amp; Gabbana will instantly be an upgrade. Simple, but super stylish.black and white vertical striped pants is extremely comfortable to rock throughout the day as well!</p>\r\n\r\n<h4>Highlights</h4>\r\n\r\n<ul>\r\n	<li>black</li>\r\n	<li>virgin wool</li>\r\n	<li>vertical strip&nbsp;pattern</li>\r\n	<li>high waist</li>\r\n	<li>belt loops</li>\r\n	<li>front button and zip fastening</li>\r\n	<li>back pocket with logo patch</li>\r\n</ul>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>&nbsp;</h4>',2,NULL,'5BLrxH',NULL,1,1,0,0,'2021-02-18 10:05:52','2021-02-18 10:07:26',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/P50g5f9sgWoP7tOPlHm31wwcypNliza4LsBEKqlU.jpg',NULL,NULL,'simple',0,''),(722,'Roaster Tail Feathers Mules','roaster-tail-feathers-mules',NULL,64,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>These sliders are hand-made and their base is crafted from black suede</li>\r\n	<li>The feather work is entirely artisanal and made from small and soft rooster&#39;s tail feathers in iridescent &#39;black-dark green&#39;. This gorgeous colour is in its natural state, with the ocasional hue of purple also present depending on the direction of light. Each feather is attached with a special adhesive and meticulously glued one by one, covering the entire upper of the chinelo. The result is an impeccable blanket of feathers that goes from the top edge of the shoe, down to the line that meets the sole</li>\r\n	<li>It is entirely lined in super soft subtle goat leather</li>\r\n	<li>The sole is actually hand-made too. The insole and the outer sole are made from leather, same case of the heel. The latter is made from layers of cut, trimmed and sanded leather sheets, which are mounted onto a leather base to form the finished sole.</li>\r\n</ul>\r\n\r\n<p><strong>DETAILS</strong></p>\r\n\r\n<ul>\r\n	<li>Sliders in suede covered with rooster&#39;s tail feathers</li>\r\n	<li>Fully lined in soft goatskin</li>\r\n	<li>Sole in 100% leather</li>\r\n</ul>',2,NULL,'AyPusv',NULL,NULL,1,0,1,'2021-02-18 11:32:26','2021-02-18 11:57:29',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42,43'),(723,'Slip On  Oxfords With 36 Hand-Stiched Accessories And Rivets','slip-on-oxfords-with-36-hand-stiched-accessories-and-rivets',NULL,64,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>This&nbsp;is a hand-made weekender made from soft cow leather</li>\r\n	<li>The leather apron overlay has decorative snap button closures on its sides</li>\r\n	<li>Many of the apron&rsquo;s objects have been custom-made for our brand, including all the embroidered badges and acrylic designs</li>\r\n	<li>It is entirely lined in super soft subtle goat leather and it has a shock absorbing insole for added comfort</li>\r\n	<li>The rubber sole is blake-stitched, which makes the sneakers more durable</li>\r\n	<li>Slip-on weekender with elastic gussets in cow leather leather</li>\r\n	<li>Leather apron with side snap button fastenings and branded rubber logo in black at the back</li>\r\n	<li>Non-removable badges and metallic accessories</li>\r\n	<li>Fully lined in soft goatskin</li>\r\n	<li>Sole in 100% rubber</li