02% elastane</p>',2,NULL,'PYGKd1',NULL,1,1,0,0,'2021-02-19 22:46:29','2021-02-19 22:46:29',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/rItXzDHOKRRkLfKXsM1KdnrMg64BqJA47I5dTaza.jpg',NULL,NULL,'simple',0,''),(742,'Millennials Striped Drawstring Pants','millennials-striped-drawstring-pants',250000,22,NULL,NULL,NULL,NULL,'<p>The brand combined sensuality with a Mediterranean aesthetic to create a unique take on contemporary fashion.&nbsp;Dolce &amp; Gabbana exude Sicilian elegance, taking inspiration from everyday Italian lifestyle. Crafted in Italy, these black cotton track trousers feature a drawstring waist, a straight leg, zipped side pockets, a rear pocket and a side stripe letters in yellow.</p>',2,NULL,'eNNAYa',NULL,1,1,0,0,'2021-02-20 00:15:30','2021-02-20 00:15:30',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/4fOzgOyuznxCfx16eu7vDSHvjBEZ5JWndiwrKae4.jpg',NULL,NULL,'simple',0,''),(743,'Welcome Amore Graffiti Medium Handbag','welcome-amore-graffiti-medium-handbag',750000,22,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Dolce &amp; Gabbana leather handbag with allover &quot;Amore&quot; graffiti features.</li>\r\n	<li>Padded double top handle.</li>\r\n	<li>Removable, adjustable shoulder strap.</li>\r\n	<li>Flap top with push-lock closure.</li>\r\n	<li>Multi-pocket interior.</li>\r\n	<li>Feet protect bottom of bag.</li>\r\n	<li>7.9&quot;H x 9.1&quot;W x 4.7&quot;D.</li>\r\n	<li>Made in Italy.</li>\r\n</ul>',2,NULL,'JZKFxQ',NULL,1,1,0,0,'2021-02-20 00:45:26','2021-02-23 13:30:14',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/X7i0IK5EYVifCAJTzNTmjwezPnuXKyiu29ilP9g8.jpg',NULL,NULL,'simple',0,''),(744,'Calfskin Graffiti Printed Welcome Satchel Rosso - Red','calfskin-graffiti-printed-welcome-satchel-rosso-red',750000,22,NULL,NULL,NULL,NULL,'<p>Dolce &amp; Gabbana introduce the Welcome tote for AW18. This new edition incorporates vintage details as seen on the galvanized brass fastening, which was created to achieve the retro look of a doorbell, reminiscent of those of the grand buildings of the 1800s, and in the top double handle made from different materials to give it a clear contrasting-colour effect. Fashioned from luxurious leather, this red leather Welcome tote features a foldover top, a gold-tone logo plaque, an internal zipped pocket, an internal slip pocket, a detachable shoulder strap and an endearing doodle style print across the bag for a playful finish. POSITIVELY CONSCIOUS: Galvan scores 3 out 5 by independent ethical brand rating agency Good On You. It has a high animal rating and it does not use fur, leather, exotic animal skin or angora.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Outer: Calf Leather 100%</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>&nbsp;</h2>',2,NULL,'TyryxW',NULL,1,1,0,0,'2021-02-20 01:04:26','2021-02-23 13:31:20',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/UsJKYmHQfsdmWKNvbdyfZfGpCD6g2hQj4ljjHLrA.jpg',NULL,NULL,'simple',0,''),(745,'Speed LT Sneakers','speed-lt-sneakers',NULL,11,NULL,NULL,NULL,NULL,'<p>Got a busy day speeding through the city ahead of you? You&#39;ll want these hi-top Speed sneakers from Balenciaga on your feet. Being rushed off your feet never looked chicer.</p>\r\n\r\n<h4>Highlights</h4>\r\n\r\n<ul>\r\n	<li>black</li>\r\n	<li>round toe</li>\r\n	<li>knitted construction</li>\r\n	<li>white logo print to the side</li>\r\n	<li>flat rubber sole</li>\r\n	<li>elasticated ankle</li>\r\n	<li>pull-on style</li>\r\n</ul>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Sole: Rubber 100%</p>\r\n\r\n<p>Lining: Fabric 100%</p>\r\n\r\n<p>Outer: Elastane 100%</p>',2,NULL,'S0kUb7',NULL,NULL,1,0,1,'2021-02-22 09:26:37','2021-02-22 13:39:14',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41'),(746,'Horse Piste Silk Twill Men\'s Long-Sleeve Shirt','horse-piste-silk-twill-mens-long-sleeve-shirt',450000,76,NULL,NULL,NULL,NULL,'<p>The&nbsp;<strong>Casablanca Horse Piste Silk Twill Short-Sleeve Shirt</strong>&nbsp;embodies Casablanca&rsquo;s identity with an imagery that combines luxury, paradisiacal vacations and elegance. Its print features a skier over the mountains among flags and snowed pine trees.</p>\r\n\r\n<ul>\r\n	<li>Style&nbsp;<strong>sophisticated</strong>.</li>\r\n	<li>Made in Italia.</li>\r\n	<li>Hidden button down and white and gold button on the collar.</li>\r\n	<li>Buttoned cuffs.</li>\r\n	<li>Color&nbsp;<strong>multicolor</strong>.</li>\r\n	<li>Made from&nbsp;<strong>100% silk twill</strong>.</li>\r\n</ul>',2,NULL,'PMqNdP',NULL,1,1,0,0,'2021-02-22 15:21:43','2021-04-06 08:21:16',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/PucZuuImKQPAa6vld3vAzBz4If3kUY1AnGlix491.jpg',NULL,NULL,'simple',0,''),(747,'Out Of Office \"OOO\" Sneakers Low-Tops','out-of-office-ooo-sneakers-low-tops',NULL,26,NULL,NULL,NULL,NULL,'<p>White &quot;OUT OF OFFICE&quot; sneakers featuring a black arrow on the side. Off-White&trade; logo on the back. Black and taupe rubber sole. White lace-up closure.<br />\r\nVirgil Abloh&mdash;Off-White&rsquo;s founder and creative director&mdash;wanted to create a tennis shoe with a late 1980&rsquo;s and early 1990&rsquo;s aesthetic, that could be worn all-day-every-day. The result: a low-top silhouette with hybridized street, basketball and running influences. The &ldquo;OUT OF OFFICE&rdquo; sneaker features a contrasting outsole with translucent gel insets, classic perforated toe vamps, a ribbed heel and a recontextualized logo.</p>\r\n\r\n<p>Material:&nbsp;100% Polyester&nbsp;100% Rubber&nbsp;100% Leather</p>',2,NULL,'MElUjm',NULL,NULL,1,0,1,'2021-02-23 11:38:58','2021-02-23 11:38:58',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41'),(748,'ODSY-1000 Low-Top Sneakers Blue','odsy-1000-low-top-sneakers-blue',NULL,26,NULL,NULL,NULL,NULL,'<p>A statement shoe, if we ever saw one. Off-White&#39;s ODSY-1000 sneakers feature some of the label&#39;s most iconic motifs, including an Arrow logo to the side and a marbled safety-tag, proving that less is not always more. Put your best foot forward.</p>\r\n\r\n<h4>Highlights</h4>\r\n\r\n<ul>\r\n	<li>white/multicolour</li>\r\n	<li>panelled design</li>\r\n	<li>signature Arrows motif</li>\r\n	<li>signature Safety tag</li>\r\n	<li>ridged rubber sole</li>\r\n	<li>logo patch at the tongue</li>\r\n	<li>round toe</li>\r\n	<li>pull-tab at the heel</li>\r\n	<li>branded insole</li>\r\n</ul>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Sole: Rubber 100%</p>\r\n\r\n<p>Outer: Polyester 100%</p>\r\n\r\n<p>Lining: Polyester 100%</p>',2,NULL,'hYcQjm',NULL,NULL,1,0,1,'2021-02-23 12:06:56','2021-02-23 12:06:56',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44'),(749,'Black Technical Mesh and Calfskin','black-technical-mesh-and-calfskin',NULL,12,NULL,NULL,NULL,NULL,'<p>The B22 sneaker takes inspiration from retro running styles. The chunky low-top silhouette is defined by a black calfskin and mesh-paneled upper set on a sculpted white and black rubber sole. The black mesh tongue and heel counter are complemented by black laces, while an embossed &#39;DIOR&#39; signature adorns the side. The sneaker can be contrasted with tailored suiting to add a fashionable sportswear touch.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Black technical mesh upper</li>\r\n	<li>Black smooth calfskin trim</li>\r\n	<li>Embossed &#39;DIOR&#39; signature on the side</li>\r\n	<li>Low-top silhouette</li>\r\n	<li>Lace-up style with nylon straps on tongue and heel</li>\r\n	<li>Nylon and calfskin lining</li>\r\n	<li>White rubber sole with black accents</li>\r\n	<li>Welded construction</li>\r\n	<li>Dust bag included</li>\r\n	<li>This model runs small: we recommend ordering a size larger than your normal shoe size</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'6hjnyf',NULL,NULL,1,0,1,'2021-02-23 12:23:41','2021-04-06 09:32:48',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44'),(750,'Shaded-effect Ff Print Low-top Sneakers','shaded-effect-ff-print-low-top-sneakers',NULL,8,NULL,NULL,NULL,NULL,'<p>Fendi is the only F-word worth knowing. Showcased on these black and yellow low-top sneakers, the brand&#39;s signature FF pattern reminds you of who you should swear by. Fendi my life! Featuring a monogram print, branded heel counter, a lace-up front fastening, a front logo plaque, a square toe and a ridged rubber sole</p>\r\n\r\n<ul>\r\n	<li>High-top coated textile sneakers in black.</li>\r\n	<li>Round toe.</li>\r\n	<li>Bonded jersey detailing at vamp.</li>\r\n	<li>Tonal bungee-style lace-up closure featuring black rubberized logo plaque.</li>\r\n	<li>Tonal buffed leather trim in black featuring embossed logo and tonal logo pattern at heel.</li>\r\n	<li>Treaded rubber sole in yellow featuring logo embossed at heel.</li>\r\n	<li>Color: Black</li>\r\n</ul>\r\n\r\n<p>Composition</p>\r\n\r\n<ul>\r\n	<li>Sole: Rubber 100%</li>\r\n	<li>Lining: Polyester 80%, Spandex/Elastane 20%</li>\r\n	<li>Outer: Polyamide 45%, Polyester 25%, Polyurethane 19%, Spandex/Elastane 11%</li>\r\n</ul>',2,NULL,'umLdzW',NULL,NULL,1,0,1,'2021-02-23 12:41:21','2021-02-23 12:41:21',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'45'),(751,'Rock Tejus Print','rock-tejus-print',NULL,16,NULL,NULL,NULL,NULL,'<p>Constructed in a diverse mix of leathers and fabrics, this women&#39;s sneaker borrows inspiration from the classic running shoe. Blending a tejus printed leather with distressed suede, reflective fabric and mesh trims, the shoe walked the Fall Winter 2019 runway. Various House details further enrich the sports influenced shape, with embroidered Gucci and G, Interlocking G rubber detail and Gucci vintage logo label.</p>\r\n\r\n<ul>\r\n	<li>Rock tejus printed leather, brown and distressed taupe suede, white and silver mesh, and yellow reflective fabric</li>\r\n	<li>Terry cloth lining</li>\r\n	<li>Embroidered G detail</li>\r\n	<li>Embroidered Gucci script</li>\r\n	<li>Interlocking G outsole detail</li>\r\n	<li>Rubber Interlocking G detail</li>\r\n	<li>Hand-painted contrast detail on the sole</li>\r\n	<li>Gucci vintage logo label</li>\r\n	<li>1.2&quot; height</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'BzENM9',NULL,NULL,1,0,1,'2021-02-23 13:00:35','2021-03-14 23:14:10',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41.5'),(752,'UltraPace Sneaker Mashes Vintage Design With Mixed-Materials','ultrapace-sneaker-mashes-vintage-design-with-mixed-materials',NULL,16,NULL,NULL,NULL,NULL,'<p><a href=\"https://hypebeast.com/tags/gucci\">Gucci</a>&nbsp;has returned to debut its latest silhouette: the UltraPace. From dusty suede overlays to faded palettes, the two colorways feature mash-up vintage design cues in a series of mixed materials.First up is the &ldquo;Green Pattern,&rdquo; accented with hits of glossy crocodile leather. The sneaker sees dark grey nubuck panels along the tongue, following through to the sidewalls and the toe cap. Delicate terry cloth lines the collars, complemented by green leather at the heel and toe cap. Topping off the upper&rsquo;s details, &ldquo;Gucci&rdquo; branding is placed at the tongue, upper eyelets and mudguards. The &ldquo;Multi&rdquo; colorway is constructed with the same designs, instead opting for a palette of black, red and amber. Both pieces come with Gucci&rsquo;s vintage logo at the tongue, while their cream-colored midsoles have been slightly scuffed, further offset by contrasting hues.</p>\r\n\r\n<p>&nbsp;</p>',2,NULL,'j2OPqO',NULL,NULL,1,0,1,'2021-02-23 13:10:07','2021-03-14 23:14:18',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43.5'),(753,'Silver Sparkling Fabric Men\'s Ultrapace Sneakers','silver-sparkling-fabric-mens-ultrapace-sneakers',NULL,16,NULL,NULL,NULL,NULL,'<p>Reflecting Gucci&rsquo;s curated approach to design, this sneaker borrows inspiration from the classic running shoe. Different shades of silver in diverse materials such as metallic leather, and sparkling and reflective fabric mix together for a chromatic, color-block effect. Various House details enrich the sports influenced shape, including the embroidered Gucci and G, Interlocking G rubber detail and the Gucci vintage logo label.</p>\r\n\r\n<ul>\r\n	<li>Silver sparkling fabric, silver metallic leather, silver and grey mesh, and grey reflective fabric</li>\r\n	<li>Men&#39;s</li>\r\n	<li>Terry cloth lining</li>\r\n	<li>Embroidered G detail</li>\r\n	<li>Embroidered Gucci script</li>\r\n	<li>Interlocking G outsole detail</li>\r\n	<li>Rubber Interlocking G detail</li>\r\n	<li>Hand-painted contrast detail on the sole</li>\r\n	<li>Gucci vintage logo label</li>\r\n	<li>1.2&quot; height</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'EAKO6B',NULL,NULL,1,0,1,'2021-02-23 13:22:01','2021-03-14 23:14:29',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44,45'),(754,'Striped Shirt','striped-shirt',200000,77,NULL,NULL,NULL,NULL,'<p><strong>DETAILS</strong></p>\r\n\r\n<ul>\r\n	<li>Plain weave</li>\r\n	<li>No appliqu&eacute;s</li>\r\n	<li>Stripes</li>\r\n	<li>Snap button fastening</li>\r\n	<li>Snap button cuffs</li>\r\n	<li>Long sleeves</li>\r\n	<li>Mandarin collar</li>\r\n	<li>No pockets</li>\r\n</ul>\r\n\r\n<p><strong>COMPOSITION</strong></p>\r\n\r\n<p>78% Cotton</p>\r\n\r\n<p>22% Silk</p>',2,NULL,'Nzbk0r',NULL,1,1,0,0,'2021-02-25 00:08:46','2021-04-06 08:22:55',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/GuKGDxmxh9xor3xx3taj1tNci3wDKrqc2nrQvkRX.jpg',NULL,NULL,'simple',0,''),(755,'Logo Plaque Shirt','logo-plaque-shirt',200000,21,NULL,NULL,NULL,NULL,'<p>An essential piece on any man&#39;s wardrobe, right? This white cotton-blend logo plaque shirt from DSQUARED2 is a timeless classic! From casual or classic, it will fit perfectly anyway. Featuring a classic collar, a front button fastening, a logo plaque, long sleeves, button cuffs, a curved hem and a straight fit.</p>\r\n\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>Cotton 97%</p>\r\n\r\n<p>Spandex/Elastane 3%</p>',2,NULL,'xVo82S',NULL,1,1,0,0,'2021-02-25 00:15:24','2021-04-06 08:24:17',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/wGcmzMDWssTn9ayvqGGQMYRK0EErEYNXDytiRPA0.jpg',NULL,NULL,'simple',0,''),(756,'Lierre Dandy Flat Loafers','lierre-dandy-flat-loafers',NULL,27,NULL,NULL,NULL,NULL,'<p>These super-chic loafers for men are designed of purple embroidered fabric. These shoes also feature the iconic shiny red lacquered soles. Make a statement with these stylish loafers with the iconic style of Christian Louboutin!</p>',2,NULL,'Xj24n0',NULL,NULL,1,0,1,'2021-02-25 00:44:12','2021-02-25 00:44:12',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44'),(757,'Flats Montezumo Donna Flat Loafers','flats-montezumo-donna-flat-loafers',NULL,27,NULL,NULL,NULL,NULL,'<p>Classic masculine style isn&rsquo;t just for the guys. Get a garconne twist this season with &quot;Montezumo Donna&quot; in black leather. This traditional loafer is perfect for business or casual looks.&nbsp; Relax into effortless style&nbsp;In lustrous navy lacquered leather which gives your look a hint of James Dean</p>',2,NULL,'Pw8aqy',NULL,NULL,1,0,1,'2021-02-25 00:57:50','2021-02-25 00:57:50',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(758,'Tiger K-Skate Slip-on Mules','tiger-k-skate-slip-on-mules',NULL,78,NULL,NULL,NULL,NULL,'<p><strong>Description</strong></p>\r\n\r\n<p>A must-have summer piece, mules break with tradition in this design inspired by skate culture, marked by their relaxed, rock &#39;n&#39; roll style. Sportswear elements give them a strong look, which is reinforced by the image of the roaring tiger. The sole with a chevron motif adds the final touch by borrowing a classic element of trainer fashion.</p>\r\n\r\n<ul>\r\n	<li>K-Skate slip-on mules.</li>\r\n	<li>Tiger motif embroidered on the upper.</li>\r\n	<li>KENZO embossed on back of sole.</li>\r\n	<li>Elastic on the sides to make them easier to put on.</li>\r\n	<li>Leather inner lining.</li>\r\n	<li>3 cm rubber sole</li>\r\n</ul>\r\n\r\n<p><strong>Size &amp; fit</strong></p>\r\n\r\n<p>Sole height: 3 cm</p>',2,NULL,'hra8PT',NULL,NULL,1,0,1,'2021-02-25 01:08:24','2021-02-25 01:10:58',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41'),(759,'Gucci Gg Supreme Espadrille Loafers','gucci-gg-supreme-espadrille-loafers',NULL,16,NULL,NULL,NULL,NULL,'<p><strong>Details:</strong></p>\r\n\r\n<p>A hybrid design combines the elements of a loafer with an espadrille construction adorned with the iconic GG Supreme pattern. The traditional espadrille cord sole has a new molded shape, set on rubber. New shapes and signature Gucci lines are reimagined in a mix of fabrics and trims imbued with an inherently summer feel. Featuring a braided raffia sole, leather trimming, an all-over GG Supreme print and a gold-tone horsebit detail</p>\r\n\r\n<p><strong>Color</strong></p>\r\n\r\n<p>Blue</p>\r\n\r\n<p><strong>Material</strong></p>\r\n\r\n<p>Rubber</p>',2,NULL,'Qui1Oe',NULL,NULL,1,0,1,'2021-02-25 01:15:40','2021-03-14 23:14:38',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(760,'Dior Oblique Oversize Beige and Navy Blue Cotton Knit Shirt','dior-oblique-oversize-beige-and-navy-blue-cotton-knit-shirt',350000,25,NULL,NULL,NULL,NULL,'<p><strong>DESCRIPTION</strong></p>\r\n\r\n<p>This iconic Dior Oblique jacquard motif, which was introduced by the House in 1967, embellishes this cotton-knit overshirt. Featuring a classic collar and simple button fastening, it can be layered over a T-shirt or fine-gauge sweater.</p>\r\n\r\n<ul>\r\n	<li>All-over Dior Oblique jacquard motif</li>\r\n	<li>Shirt collar</li>\r\n	<li>Button fastening</li>\r\n	<li>Mother-of-pearl buttons with &#39;Dior&#39; logo</li>\r\n	<li>Long sleeves</li>\r\n	<li>Back length: 68cm/27&quot; (size M)</li>\r\n	<li>100% cotton (18-gauge)</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'QN5aO4',NULL,1,1,0,0,'2021-02-25 01:24:33','2021-04-06 09:29:05',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/DXTHDgKwaC27y2fGiwKchAj9pLzlF69B5yMfdoJA.jpg',NULL,NULL,'simple',0,''),(761,'Medium Vintage Check Bonded Cotton Bum Bag','medium-vintage-check-bonded-cotton-bum-bag',400000,6,NULL,NULL,NULL,NULL,'<p>DETAILS</p>\r\n\r\n<ul>\r\n	<li>A 1990s streetwear staple revived in Vintage check bonded cotton with leather accents. Carry it crossbody, by the strap or around the waist.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>31 x 7.5 x 16cm/12.2 x 3 x 6.3in</li>\r\n	<li>Min. strap length: 54cm/21.3in</li>\r\n	<li>Max. strap length: 126cm/49.6in</li>\r\n	<li>Outer: 80% cotton, 20% polyester</li>\r\n	<li>Trim: 100% calf leather</li>\r\n	<li>Lining: 60% cotton, 40% polyamide</li>\r\n	<li>Adjustable clip belt</li>\r\n	<li>One exterior back zip pocket, one interior patch pocket</li>\r\n	<li>Zip closure</li>\r\n	<li>Hand-painted edges</li>\r\n	<li>Polished metal hardware</li>\r\n</ul>',2,NULL,'XfEHDo',NULL,1,1,0,0,'2021-02-25 01:34:12','2021-02-25 01:34:12',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/PiTyrVdQKXMCwI8Qt4D1Q0yZxcWXipBsVcoqGNCO.jpg',NULL,NULL,'simple',0,''),(762,'Camouflage Pattern Flip Flops','camouflage-pattern-flip-flops',NULL,18,NULL,NULL,NULL,NULL,'<p>When the sun is shining and no clouds can you see, then it is obvious you should let your feet be free. So step out into warm streets in these black Valentino Garavani camouflage pattern flip flops that are ready to feel all the warmth from the sun rays. Featuring a thong style, a branded insole and a rubber sole.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<ul>\r\n	<li>Sole: Rubber 100%</li>\r\n	<li>Outer: Polyamide 100%</li>\r\n	<li>Lining: Polyamide 100%</li>\r\n</ul>',2,NULL,'0Hpabe',NULL,NULL,1,0,1,'2021-02-25 01:43:02','2021-02-25 01:43:02',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(763,'Steckel Stud-Embellished Leather Deck Shoes','steckel-stud-embellished-leather-deck-shoes',NULL,27,NULL,NULL,NULL,NULL,'<p><strong>DESCRIPTION</strong></p>\r\n\r\n<p>Christian Louboutin&rsquo;s blue leather Steckel deck shoes juxtapose nautical codes with silver-tone metal spikes for a rebellious verve. They&rsquo;re crafted in Italy and offset with brown, black and white panels and sit on a rubber rope-embossed midsole with a signature red sole. Fit runs true to size</p>\r\n\r\n<p><strong>DETAILS</strong></p>\r\n\r\n<ul>\r\n	<li>COLOUR: Blue</li>\r\n	<li>COMPOSITION: Leather.</li>\r\n	<li>COUNTRY OF ORIGIN: Italy</li>\r\n	<li>Blue, brown, black and white leather panels</li>\r\n	<li>Silver-tone metal spike embellishments</li>\r\n	<li>Beige leather lining and insole</li>\r\n	<li>White rope-embossed rubber midsole</li>\r\n	<li>Red rubber sole</li>\r\n</ul>',2,NULL,'5Tl9sm',NULL,NULL,1,0,1,'2021-02-25 02:10:16','2021-02-25 02:10:16',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(764,'Christian Louboutin Love Men Loafers','christian-louboutin-love-men-loafers',NULL,27,NULL,NULL,NULL,NULL,'<h3>PRODUCT DETAILS</h3>\r\n\r\n<p>Cloaked in black Glitter Tennis, Christian Louboutin&#39;s Venetian cut Love Met loafers bring simple sophistication to your ensembles. A luxurious and over-the-top take on the iconic Dandylove model displaying the word love meeting at the insole with the O, the Love family is growing with this metallic love composed of 18 different metallic studs: Pyramid studs, gold beads, sheel studs for a total of 77 metallic ornaments per pair. This new mix is applied on a gold Glitter Mini base to increase the galvanization of the studs. Grosgrain piping finish lends edge to the perfect city shoe. Looks like your sleeve is not the only place you wear your heart.&nbsp;<br />\r\n<br />\r\nLove your red soles&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Leather sole.</li>\r\n	<li>Lined interior.</li>\r\n	<li>Heel: 2,5 cm</li>\r\n</ul>\r\n\r\n<p>Made in Italy</p>',2,NULL,'13cXS4',NULL,NULL,1,0,1,'2021-02-25 02:25:11','2021-02-25 02:25:11',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(765,'Metallic Logo-print Cotton-jersey T-shirt','metallic-logo-print-cotton-jersey-t-shirt',250000,16,NULL,NULL,NULL,NULL,'<p>While we like every single iteration of Gucci &#39;s logo T-shirt, this one might be the most fun and eye-catching yet. It&#39;s cut from black cotton-jersey and emblazoned with the brand&#39;s name and interlocking Gs in multicoloured holographic font. Keep it casual with sweats, or wear it tucked-in with a dark suit.</p>\r\n\r\n<p>&nbsp;</p>',2,NULL,'GHZtww',NULL,1,1,0,0,'2021-02-25 10:40:28','2021-02-25 10:40:28',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/xRD9WpNeREYqi2nBM1qdQxJHe6RXudflCiAji9cV.jpg',NULL,NULL,'simple',0,''),(766,'Black Dior X Sorayama Dinosaur','black-dior-x-sorayama-dinosaur',300000,25,NULL,NULL,NULL,NULL,'<h2>This Dior x Sorayama Shirt features</h2>\r\n\r\n<ul>\r\n	<li>\r\n	<h2>a black cotton knit</h2>\r\n	</li>\r\n	<li>\r\n	<h2>short sleeves&nbsp;</h2>\r\n	</li>\r\n	<li>\r\n	<h2>ribbed collar&nbsp;</h2>\r\n	</li>\r\n	<li>\r\n	<h2>silver-tone metallic dinosaur and &#39;DIOR&#39;</h2>\r\n	</li>\r\n	<li>\r\n	<h2>pink floral print across the chest.</h2>\r\n	</li>\r\n</ul>\r\n\r\n<h4><strong>DESCRIPTION</strong></h4>\r\n\r\n<p>100% Cotton<br />\r\nMade in Italy</p>',2,NULL,'Fd7XVS',NULL,1,1,0,0,'2021-02-25 10:54:34','2021-02-25 10:54:34',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/YUN9sYsVSwBzQ4MJ4PtFg8cgjSgwSCaVf5FaVbgN.jpg',NULL,NULL,'simple',0,''),(767,'The Caten Bro’s T-Shirt- Red','the-caten-bros-t-shirt-red',150000,21,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>LOGO</li>\r\n	<li>PRINT</li>\r\n	<li>SHORT SLEEVES</li>\r\n	<li>CREW NECKLINE</li>\r\n	<li>RED</li>\r\n	<li>TRENDY</li>\r\n	<li>AUTUMN-WINTER</li>\r\n	<li>LEATHER TREND REPORT</li>\r\n	<li>MATERIALS: 100% CO</li>\r\n</ul>',2,NULL,'POT5hg',NULL,1,1,0,0,'2021-02-25 11:53:29','2021-02-25 11:53:29',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/AfOSYftAPl9ZNMzLDg64j3aOrL01scl0to15rWwY.jpg',NULL,NULL,'simple',0,''),(768,'UMC Tshirt In Black','umc-tshirt-in-black',170000,30,NULL,NULL,NULL,NULL,'<h2><strong>DESCRIPTION</strong></h2>\r\n\r\n<p>Neil Barrett UMC T Shirt in Black. Join us in celebrating our debut season with Neil Barrett! This t shirt arrives with a classic t shirt styling. A crew neck t shirt with short sleeves cut to a loose fit. Large print tot the front set in a music magazine style, celebrating the punk movement of the 1970&#39;s. Ribbed neckline.</p>\r\n\r\n<ul>\r\n	<li>Loose fit</li>\r\n	<li>Crew neck</li>\r\n	<li>Short sleeve</li>\r\n	<li>UMC Magazine print</li>\r\n	<li>100% Cotton</li>\r\n</ul>',2,NULL,'3Rcr2R',NULL,1,1,0,0,'2021-02-25 12:02:03','2021-02-25 12:02:03',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/UyLAHLLwotkvtJ0AlxaDzRZZhWZluseJDSSqUGDu.jpg',NULL,NULL,'simple',0,''),(769,'Lightning Bolt T-shirt','lightning-bolt-t-shirt',170000,30,NULL,NULL,NULL,NULL,'<p>Boasting Neil Barrett&#39;s emblem - the lightning bolt - this cotton and modal-blend T-shirt will strike a chord with your wardrobe. The lightning bolt makes a striking addition to your casualwear edit. It&#39;s electrifying! Featuring a round neck, short sleeves, a straight hem, a relaxed fit and a &nbsp;lightning bolt on the front.</p>',2,NULL,'yCMGb4',NULL,1,1,0,0,'2021-02-25 12:11:27','2021-02-25 12:12:08',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/1YHl35MsUA3zUbL7JQb6tqcf2Lwz3fpNyd4R31q1.jpg',NULL,NULL,'simple',0,''),(770,'Round Neck Logo T Shirt','round-neck-logo-t-shirt',170000,22,NULL,NULL,NULL,NULL,'<p>This black Dolce &amp; Gabbana logo t-shirt has more than a hint of the logo-obsessed, minimalist aesthetic of the 90s (incidentally, also the golden age of martial arts movies, alien goo and yo-yos). We&#39;re loving how the simple white lettering near the round neckline draws the eye, and turns a simple plain tee into a statement of sorts. Featuring short sleeves, a straight hem and pure cotton composition, wear your Dolce &amp; Gabbana top with&nbsp;<a href=\"https://www.brownsfashion.com/shopping/hessan-quilted-bomber-jacket-12403840\"><u>Dries Van Noten</u></a>,&nbsp;<a href=\"https://www.brownsfashion.com/shopping/colour-block-ankle-socks-12217122\"><u>Marni</u></a>&nbsp;and&nbsp;<a href=\"https://www.brownsfashion.com/shopping/black-drop-crotch-track-pants-12309405\"><u>Neil Barrett</u></a>.</p>\r\n\r\n<p><strong>Materials &amp; Product Care</strong></p>\r\n\r\n<p>Composition:&nbsp;Cotton&nbsp;100%</p>\r\n\r\n<p>Washing Instructions&nbsp;Machine Wash</p>',2,NULL,'8vhLYV',NULL,1,1,0,0,'2021-02-25 12:17:47','2021-02-25 12:17:47',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/BEq4VxD0a80PNG4TuYLiRjW7ycSyU9Yt2NwNDa9L.jpg',NULL,NULL,'simple',0,''),(771,'Chaos Print Cotton Jersey T-shirt','chaos-print-cotton-jersey-t-shirt',200000,20,NULL,NULL,NULL,NULL,'<p>Black cotton distressed T-shirt from Amiri featuring a round neck, short sleeves, a graphic print and a printed logo to the front.</p>\r\n\r\n<p>Material:</p>\r\n\r\n<ul>\r\n	<li>Cotton.Crewneck.</li>\r\n	<li>Ribbed collar.</li>\r\n	<li>Printed front panel.</li>\r\n</ul>\r\n\r\n<p>100%cotton</p>\r\n\r\n<p>Color: black</p>',2,NULL,'KMLVnS',NULL,1,1,0,0,'2021-02-25 12:22:45','2021-02-25 12:22:45',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/GBdVvUCnyXZoeygLnUx0Zv4FR9OHWWrgYkYeEo9F.jpg',NULL,NULL,'simple',0,''),(772,'Punk\'ed Bear\" Jersey T-shirt','punked-bear-jersey-t-shirt',170000,30,NULL,NULL,NULL,NULL,'<p><strong>PRODUCT DETAILS</strong></p>\r\n\r\n<p>The main collection&rsquo;s punk inspiration can give a rebellious edge to a teen boy&rsquo;s wardrobe. Made in Italy, this black cotton T-shirt features a Punke&rsquo;d Bear print set against a backdrop resembling tartan fabric.</p>\r\n\r\n<ul>\r\n	<li>Ribbed crew neck</li>\r\n	<li>Short sleeves</li>\r\n	<li>&ldquo;Punke&rsquo;d Bear&rdquo; motif</li>\r\n	<li>Neil Barrett logo on the back</li>\r\n	<li>100% cotton</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'MUCtuJ',NULL,1,1,0,0,'2021-02-25 12:26:27','2021-02-25 12:26:27',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/rk8gBa2zWlmV63t69WqA5WP1BhorOpXgWsAPJhAb.jpg',NULL,NULL,'simple',0,''),(773,'Allover Jewel Print T-Shirt','allover-jewel-print-t-shirt',180000,7,NULL,NULL,NULL,NULL,'<p><a href=\"https://www.eqvvs.co.uk/clothing-c37/t-shirts-tops-c40/versace-jeans-couture-allover-jewel-print-t-shirt-p16176#tab-s153494192759160-1\">PRODUCT DESCRIPTION</a></p>\r\n\r\n<p>The&nbsp;Allover Jewel Print T-Shirt by Versace Jeans Couture. This bold t-shirt takes inspiration from their baroque heritage with this bold allover print tee. This allover design&nbsp; is a luxurious gold jewel design - a true sign of Versace&#39;s premium quality.</p>\r\n\r\n<p><strong>Key features:</strong></p>\r\n\r\n<ul>\r\n	<li>Crew neck</li>\r\n	<li>Short sleeves</li>\r\n	<li>Allover baroque print</li>\r\n</ul>\r\n\r\n<p>MATERIAL</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>93% Cotton, 7% Elastane</p>\r\n	</li>\r\n	<li>Machine wash cold</li>\r\n</ul>',2,NULL,'TnDSgs',NULL,1,1,0,0,'2021-02-25 12:33:52','2021-02-25 12:33:52',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/sEUI6ZQ1kx8MhzNwFqVTNOtHY7vrcarrWUdXcqvh.jpg',NULL,NULL,'simple',0,''),(774,'Crystal Graphic T Shirt','crystal-graphic-t-shirt',200000,20,NULL,NULL,NULL,NULL,'<p>This black graphic T-shirt plays tribute to 1980&#39;s cult film The Lost Boys, the inspiration behind Mike Amiri&#39;s vampire-meets-rock star Autumn/Winter 2018 collection. Created in Los Angeles, it features the face of the movie&#39;s star Kiefer Sutherland in hand-placed Swarovski crystals and a studded motif across the back. Fits true to size.</p>',2,NULL,'k6h2j6',NULL,1,1,0,0,'2021-02-25 12:40:30','2021-02-25 12:40:30',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/pOfzHNHqxNnAkz2brMINLNSoP2DbApbJfcvwhY2A.jpg',NULL,NULL,'simple',0,''),(775,'All-Over Floral Print T-shirt','all-over-floral-print-t-shirt',170000,22,NULL,NULL,NULL,NULL,'<p>Dolce &amp; Gabbana know a thing or two about prints. Showcasing an exquisite floral print, this cotton black and multicolour T-shirt offers comfort and impeccable style. More is more when it comes to flowers.</p>\r\n\r\n<h4>Highlights</h4>\r\n\r\n<ul>\r\n	<li>black/multicolour</li>\r\n	<li>cotton</li>\r\n	<li>all-over floral print</li>\r\n	<li>round neck</li>\r\n	<li>short sleeves</li>\r\n</ul>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Cotton 100%</p>',2,NULL,'YffZRA',NULL,1,1,0,0,'2021-02-25 12:44:50','2021-02-25 12:44:50',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/NvJgw5wrLqcOPuYPOBNZmPijmD06IcXg2Zm98RoY.jpg',NULL,NULL,'simple',0,''),(776,'Leather Loafers With Logo Signature','leather-loafers-with-logo-signature',NULL,16,NULL,NULL,NULL,NULL,'<p>Gucci&#39;s black loafers are an update on the house&#39;s iconic shoe style &ndash; first launched in 1953. They&#39;re made in Italy to a slender silhouette with an almond toe and small stacked heel, then detailed with the signature antiqued metal Horsebit plaque across the high vamp . Let them bring a smart riff to casual ensembles.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"mCSB_container\" dir=\"ltr\" id=\"mCSB_2_container\" style=\"left:0px; position:relative; top:-34px\">\r\n<div class=\"pdp-accordion__content\">\r\n<div class=\"inner-content\">\r\n<ul>\r\n	<li>COLOUR: Black</li>\r\n	<li>COMPOSITION: Leather.</li>\r\n	<li>COUNTRY OF ORIGIN: Italy</li>\r\n	<li>Almond toe, small stacked heel</li>\r\n	<li>Antiqued gold-tone metal Horsebit front feature</li>\r\n	<li>Caramel-beige leather insole, lining and sole</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'ayI4VF',NULL,NULL,1,0,1,'2021-03-01 12:05:17','2021-03-14 23:14:50',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(777,'Leather Slippers With NY Yankees™ Patch','leather-slippers-with-ny-yankees-patch',NULL,16,NULL,NULL,NULL,NULL,'<div class=\"_1bcfc9\">\r\n<div class=\"_ab46e0\">\r\n<div class=\"_861fd5\" id=\"bannerComponents-Container\">Leather slippers with NY Yankees&trade; patch</div>\r\n</div>\r\n\r\n<div class=\"_ab46e0\">\r\n<p>In a collaboration that stemmed from the Creative Director&rsquo;s love for his Yankees baseball hat, Gucci incorporated a mix of Major League Baseball teams into the Fall Winter 2018 Fashion Show collection. Placed onto a green and red leather Web stripe, the New York Yankees&trade; patch decorates the black leather slipper shown on the Fall Winter 2018 runway, and is further enhanced by the oval enameled Double G detail. Black leather. Green and red leather Web. Embroidered New York Yankees&trade; patch. Oval enameled detail with metal Double G. These shoes will be delivered in an Original GG canvas pouch with a MLB&trade; label. Quilted satin footbed. 20mm height. Made in Italy. Major League Baseball trademarks and copyrights are used with permission of Major League Baseball Properties, Inc.</p>\r\n</div>\r\n\r\n<div class=\"_ab46e0 _df8766\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_1bcfc9\">\r\n<div class=\"_022d97 _ab46e0\">\r\n<div class=\"_1b910b _ab46e0\">\r\n<h4>Composition</h4>\r\n\r\n<p>sole: Leather 100%</p>\r\n\r\n<p>outer: Enamel 100%, metal 100%, Leather 100%</p>\r\n\r\n<p>lining: Satin 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'vU7q6B',NULL,NULL,1,0,1,'2021-03-01 12:09:15','2021-03-14 23:14:58',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41'),(778,'Queercore brogue monk shoes','queercore-brogue-monk-shoes',NULL,16,NULL,NULL,NULL,NULL,'<p>These black Gucci &#39;Queercore&#39; leather brogue monk shoes are best described through the words of our pal Jared Leto:&nbsp;&#39;Michele makes clothes for men that are as fun to wear as the clothes that women get to wear. There&#39;s a send of joy and celebration in it&#39;. These <u>Gucci</u> shoes boast a round toe, brogue detailing, two buckle strap closures, a silver-tone studded tiger head buckle, rear gold embroidered bee motif and a 25 mm heel.</p>\r\n\r\n<div style=\"height:auto\">\r\n<div>\r\n<div id=\"accordionBody-2\">\r\n<div class=\"_1dZf1\">\r\n<div>\r\n<div class=\"_2o9vf\">\r\n<p>Outer Composition: Leather 100%</p>\r\n\r\n<p>Lining Composition: Leather 100%</p>\r\n\r\n<p>Sole Composition: Leather 100%</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'bVldzX',NULL,NULL,1,0,1,'2021-03-01 12:20:04','2021-03-14 23:15:05',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(779,'Falacer Sneakers With Sequinned Web','falacer-sneakers-with-sequinned-web',NULL,16,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<p>The low-top sneaker is designed with a retro influence in leather with Web stripe along the sides. The back heels are finished with bee embroidered metallic leather in contrasting colors-a distinctive House detail that began with the Ace sneaker. White leather. White grosgrain trim. Leather blue and red Web. Red metallic leather detail on the back of one shoe and blue metallic leather detail on the back of the other shoe with gold embroidered bee. Rubber sole. 10mm height. Made in Italy.</p>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4>Composition</h4>\r\n\r\n<p>sole: Rubber 100%</p>\r\n\r\n<p>outer: Leather 100%</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<ul>\r\n	<li>Add a dash of Gucci to your wardrobe with these Falacer sneakers with sequinned Web for a bold off-duty look.</li>\r\n	<li>Crafted in italy from luxury off-white calf leather and leather, these sneakers are characterised by the signature green and red Web detail in sequinned embroidery to the sides and by the contrasting red and green heel counters with the bee motif embroidered in a gold-tone.</li>\r\n	<li>These Gucci sneakers also feature a round toe, a lace fastening, a branded insole and a flat rubber sole.</li>\r\n</ul>',2,NULL,'yP3IHx',NULL,NULL,1,0,1,'2021-03-01 12:33:11','2021-03-14 23:15:13',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(780,'Logo Signature Leather Espadrilles','logo-signature-leather-espadrilles',NULL,16,NULL,NULL,NULL,NULL,'<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\">Gucci Signature leather espadrilles</div>\r\n</div>\r\n\r\n<div class=\"_9584ff\">\r\n<p>A platform espadrille, made in heat debossed Gucci Signature leather resulting in a defined print with a firm texture. Black Gucci Signature leather with black leather trim. Cord platform. Materials made in Italy. Shoe constructed in Spain.</p>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4>Composition</h4>\r\n\r\n<p>sole: Rubber 100%</p>\r\n\r\n<p>outer: Leather 100%</p>\r\n</div>\r\n</div>\r\n</div>',2,NULL,'Lh5yGZ',NULL,NULL,1,0,1,'2021-03-01 12:48:43','2021-03-14 23:15:21',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(781,'Dublin GucciGhost Leather Slip-On Sneaker','dublin-guccighost-leather-slip-on-sneaker',NULL,16,NULL,NULL,NULL,NULL,'<div class=\"productCutline\">\r\n<div>\r\n<ul>\r\n	<li>Gucci calf leather skate sneaker in GG stars print created by GucciGhost, aka Trevor Andrew.</li>\r\n	<li>Elastic gored insets at sides.</li>\r\n	<li>Grosgrain loop at back heel counter in signature green/red/green web.</li>\r\n	<li>Molded leather footbed.</li>\r\n	<li>Contrast rubber sole.</li>\r\n	<li>Made in Italy.</li>\r\n</ul>\r\n</div>\r\n</div>',2,NULL,'RGywGF',NULL,NULL,1,0,1,'2021-03-01 13:16:44','2021-03-01 13:16:44',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(782,'Bloom Flower Print Blue GG Supreme Coated Canvas Slip Sneakers','bloom-flower-print-blue-gg-supreme-coated-canvas-slip-sneakers',NULL,16,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Made of GG Supreme canvas, Blue Blooms flower Print, Pull On Loop Tab</li>\r\n	<li>Leather trim, Slip on styling, Rubber sole, Gucci Script at rear heel</li>\r\n	<li>Outer Material: GG Supreme Coated Canvas</li>\r\n	<li>Measurements: 10 G; Insole length 11 3/8 inches</li>\r\n	<li>Original Gucci box, tags, and authenticity card included</li>\r\n	<li>Made in Italy</li>\r\