021-03-18 09:28:23',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(787,'Crown-Appliqué Cotton-Knit Polo Shirt','crown-applique-cotton-knit-polo-shirt',NULL,22,NULL,NULL,NULL,NULL,'<p><a href=\"javascript:void(0)\">DESCRIPTION</a></p>\r\n\r\n<p>&nbsp;Lend a regal edge to your basics edit with Dolce &amp; Gabbana&rsquo;s&nbsp;blue polo shirt. It&rsquo;s made in Italy from cotton with a soft knit texture and a subtle marl effect, then features a crystal-embellished crown appliqu&eacute; on the chest and gold stitching along the ribbed trims.</p>',2,NULL,'67ccIP',NULL,NULL,1,0,1,'2021-03-18 09:47:06','2021-03-18 09:47:36',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(788,'Dior x Shawn Stussy Logo Tshirt In Pink Cotton Tshirt','dior-x-shawn-stussy-logo-tshirt-in-pink-cotton-tshirt',NULL,12,NULL,NULL,NULL,NULL,'<p><strong>Description</strong></p>\r\n\r\n<ul>\r\n	<li>Limited Edition.</li>\r\n	<li>From the Fall 2020 Shawn Stussy Collaboration.</li>\r\n	<li>Men&#39;s pink and white Shawn Stussy for Dior dyed T-shirt with crew neck</li>\r\n	<li>&nbsp;short sleeves and logo graphic at front.</li>\r\n</ul>',2,NULL,'Sb8G5i',NULL,NULL,1,0,1,'2021-03-18 09:58:30','2021-03-18 09:58:30',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(789,'RC Monogram Print T-shirt','rc-monogram-print-t-shirt',NULL,46,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Roberto Cavalli Superior Quality and Design</li>\r\n	<li>Gold and red&nbsp;graphic logo</li>\r\n	<li>Crew neck</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'x5lZSN',NULL,NULL,1,0,1,'2021-03-18 10:17:59','2021-03-18 10:17:59',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(790,'Maple Leaf-Print Cotton-Jersey T-shirt','maple-leaf-print-cotton-jersey-t-shirt',NULL,21,NULL,NULL,NULL,NULL,'<p><a href=\"javascript:void(0)\">DESCRIPTION</a></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>DSquared&sup2;&rsquo;s white&nbsp;T-shirt is printed with a graphic logo that&#39;s merged with a maple leaf motif, paying tribute to founders Dean and Dan Caten&#39;s Canadian heritage. It&#39;s made from soft cotton jersey to a relaxed fit with a ribbed crew neck and subtle dropped shoulders.</p>\r\n	</li>\r\n</ul>',2,NULL,'uKBMP5',NULL,NULL,1,0,1,'2021-03-18 10:23:23','2021-03-18 10:23:23',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(791,'Plug-In Logo Print T-shirt - Black','plug-in-logo-print-t-shirt-black',NULL,20,NULL,NULL,NULL,NULL,'<h2>Tapping into LA&rsquo;s rock &lsquo;n&rsquo; roll scene, this tee arrives in a relaxed fit, exuding urban cool. Cut from a rich cotton Supima, the short sleeve jersey is decorated across the chest with a guitar cable graphic, complete with &lsquo;quality sound&rsquo; printed underneath for a bold finish.</h2>\r\n\r\n<p>&nbsp;</p>',2,NULL,'BTApzC',NULL,NULL,1,0,1,'2021-03-18 11:45:20','2021-03-18 11:45:20',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(792,'Abstract Face Graphic T-Shirt','abstract-face-graphic-t-shirt',NULL,30,NULL,NULL,NULL,NULL,'<p>The pen of autodidact artist February Jones never leaves the page to create one of her signature abstract portraits on the front and back.</p>\r\n\r\n<ul>\r\n	<li>Crewneck</li>\r\n	<li>Short sleeves</li>\r\n	<li>95% cotton, 5% elastane</li>\r\n	<li>Dry clean or machine wash, dry flat</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'BneNfO',NULL,NULL,1,0,1,'2021-03-18 13:24:27','2021-03-18 13:24:27',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(793,'Printed Cotton T-shirt In Majolica Print','printed-cotton-t-shirt-in-majolica-print',NULL,22,NULL,NULL,NULL,NULL,'<p>Classic Majolica and Sicilian influences continue to inspire collections. Colours, paintings and iconography meet to add a lively and fresh touch to your look.</p>\r\n\r\n<ul>\r\n	<li>&nbsp;Regular fit</li>\r\n	<li>&nbsp;Short sleeved</li>\r\n	<li>Round neckline with branded label</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'EujQiG',NULL,NULL,1,0,1,'2021-03-18 14:19:21','2021-03-18 14:19:21',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(794,'Skeleton Appliqué Tie-Dye Canvas Slip-On Trainers','skeleton-applique-tie-dye-canvas-slip-on-trainers',NULL,20,NULL,NULL,NULL,NULL,'<p><a href=\"javascript:void(0)\">DESCRIPTION</a></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Skeleton and bones are recurring Amiri motifs that are incorporated into these blue slip-on trainers in the form of white leather appliqu&eacute;s. They&#39;re crafted in Spain from tie-dyed canvas and set on a raised vulcanised-rubber sole.</p>\r\n	</li>\r\n	<li>\r\n	<p><a href=\"javascript:void(0)\">DETAILS</a></p>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>COLOUR: Blue</li>\r\n		<li>COMPOSITION: Canvas.</li>\r\n		<li>Blue, pink and grey tie-dye</li>\r\n		<li>White leather skeleton appliqu&eacute;, heel tab and lining</li>\r\n		<li>Black leather insole</li>\r\n		<li>Ivory rubber midsole and sole</li>\r\n	</ul>\r\n	</li>\r\n</ul>',2,NULL,'Jwppfl',NULL,NULL,1,0,1,'2021-03-18 14:32:40','2021-03-18 14:32:40',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(795,'2054 Multicolour Sneakers','2054-multicolour-sneakers',NULL,10,NULL,NULL,NULL,NULL,'<p>Introducing the new performance-inspired and tech line imagined by Men&rsquo;s Artistic Director Virgil Abloh.</p>\r\n\r\n<p>Launched for Spring-Summer 2020, the name fuses the present century with the year 1854, when Louis Vuitton was founded. Invoking an idea of a sartorial uniform two hundred years from its point of origin, Virgil Abloh aims to define a contemporary wardrobe by morphing of the codes of urban dressing and activewear. Louis Vuitton 2054 features fourteen pieces in a selection of styles and colors, each integrated with transformable functionalities.</p>',2,NULL,'i24w5S',NULL,NULL,1,0,1,'2021-03-19 01:08:18','2021-03-19 01:08:18',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'45'),(796,'Brown Croc Suede Lukas Boots','brown-croc-suede-lukas-boots',NULL,41,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Ankle-high croc-embossed calfskin suede boots in brown.</li>\r\n	<li>Pointed toe.</li>\r\n	<li>Zip closure at inner side.</li>\r\n	<li>Grained leather lining.</li>\r\n	<li>Stacked leather Cuban heel.</li>\r\n	<li>Tonal leather sole featuring rubber injection at heel.</li>\r\n	<li>Approx. 2&quot; heel.</li>\r\n</ul>\r\n\r\n<p>Material - Calfskin.</p>\r\n\r\n<p>Made in Italy.</p>',2,NULL,'W2Tj0p',NULL,NULL,1,0,1,'2021-03-19 01:20:10','2021-03-19 01:20:10',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44'),(797,'Beverly Hills Sneaker','beverly-hills-sneaker',NULL,10,NULL,NULL,NULL,NULL,'<p>Sneaker in glazed leather with a gold Monogram flowers signature and an extra light outsole.</p>\r\n\r\n<h2>Detailed Features</h2>\r\n\r\n<ul>\r\n	<li>Glazed leather</li>\r\n	<li>Gold Monogram flowers</li>\r\n	<li>Extra light outsole</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'rnESua',NULL,NULL,1,0,1,'2021-03-19 01:30:37','2021-03-19 01:30:37',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42.5'),(798,'Match-up Sneaker','match-up-sneaker',NULL,10,NULL,NULL,NULL,NULL,'<p>Sneaker in plain calf leather and Monogram canvas with rubber outsole.</p>\r\n\r\n<h2>Detailed Features</h2>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<ul>\r\n	<li>\r\n	<h2>&nbsp;Monogram coated canvas</h2>\r\n	</li>\r\n	<li>\r\n	<h2>&nbsp;Rubber outsole</h2>\r\n	</li>\r\n</ul>',2,NULL,'0Pc37n',NULL,NULL,1,0,1,'2021-03-19 01:38:05','2021-03-19 01:38:05',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(799,'Black 2054 Sneaker','black-2054-sneaker',NULL,10,NULL,NULL,NULL,NULL,'<p>Introducing the new performance-inspired and tech line imagined by Men&rsquo;s Artistic Director Virgil Abloh.</p>\r\n\r\n<p>Launched for Spring-Summer 2020, the name fuses the present century with the year 1854, when Louis Vuitton was founded. Invoking an idea of a sartorial uniform two hundred years from its point of origin, Virgil Abloh aims to define a contemporary wardrobe by morphing of the codes of urban dressing and activewear. Louis Vuitton 2054 features fourteen pieces in a selection of styles and colors, each integrated with transformable functionalities.</p>',2,NULL,'UzwIqJ',NULL,NULL,1,0,1,'2021-03-19 01:46:41','2021-03-19 01:46:41',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'39.5'),(800,'VLTN Giggies Low-Top Sneakers','vltn-giggies-low-top-sneakers',NULL,18,NULL,NULL,NULL,NULL,'<p>VLTN. What does that spell? It spells pure style and these low-top sneakers from Valentino Garavani. Go ahead, treat yourself.</p>\r\n\r\n<h4>Highlights</h4>\r\n\r\n<ul>\r\n	<li>black</li>\r\n	<li>canvas</li>\r\n	<li>logo print to the side</li>\r\n	<li>pull tab at the heel</li>\r\n	<li>branded lace-up fastening</li>\r\n	<li>round toe</li>\r\n	<li>flat rubber sole</li>\r\n</ul>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Sole: Rubber 100%</p>\r\n\r\n<p>Outer: Polyester 100%</p>\r\n\r\n<p>Lining: Bos Taurus 100%</p>',2,NULL,'QYlgCr',NULL,NULL,1,0,1,'2021-03-19 01:55:25','2021-03-19 01:55:25',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(801,'Dior x Judy Blame Black Safetypin T-Shirt','dior-x-judy-blame-black-safetypin-t-shirt',NULL,12,NULL,NULL,NULL,NULL,'<p><strong>DESCRIPTION</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The black T-shirt features the DIOR AND JUDY BLAME embroidery of the capsule collection in collaboration with Dior Men. Its loose-fitting cut makes it a versatile and comfortable piece, and the crew-neck collar is highlighted by a V-ribbed detail. The lightweight cotton jersey T-shirt will bring character to relaxed attire.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Black cotton jersey</li>\r\n	<li>Composition: 100% cotton</li>\r\n	<li>White DIOR AND JUDY BLAME embroidery on the front</li>\r\n	<li>Regular fit</li>\r\n	<li>Ribbed round collar with V detail</li>\r\n</ul>',2,NULL,'cfsAGR',NULL,NULL,1,0,1,'2021-03-22 17:00:14','2021-04-06 11:22:10',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'S,M'),(802,'Dior x Judy Blame Black Safetypin T-Shirt - White','dior-x-judy-blame-black-safetypin-t-shirt-white',NULL,12,NULL,NULL,NULL,NULL,'<p><strong>DESCRIPTION</strong></p>\r\n\r\n<p>The white T-shirt features the DIOR AND JUDY BLAME embroidery of the capsule collection in collaboration with Dior Men. Its loose-fitting cut makes it a versatile and comfortable piece, and the crew-neck collar is highlighted by V-ribbed detailing. The lightweight cotton jersey T-shirt will bring character to relaxed attire.</p>\r\n\r\n<ul>\r\n	<li>White cotton jersey</li>\r\n	<li>Composition: 100% cotton</li>\r\n	<li>Black DIOR AND JUDY BLAME embroidery on the front</li>\r\n	<li>Regular fit</li>\r\n	<li>Ribbed round collar with V detail</li>\r\n</ul>',2,NULL,'SdSqY6',NULL,NULL,1,0,1,'2021-03-22 17:11:09','2021-04-06 11:22:46',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'S,M'),(803,'DIOR AND SHAWN Bee Embroidered Oversize T-Shirt','dior-and-shawn-bee-embroidered-oversize-t-shirt',NULL,12,NULL,NULL,NULL,NULL,'<p><strong>DESCRIPTION</strong><br />\r\nThe white T-shirt is crafted from thick-woven cotton in an oversized fit. It is finished with the DIOR AND SHAWN interpretation of the signature bee, embroidered at the chest pocket. The T-shirt can be styled with jeans or joggers and an overshirt.<br />\r\nCOLOUR: White&nbsp;<br />\r\nCOMPOSITION: 100% Cotton<br />\r\nCARE: Hand wash<br />\r\nOversized fit&nbsp;<br />\r\nCrew neck, short sleeves</p>',2,NULL,'1jhmd1',NULL,NULL,1,0,1,'2021-03-26 15:31:15','2021-04-06 11:26:41',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'S,M'),(804,'Superhero Print Shirt In Green','superhero-print-shirt-in-green',NULL,22,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Green/multicolour</li>\r\n	<li>cotton</li>\r\n	<li>superhero print shirt from Dolce &amp; Gabbana featuring classic collar</li>\r\n	<li>front button fastening</li>\r\n	<li>long sleeves and superhero print.</li>\r\n</ul>',2,NULL,'we0fzr',NULL,NULL,1,0,1,'2021-03-26 16:19:34','2021-04-06 08:26:40',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L,XL'),(805,'Barocco Western Print Shirt','barocco-western-print-shirt',NULL,7,NULL,NULL,NULL,NULL,'<p>Hm...what do modern cowboys wear? Put your mind to rest, Versace is here to help - turns out they wear this shirt so they can amaze their enemies from miles away with its Barocco Western print. Giddy up, boy! Featuring a pointed collar, a front button fastening, long sleeves, button cuffs, a relaxed shape and a Barocco Western print.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Silk 100%</p>\r\n\r\n<h4>Washing instructions</h4>\r\n\r\n<p>Dry Clean Only</p>',2,NULL,'5gC6zm',NULL,NULL,1,0,1,'2021-03-26 18:00:36','2021-04-06 08:59:15',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'S,M'),(806,'Leopard Silk Woven Button-down Shirt In Yellow & Orange','leopard-silk-woven-button-down-shirt-in-yellow-orange',NULL,7,NULL,NULL,NULL,NULL,'<p>Ever a fan of the more is more philosophy, Ms Donatella Versace selected some of the boldest motifs from the house&#39;s archives and reworked them for its AW18 collection. This shirt has been made in Italy from fluid silk-twill and printed with a prowling leopard and ancient statues in gold, black and white.</p>\r\n\r\n<ul>\r\n	<li>Gold, black and white silk-twill&nbsp;</li>\r\n	<li>Classic collar, buttoned cuffs</li>\r\n	<li>Button fastenings&nbsp;</li>\r\n	<li>100% silk&nbsp;</li>\r\n	<li>Dry clean&nbsp;</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'bLg8gL',NULL,NULL,1,0,1,'2021-03-26 18:15:15','2021-04-06 09:03:07',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'S,M'),(807,'Baroque Leopard Print Pyjama Shirt','baroque-leopard-print-pyjama-shirt',NULL,7,NULL,NULL,NULL,NULL,'<p>Versace&rsquo;s menswear collection offers a relaxed take on luxury fashion, presenting sports-inspired silhouettes with signature prints, glamorous details and a newly-defined colour palette, and this white, brown and yellow silk baroque leopard print pyjama shirt is a stand-out. Featuring notched lapels, long sleeves, a front button fastening and front pockets.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Silk 100%</p>\r\n\r\n<h4>Washing instructions</h4>\r\n\r\n<p>Dry Clean Only</p>',2,NULL,'LB0gsp',NULL,NULL,1,0,1,'2021-03-27 01:24:31','2021-04-06 08:51:20',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'S,M'),(808,'Men\'s Yellow Leopard Baroque Print Trousers','mens-yellow-leopard-baroque-print-trousers',NULL,7,NULL,NULL,NULL,NULL,'<p>Legendary designer and founder Gianni Versace&rsquo;s groundbreaking vision helped to reshape the fashion industry and secured the brand&rsquo;s place as a symbol of glamour, decadence and luxury, as showcased by this brown and yellow silk leopard baroque print trousers. Featuring an elasticated waistband and a wide leg.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Silk 100%</p>\r\n\r\n<h4>Washing instructions</h4>\r\n\r\n<p>Dry Clean Only</p>',2,NULL,'uicUHn',NULL,NULL,1,0,1,'2021-03-27 01:34:28','2021-04-06 08:45:52',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'S,M'),(809,'Millennials Printed T-shirt Black','millennials-printed-t-shirt-black',NULL,22,NULL,NULL,NULL,NULL,'<p>this&nbsp;luxury fashion house was founded in 1985 and is well known for making all celebrities look fabulous. Taking their stylistic source, they also make everybody look like stars. You will be lounging in luxury wearing this black&nbsp;cotton Millennials printed T-shirt from Dolce &amp; Gabbana featuring short sleeves.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Cotton 100%</p>\r\n\r\n<h4>Washing instructions</h4>\r\n\r\n<p>Machine Wash</p>',2,NULL,'Z53HyT',NULL,NULL,1,0,1,'2021-03-27 02:32:19','2021-04-06 08:40:01',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'S,M'),(810,'Logo Label Cotton Shirt','logo-label-cotton-shirt',NULL,22,NULL,NULL,NULL,NULL,'<p>They conquered tailoring and now they can conquer the world, Dolce &amp; Gabbana have developed a reputation of the finest Italian-crafted formal-wear across the globe. Made by the best, for the best. This white cotton logo label shirt from Dolce &amp; Gabbana features a classic collar, a front button fastening, long sleeves, button cuffs and a tailored design.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Cotton 100%</p>\r\n\r\n<h4>Washing instructions</h4>\r\n\r\n<p>Machine Wash</p>',2,NULL,'rZCynh',NULL,NULL,1,0,1,'2021-03-27 03:17:57','2021-04-06 08:13:22',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'S,M'),(811,'Saturday Slip-On Leather Sneakers','saturday-slip-on-leather-sneakers',NULL,42,NULL,NULL,NULL,NULL,'<p><strong>Details</strong></p>\r\n\r\n<p>Easy-going slip-on sneakers with signature horsebit buckle made from smooth leather with a rubble sole.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>&nbsp;Leather upper</li>\r\n	<li>&nbsp;Round toe</li>\r\n	<li>&nbsp;Slip-on style</li>\r\n	<li>&nbsp;Leather lining</li>\r\n	<li>&nbsp;Rubber sole</li>\r\n	<li>&nbsp;Made in Italy</li>\r\n</ul>',2,NULL,'8u1L35',NULL,NULL,1,0,1,'2021-04-08 02:46:53','2021-04-08 02:46:53',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(812,'Gucci Blade Print T-shirt','gucci-blade-print-t-shirt',NULL,16,NULL,NULL,NULL,NULL,'<p>A slightly heavier quality of cotton jersey defines the T-shirts for Spring Summer 2019, resulting in an enhanced retro appearance. Designed with an oversize fit, this piece features the Gucci Blade print&mdash;a recurring motif of this season&mdash;presented in green and red, distinctive colors that speak to the House&#39;s equestrian roots. POSITIVELY CONSCIOUS: This product contains organic cotton where the cultivation and manufacturing process restrict the use of chemicals, eliminate pesticides or artificial fertilizers and incorporate methods that respect biodiversity, improve soil quality, and reduce water consumption.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Outer: Cotton 100%</p>',2,NULL,'RUsDYb',NULL,NULL,1,0,1,'2021-04-08 02:56:10','2021-04-08 02:56:10',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(813,'Oversized T-shirt with GG Print','oversized-t-shirt-with-gg-print',NULL,16,NULL,NULL,NULL,NULL,'<p>Designed with an oversized cut, this white cotton T-shirt is subjected to a stone-washed treatment that gives a lived-in effect. The green and red GG logo inspired by 80s prints stands out on the front. Faded memories of sports fields, gyms and colorful retro uniforms come to light, re-imagined in a contemporary key. White cotton jersey with stone-washed treatment, green and red vintage GG print, round neck, oversize cut, 100% cotton, Made in Italy.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Cotton 100%</p>',2,NULL,'0BPGTe',NULL,NULL,1,0,1,'2021-04-08 03:04:48','2021-04-08 03:04:48',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(814,'Oversized Logo-Print Cotton T-shirt - Blue','oversized-logo-print-cotton-t-shirt-blue',NULL,2,NULL,NULL,NULL,NULL,'<p><strong>DESCRIPTION</strong></p>\r\n\r\n<p>This blue T-shirt is printed across the chest with Givenchy&#39;s headquarters address in Paris, France, a subtle nod to the house&#39;s heritage. It&#39;s made from cotton jersey to an oversized silhouette that is reminiscent of the house&#39;s retro-tinged influences and finished with a ribbed crew neck.</p>\r\n\r\n<ul>\r\n	<li>COLOUR: Blue</li>\r\n	<li>COMPOSITION: 100% cotton.</li>\r\n</ul>',2,NULL,'np5HcA',NULL,NULL,1,0,1,'2021-04-08 03:16:32','2021-04-09 12:38:42',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(815,'Fiandra Intrecciato Leather Loafers','fiandra-intrecciato-leather-loafers',NULL,47,NULL,NULL,NULL,NULL,'<p>Bottega Veneta&#39;s Fiandra leather loafers exemplify the height of fine craftsmanship that the Italian label is known and loved for.</p>\r\n\r\n<p>A perfect showcase of the brand&#39;s signature woven leather technique, the Bottega Veneta Interweave loafers bring smart style to off-duty days. Crafted in leather, the traditional slipper design makes a well-paired partner to casual denim and tailoring alike.</p>\r\n\r\n<ul>\r\n	<li>Made of suede.</li>\r\n	<li>Decorated with a signature &#39;Intrecciato&#39; pattern.</li>\r\n	<li>Trimmed with red grosgrain.</li>\r\n	<li>Black leather sole</li>\r\n</ul>',2,NULL,'RHTAdN',NULL,NULL,1,0,1,'2021-04-08 03:35:10','2021-04-08 03:35:10',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41'),(816,'Logo Print Cotton T-shirt - White','logo-print-cotton-t-shirt-white',NULL,16,NULL,NULL,NULL,NULL,'<p>Some things need no introduction. Such as this white logo print cotton T-shirt from Gucci. Naturally so. Featuring a printed logo to the front, a round neck, short sleeves and a straight hem.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Outer: Cotton 100%</p>',2,NULL,'NPhH9j',NULL,NULL,1,0,1,'2021-04-08 03:42:27','2021-04-08 03:42:27',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(817,'Stripe Detail Slip-on Sneakers','stripe-detail-slip-on-sneakers',NULL,6,NULL,NULL,NULL,NULL,'<p><strong>DETAILS</strong></p>\r\n\r\n<p>They may appear simple at first, but you won&#39;t want to let these Burberry sneakers leave your feet. With a classic lace-up, low-top design, they&#39;re crafted in Italy from a durable blend of leather and rubber, while side stripe detailing ensures their affiliation to the cult British brand can&#39;t be missed. Embossed logo lettering to the heel provides a lasting final impression.&nbsp;these slip-on sneakers from Burberry are the perfect choice to make sure you run after yours in style. Enjoy every step!</p>\r\n\r\n<p><br />\r\n<strong>Highlights</strong></p>\r\n\r\n<ul>\r\n	<li>Leather/Rubber</li>\r\n	<li>Color: white</li>\r\n</ul>\r\n\r\n<p>Made in Italy<br />\r\n<strong>Composition</strong></p>\r\n\r\n<ul>\r\n	<li>Outer: Leather 100%</li>\r\n	<li>Lining: Leather 100%</li>\r\n	<li>Sole: Rubber 100%</li>\r\n</ul>',2,NULL,'3Oj80W',NULL,NULL,1,0,1,'2021-04-08 03:56:50','2021-04-08 03:56:50',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'45'),(818,'Embossed Anagram Espadrilles','embossed-anagram-espadrilles',NULL,79,NULL,NULL,NULL,NULL,'<p>The new season calls for a wardrobe update. Crafted from leather, these black espadrilles from LOEWE are elegantly detailed with the brand&#39;s signature embossed anagram at the upper. The perfect choice for a relaxed look that doesn&#39;t compromise on style. Featuring a round toe, a slip-on style, stitching details, a branded insole and a braided raffia sole.</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Sole: Leather 100%</p>',2,NULL,'TI1mFP',NULL,NULL,1,0,1,'2021-04-08 04:09:15','2021-04-08 04:09:15',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41'),(819,'Soft Sock Sneakers','soft-sock-sneakers',NULL,42,NULL,NULL,NULL,NULL,'<p>This&nbsp;Salvatore Ferragamo sock sneakers are simply decorated with tonal renditions of the brand&#39;s Gancini motif, constructed from stretchy comfortable fabric.</p>\r\n\r\n<p><strong>&nbsp;HIGHLIGHTS</strong></p>\r\n\r\n<ul>\r\n	<li>black</li>\r\n	<li>gancini print</li>\r\n	<li>sock style ankle</li>\r\n	<li>round toe</li>\r\n	<li>chunky rubber sole</li>\r\n</ul>\r\n\r\n<h3><strong>COMPOSITION</strong></h3>\r\n\r\n<p>Polyester 100%</p>',2,NULL,'YtpqTw',NULL,NULL,1,0,1,'2021-04-13 07:43:58','2021-04-13 07:43:58',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'44'),(820,'Cotton Polo With Web Collar','cotton-polo-with-web-collar',NULL,16,NULL,NULL,NULL,NULL,'<p>An unmistakable mark of the Gucci brand, the Web continues to make a strong statement on Alessandro Michele&#39;s designs. Here, it is represented in our classic green and red combination on a stretch cotton base. Ink blue stretch cotton piquet with green and red collar. Button-through placket with mother of pearl interlocking GG button at the collar. 93% cotton and 7% lycra. Made in Italy.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>Outer: Cotton 93%, Spandex/Elastane 7%</p>',2,NULL,'jcUcjh',NULL,NULL,1,0,1,'2021-04-13 08:36:00','2021-04-17 06:45:09',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(821,'Cotton polo with Web collar - White','cotton-polo-with-web-collar-white',NULL,16,NULL,NULL,NULL,NULL,'<p>An unmistakable mark of the Gucci brand, the Web continues to make a strong statement on Alessandro Michele&#39;s designs. Here, it is represented in our classic green and red combination on a stretch cotton base. White stretch cotton piquet with green and red collar. Button-through placket with mother of pearl interlocking GG button at the collar. 93% cotton and 7% lycra. Made in Italy.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>Outer: Cotton 93%, Spandex/Elastane 7%</p>',2,NULL,'o3tY8J',NULL,NULL,1,0,1,'2021-04-13 08:48:36','2021-04-13 08:48:36',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(822,'Slim Fit Bullion Link Cotton Poplin Dress Shirt','slim-fit-bullion-link-cotton-poplin-dress-shirt',NULL,6,NULL,NULL,NULL,NULL,'<p>A slim-fit dress shirt tailored from Italian cotton poplin, highlighted with a link detail in metallic bullion embroidery.</p>\r\n\r\n<p>Material:Cotton/Mother of Pearl.&nbsp;</p>\r\n\r\n<p>Color: black</p>',2,NULL,'NWEnr7',NULL,NULL,1,0,1,'2021-04-13 09:05:25','2021-04-21 21:50:24',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(823,'Chain Collar Shirt','chain-collar-shirt',NULL,6,NULL,NULL,NULL,NULL,'<p>Classic British label Burberry has revamped its image, delivering more contemporary styles with a fresh finish. Of course, their signature Check pattern continues to be a globally-recognised mainstay in every collection. Made from cotton, this white shirt has a classic style and fit, with an embroidered chain on the collar.</p>\r\n\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>Cotton 100%</p>',2,NULL,'CpbLK0',NULL,NULL,1,0,1,'2021-04-13 10:00:19','2021-04-21 21:45:56',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(824,'Otromundo Logo T-shirt','otromundo-logo-t-shirt',NULL,37,NULL,NULL,NULL,NULL,'<p>This cotton ortromundo Logo T-shirt features :</p>\r\n\r\n<ul>\r\n	<li>a white-tone &quot;ortromundo&#39;&#39; print to the front,</li>\r\n	<li>a printed logo to the rear</li>\r\n	<li>a crew neck, short sleeve&nbsp;</li>\r\n	<li>a relaxed and straight hem</li>\r\n</ul>\r\n\r\n<p><strong>COMPOSITION</strong></p>\r\n\r\n<ul>\r\n	<li>100% cotton</li>\r\n	<li>polyester</li>\r\n	<li>elastane</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',2,NULL,'4Lsg63',NULL,NULL,1,0,1,'2021-04-13 10:28:22','2021-04-21 21:44:23',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(825,'Pouch With Shoulder Strap','pouch-with-shoulder-strap',400000,12,NULL,NULL,NULL,NULL,'<p><strong>DESCRIPTION</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The pouch pays tribute to the Dior Oblique motif, first showcased on the House&#39;s creations in 1967. Crafted in beige and black jacquard, it features a two-way zipped closure at the top and a front pocket with three card slots. A black adjustable and removable shoulder strap adorned with the &#39;Christian Dior&#39; signature and made with technical fabric jacquard is completed by two ruthenium-finish brass snap hooks. An embossed &#39;DIOR&#39; signature is present on the streamlined and spacious interior with a patch pocket to safely hold your essentials. The pouch is a modern piece that will add a touch of elegance to any outfit.</p>\r\n\r\n<ul>\r\n	<li>Beige and black Dior Oblique jacquard</li>\r\n	<li>Exterior ruthenium-finish brass &#39;DIOR&#39; signature</li>\r\n	<li>Embossed &#39;DIOR&#39; signature on interior</li>\r\n	<li>Ruthenium-finish brass two-way zip closure</li>\r\n	<li>Removable and adjustable &#39;Christian Dior&#39; technical fabric jacquard and calfskin shoulder strap</li>\r\n	<li>Front zip pocket with three card slots</li>\r\n	<li>Interior patch pocket</li>\r\n	<li>Dimensions: 17&nbsp;x&nbsp;12.5&nbsp;x 5 cm</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'qnG6N8',NULL,1,1,0,0,'2021-04-13 10:42:09','2021-04-21 21:40:55',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/XIr7JELz37EpQmUWTzCVCIzzGaXhmBO07VC9bUsP.jpg',NULL,NULL,'simple',0,''),(826,'Clear Lens  Rose Gold Glasses','clear-lens-rose-gold-glasses',250000,8,NULL,