s from Balenciaga. Crafted from smooth black napa leather, these shoes have a draped design with a knot detail and an easy slip-on style. Feel and look good.</p>\r\n\r\n<h4><strong>Highlights</strong></h4>\r\n\r\n<ul>\r\n	<li>black</li>\r\n	<li>leather</li>\r\n	<li>80mm</li>\r\n	<li>draped design</li>\r\n	<li>open toe</li>\r\n	<li>open back</li>\r\n	<li>slip-on style</li>\r\n	<li>high sculpted heel</li>\r\n</ul>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>Outer: Leather 100%</p>\r\n\r\n<p>Lining: Leather 100%</p>\r\n\r\n<p>Sole: Leather 100%</p>\r\n\r\n<p>&nbsp;</p>',2,NULL,'Lne16m',NULL,NULL,1,0,1,'2021-04-17 08:16:24','2021-04-17 08:16:24',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'38'),(842,'Black Rubber Footbed','black-rubber-footbed',NULL,8,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Sandals with wide strap.</li>\r\n	<li>The polyurethane footbed is lightweight and extremely flexible.</li>\r\n	<li>Non-slip rubber sole.</li>\r\n	<li>Made of black rubber.</li>\r\n	<li>The strap features a mix of textures with embossed diagonal FF motif.</li>\r\n</ul>\r\n\r\n<p><br />\r\nMade in Italy</p>',2,NULL,'GL8LMo',NULL,NULL,1,0,1,'2021-04-17 08:28:29','2021-04-21 21:00:57',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'39'),(843,'White Leather Low-tops','white-leather-low-tops',NULL,8,NULL,NULL,NULL,NULL,'<ul>\r\n	<li>Lace-up sneakers.</li>\r\n	<li>Rubber cupsole.</li>\r\n	<li>Made of white leather, with fabric inserts with FF motif in brown and tobacco on the outside.</li>\r\n	<li>Embellished with red leather details.</li>\r\n	<li><strong>Composition:</strong>100% Calfskin, material 2: 65% Polyamide, 35% Cotton, coating: 100% Resin,</li>\r\n	<li>inside: 100% Polyester</li>\r\n</ul>\r\n\r\n<p>Made in Italy</p>',2,NULL,'l6Pthm',NULL,NULL,1,0,1,'2021-04-17 08:35:12','2021-04-21 20:56:02',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'42'),(844,'Cosy Bb Flat Carrera Leather Mules - Black','cosy-bb-flat-carrera-leather-mules-black',NULL,11,NULL,NULL,NULL,NULL,'<p>Being grounded isn&#39;t necessarily a bad thing. Especially if we&#39;re talking about these black leather Cosy BB flat mules from Balenciaga. Possessing a comfortable flat sole, you&#39;ll feel as if you&#39;re kissing the earth with your feet. How amazing is that? Featuring a square toe, a slip-on style, a flat sole, a brand debossed insole and a black-tone BB appliqu&eacute; to the front.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<ul>\r\n	<li>Outer: Leather 100%</li>\r\n	<li>Lining: Leather 100%</li>\r\n	<li>Sole: Leather 100%</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>',2,NULL,'oizIjR',NULL,NULL,1,0,1,'2021-04-17 09:03:36','2021-04-17 09:03:36',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(845,'Cosy BB Crocodile-Effect Mules','cosy-bb-crocodile-effect-mules',NULL,11,NULL,NULL,NULL,NULL,'<p>Time to put those acting skills into practice. Shed some crocodile tears until someone finally gives in and gets you these black leather Cosy BB crocodile-effect mules from Balenciaga. Lights, Camera, Action! Featuring a slip-on style, a flat leather sole, an embossed crocodile effect, a square toe, a front logo plaque and a brand embossed insole.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<ul>\r\n	<li>Outer: Leather 100%</li>\r\n	<li>Lining: Leather 100%</li>\r\n	<li>Sole: Leather 100%</li>\r\n</ul>',2,NULL,'wS1zpv',NULL,NULL,1,0,1,'2021-04-17 09:17:00','2021-04-17 09:17:00',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(846,'Cosy BB-plaque leather backless loafers','cosy-bb-plaque-leather-backless-loafers',NULL,11,NULL,NULL,NULL,NULL,'<p>Balenciaga&#39;s black Cosy loafers are hallmarked with the signature silver BB plaque which was first introduced in the 1970s. They&#39;re made in Italy from smooth leather to a backless silhouette with a squared toe. Draw focus to the graphic adornment by styling them with black staples.</p>\r\n\r\n<ul>\r\n	<li>COLOUR: Black</li>\r\n	<li>COMPOSITION: Leather.</li>\r\n	<li>COUNTRY OF ORIGIN: Italy</li>\r\n	<li>BB plaque</li>\r\n	<li>Square toe</li>\r\n	<li>Black leather sole</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>',2,NULL,'yZ0fa3',NULL,NULL,1,0,1,'2021-04-17 09:24:47','2021-04-21 20:52:16',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'43'),(847,'Cosy Crisscross Sandals In Croc-Print Leather','cosy-crisscross-sandals-in-croc-print-leather',NULL,11,NULL,NULL,NULL,NULL,'<p>A timeless offering from the French label, Balenciaga&#39;s Cosy sandals are crafted from croc-print leather with crossover straps in black which will complement your summer edits with ease.</p>\r\n\r\n<ul>\r\n	<li>Polished croc-embossed leather sandals in black.</li>\r\n	<li>Open round toe.</li>\r\n	<li>Logo printed in white at outer side.</li>\r\n	<li>Grained leather footbed.</li>\r\n	<li>Tonal leather sole with rubber injection at heel.</li>\r\n</ul>',2,NULL,'8yIMjq',NULL,NULL,1,0,1,'2021-04-17 09:44:20','2021-04-21 20:46:43',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'41'),(848,'LA Medusa Small Handbag','la-medusa-small-handbag',650000,7,NULL,NULL,NULL,NULL,'<p>Crafted in Italy from premium leather, Versace&#39;s latest handbag is adorned with a Medusa plaque &ndash; the same d&eacute;cor that was discovered on the doors of the brand&#39;s first headquarters in Milan. The slouchy silhouette can be styled on the wrist or across the shoulder, featuring two detachable shoulderstraps: one leather and one chain</p>\r\n\r\n<p>DETAILS</p>\r\n\r\n<ul>\r\n	<li>La Medusa plaque</li>\r\n	<li>Top handle</li>\r\n	<li>Leather shoulder strap</li>\r\n	<li>Chain shoulder strap</li>\r\n	<li>Magnetic button closure</li>\r\n	<li>Flat internal pocket</li>\r\n	<li>Outer fabric: 100% Leather</li>\r\n	<li>Lining: 100% Leather</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'F5Gtb0',NULL,1,1,0,0,'2021-04-17 09:51:10','2021-04-17 09:51:10',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/gRW2J2XCqlVAg1J9dd8yUCIZKaVFWoUOqoH9PGgS.jpg',NULL,NULL,'simple',0,''),(849,'LA Medusa Small Handbag - Pink','la-medusa-small-handbag-pink',650000,7,NULL,NULL,NULL,NULL,'<p>Crafted in Italy from premium leather, Versace&#39;s latest handbag is adorned with a Medusa plaque &ndash; the same d&eacute;cor that was discovered on the doors of the brand&#39;s first headquarters in Milan. The slouchy silhouette can be styled on the wrist or across the shoulder, featuring two detachable shoulderstraps: one leather and one chain</p>\r\n\r\n<ul>\r\n	<li>La Medusa plaque</li>\r\n	<li>Top handle</li>\r\n	<li>Leather shoulder strap</li>\r\n	<li>Chain shoulder strap</li>\r\n	<li>Magnetic button closure</li>\r\n	<li>Flat internal pocket</li>\r\n	<li>Outer fabric: 100% Leather</li>\r\n	<li>Lining: 100% Leather</li>\r\n	<li>Made in Italy</li>\r\n</ul>',2,NULL,'6iEAbZ',NULL,1,1,0,0,'2021-04-17 10:09:44','2021-04-21 21:58:22',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/Zn6I7HHSwBbMuTrb7trQOpEQuE0wgjTTG60SnQY1.jpg',NULL,NULL,'simple',0,''),(850,'Quilted Virtus Leather Shoulder Bag','quilted-virtus-leather-shoulder-bag',500000,7,NULL,NULL,NULL,NULL,'<p>&bull; V-shaped quilted sheepskin design<br />\r\n&bull; Virtus Barocco emblem in gilded brass<br />\r\n&bull; Removable chain shoulder strap<br />\r\n&bull; Magnetic snap closure<br />\r\n&bull; Flat internal pockets<br />\r\n&bull; Embossed logo inside<br />\r\n&bull; Barocco lining</p>',2,NULL,'Vrn51X',NULL,1,1,0,0,'2021-04-17 11:57:57','2021-04-21 22:01:43',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/YPrOz9vhb5r9NZgf0uM79TFRoM5Whb9egJo8F0Rl.jpg',NULL,NULL,'simple',0,''),(851,'Exodus Track Jacket','exodus-track-jacket',300000,36,NULL,NULL,NULL,NULL,'<p>Looking for a way to work some loungewear magic? Well, the colour blacke is associated with magic powers, so we believe this Palm Angels track jacket is the answer. No wand needed.</p>\r\n\r\n<ul>\r\n	<li>Long sleeves track jacket in black with &#39;&#39;Palm Angels&#39;&#39; logo printed at the chest&nbsp;</li>\r\n	<li>Rib knit cuffs</li>\r\n	<li>Collar and hem</li>\r\n	<li>Zip closure</li>\r\n	<li>Two zip pockets</li>\r\n	<li>Green, yellow, and red strpies at sleeves</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',2,NULL,'XJLVCs',NULL,1,1,0,0,'2021-04-17 12:27:07','2021-04-21 20:42:04',NULL,0,NULL,NULL,'https://theluxurysale.com/images/products/YmdLEjVbrfNmJsD7IJSnCdNyC4zqFrfYYCFpYix3.webp',NULL,NULL,'variable',0,'S,M'),(852,'Black Track Pants','black-track-pants',NULL,36,NULL,NULL,NULL,NULL,'<p>Keep your wardrobe LA-cool. These black logo track pants from Palm Angels will make sure you&#39;re on par with the Venice beach skaters. Laid-back luxury done right.</p>\r\n\r\n<h4>Highlights</h4>\r\n\r\n<ul>\r\n	<li>black</li>\r\n	<li>side stripe detailing</li>\r\n	<li>logo print embellishment</li>\r\n	<li>elasticated waistband</li>\r\n	<li>two side slit pockets</li>\r\n</ul>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Outer: Polyester 100%</p>\r\n\r\n<p>Lining: Polyester 100%</p>\r\n\r\n<p>&nbsp;</p>',2,NULL,'mKdCIQ',NULL,NULL,1,0,1,'2021-04-17 12:49:09','2021-04-20 08:29:41',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'S,M'),(853,'Come Here Pin Up Shirt','come-here-pin-up-shirt',NULL,22,NULL,NULL,NULL,NULL,'<p>Fallen out of love with your wardrobe? Inject some romance again with this black silk Come Here pin up shirt from Dolce &amp; Gabbana that is bound to be an SS20 favourite of yours with its flowy design. Featuring notched lapels, a graphic print, a front button fastening, a chest pocket, a relaxed fit, short sleeves and a printed logo to the rear.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>Silk 100%</p>',2,NULL,'p5IS6L',NULL,NULL,1,0,1,'2021-04-28 17:06:12','2021-04-28 17:06:12',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L'),(854,'Pin-Up Print Cady Shirt','pin-up-print-cady-shirt',NULL,22,NULL,NULL,NULL,NULL,'<p>Some say love is the only thing in this world that doesn&#39;t go out of fashion - for us, it&#39;s this Dolce &amp; Gabbana shirt. Boasting a fun &lsquo;50s pin-up print to brighten your days, it&#39;s a given that your heart will grow fond for this piece. It was meant to be.</p>\r\n\r\n<h4>Highlights</h4>\r\n\r\n<ul>\r\n	<li>multicoloured</li>\r\n	<li>classic collar</li>\r\n	<li>front button fastening</li>\r\n	<li>contrasting pin-up print</li>\r\n	<li>short sleeves</li>\r\n	<li>straight hem</li>\r\n</ul>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4><strong>Composition</strong></h4>\r\n\r\n<p>Viscose 100%</p>',2,NULL,'CmRkIk',NULL,NULL,1,0,1,'2021-04-28 17:13:54','2021-04-28 17:13:54',NULL,0,NULL,NULL,NULL,NULL,NULL,'variable',0,'L');
