INSERT INTO `reviews` VALUES (19,220,NULL,100,'I\'m into my third week of using your 14-Day teatox and i am already very happy with my results.  This tea literally removes my bloat. This is my favorite product.','','2020-05-10 21:15:51','2020-05-10 21:15:51',NULL,7,NULL),(22,222,NULL,100,'Your protein shake is so nice and super amazing, i take it for breakfast and dinner daily and it literally powers me for hours. I have lost so much weight using just the shakes. This product is a must have if you are trying to watch your daily calories.','','2020-05-11 18:03:42','2020-05-11 18:03:42',NULL,9,NULL),(28,217,NULL,80,'This coffee is one of the best purchase I’ve ever made. It works wonders and was extremely beneficial for my body. I’ve never felt so great about any weight loss product. I lost 16kg in a month. I’m still in shock. Ohram Works!','','2020-05-15 02:22:53','2020-05-15 02:22:53',NULL,12,NULL),(29,213,NULL,100,'I and my husband have been using this tea and we have lost so much weight. Trust me I’m not the type of person to order stuff online or go by stuff that people post but this tea has helped me and my husband so much with our weight loss goals! it makes me feel light and helps with the digestive system. I highly recommend this product to anyone who wants to lose weight or remove bloats. It will give you so much energy even after a workout and it’s crazy.','','2020-05-15 03:01:23','2020-05-15 03:01:23',NULL,13,NULL),(30,220,NULL,100,'Normally, I do not believe in products like this work, but I decided to try it out and I’m so happy I did. This tea will give you value for your money, I am not even joking. Apart from your slim coffee, this is my best because it flushes out everything I eat and eliminate my bloat. I legit recommend this product.','','2020-05-15 06:02:03','2020-05-15 06:02:03',NULL,14,NULL),(31,217,NULL,100,'If you are looking for a product to help you lose weight fast, Ohram slim diet coffee is what you need. This coffee will burn and dry up your fat, it also helps to curb my huge appetite for food.','','2020-05-15 17:07:38','2020-05-15 17:07:38',NULL,15,NULL),(32,217,NULL,80,'I am happy with the result i got from using your slimming coffee, keep up the good work. #bestweightlossproduct','','2020-05-15 22:10:18','2020-05-15 22:10:18',NULL,17,NULL),(33,221,NULL,100,'Hae from the UK. This pills works wonders, it curbs my appetite so well and it scares me because I am a foodie. Lolll.... This slimming pills are my favorite 👌🏻','','2020-05-15 22:26:41','2020-05-15 22:26:41',NULL,19,NULL),(34,220,NULL,100,'I ordered this tea, the protein shakes and slim diet coffee for myself and my wife two months ago from Canada. Ohram products truly works and their customer service is topnotch.','','2020-05-15 22:31:45','2020-05-15 22:31:45',NULL,18,NULL),(35,223,NULL,80,'This shakes taste so good and its really filling.','','2020-05-15 22:37:54','2020-05-15 22:37:54',NULL,20,NULL),(36,217,NULL,60,'You pple said I would burn all my tummy fat hmmm. I bought two parks and my tummy is not very flat yet. Although I lost a few pounds and have been avoiding all my eba... I hope to get the best result soon. 🚶🏿‍♂️🚶🏿‍♂️🚶🏿‍♂️🚶🏿‍♂️','','2020-05-15 22:44:05','2020-05-15 22:44:05',NULL,21,NULL),(37,217,NULL,100,'I have been on and off this product for years it is super effective, curbs my appetite and stops my cravings. If you are a coffee lover and want to lose weight this is what you should get. Good product, great taste.','','2020-05-15 22:50:37','2020-05-15 22:50:37',NULL,22,NULL),(38,214,NULL,100,'The best protein shakes. So delicious, i\'m stock with this forever!','','2020-05-15 23:04:56','2020-05-15 23:04:56',NULL,23,NULL),(39,215,NULL,80,'These capsules are magic! Been on’ em for a month now and I’m still in shock of the results! Thank u Ohram! ❤️❤️😁','','2020-05-15 23:11:59','2020-05-15 23:11:59',NULL,25,NULL),(40,213,NULL,80,'If you want to start your weekend off Right, use this product. It will melt all your tummy fat. This product is my favorite.','','2020-05-15 23:12:22','2020-05-15 23:12:22',NULL,24,NULL),(41,213,NULL,100,'I have been using this flat tummy teatox and shakes for a month now, and I am loving it. With exercising and eating right its working great.','','2020-05-15 23:20:04','2020-05-15 23:20:04',NULL,26,NULL),(42,221,NULL,100,'My journey so far on these pills have been incredible! I’ve lost 8kg so far in just a month. Amazing amazing amazing product. 😅','','2020-05-15 23:30:29','2020-05-15 23:30:29',NULL,27,NULL),(43,217,NULL,100,'No matter what way you look at it, Ohram game is pretty strong 💪🏻. They are the best in the game, great products, great customer service, and quick delivery 👍🏼👏🏼💕💕💕💕💕💕💕💕💕💕','','2020-05-15 23:45:20','2020-05-15 23:45:20',NULL,28,NULL),(44,220,NULL,80,'I\'m currently taking this tea and its already working tremendously. This teatox is everything, it cleans and detoxifies.','','2020-05-16 04:22:45','2020-05-16 04:22:45',NULL,32,NULL),(45,217,NULL,100,'The best weight loss coffee. I love the taste, and how it helps to boost my metabolism. I was introduced to it in February and I have dropped two dress sizes. This product works most especially when it’s combined with a good diet and exercise. 🔥🔥❤️❤️❤️❤️❤️👍🏽','','2020-05-16 22:46:56','2020-05-16 22:46:56',NULL,33,NULL),(46,217,NULL,100,'The best weight loss coffee. I love the taste, and how it helps to boost my metabolism. I was introduced to it in February and I have dropped two dress sizes. This product works most especially when it’s combined with a good diet and exercise. 🔥🔥❤️❤️❤️❤️❤️👍🏽','','2020-05-16 22:47:18','2020-05-16 22:47:18',NULL,33,NULL),(47,227,NULL,80,'Your loagos','','2020-05-20 13:57:03','2020-05-20 13:57:03',NULL,7,NULL),(48,220,NULL,80,'HIe','','2020-05-20 17:24:03','2020-05-20 17:24:03',NULL,7,NULL),(49,220,NULL,100,'Hi','','2020-05-20 17:33:45','2020-05-20 17:33:45',NULL,7,NULL),(50,227,NULL,100,'hii','','2020-05-20 17:36:24','2020-05-20 17:36:24',NULL,7,NULL),(51,227,NULL,100